('11fc6c9d-7b77-1348-1f61-5535607db095', 'RA350-Upper Terrace Cottage', 'ra350-upper-terrace-cottage-2', 'Located on the ground floor of a uniquely beautiful San Francisco residence, this unit has old world charm plus all the modern conveniences in a private, quiet neighborhood.\n\nUpper Terrace Cottage is centrally located, offering easy access to all of San Francisco while nestled in exclusive Ashbury Heights.  Enjoy glorious views from Buena Vista Park and nearby Twin Peaks, or stroll down the hill to shopping, dining, and entertainment in nearby Cole Valley, Castro or the world-famous Haight-Ashbury district. Golden Gate Park is also nearby, with world-class museums like the De Young and the Cal Academy of Sciences, and year-round activities. Quick commute to downtown via public transportation.This unit comes fully furnished and accessorized for day to day living.Amenities include:Full kitchen with pots, pans, utensilsCoffee Maker, Toaster, Dishwasher, Gas oven and cook top, large refrigerator and microwaveWireless high-speed InternetDedicated phone with free local and domestic long distance callingThree televisions, with the main living room and bedroom flat-screen televisions with full cable packages, featuring HBO, Showtime and other pre-purchased showsPrivate entrance to the unit via a separate access off of a charming pathwayPlease note: Rentals of 7 days or more require a weekly maid service at an additional $50/week.\n                    Unit Sleeps Two guests and bookings for more than two guests are not accepted', 'United States', 'California', 'San Francisco', '', '', '94117', '37.765481', '-122.443031', NULL, 0, '', 0, '0', 2, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', 'b1667c1f-9e1f-85f3-9682-55317452e139', 1, 1, 'Y', 'N', 0, '2015-04-20 22:25:49', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:25:49', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('14180685-c9fa-4730-ad53-553563f00fcc', 'RA407-Glenrock Town Home', 'ra407-glenrock-town-home-2', 'You''ll love this cute and cozy, economy rated 3 bedroom town home at Glenrock. This great rental is just steps away from the community swimming pool (summer only) and the Golf Course.The property has been partially remodeled and thoughtfully decorated, and includes high speed wireless internet access (subject to connectivity). In addition to the on-site swimming pool, you''ll enjoy access to Incline''s exclusive, private beaches and 2 world class golf courses. Diamond Peak ski area, the Hyatt resort casino, and excellent dining and shopping are also just minutes away! This is a perfect rental for your budget minded summer or winter Lake Tahoe vacation getaway.The home is nicely furnished and equipped, with all the cookware and linens you''ll need to relax and enjoy a memorable experience in gorgeous Lake Tahoe. Downstairs you''ll find the cozy living room with a gas fireplace on a stone hearth, comfy sofas, TV with DVD player, and access to the gas BBQ (summer only) on the back patio, set among large granite boulders.The dining area and kitchen are also downstairs, along with a half bath and laundry area with washer/dryer. All 3 bedrooms are upstairs. The master bedroom offers a king bed, TV, writing desk, and attached full bathroom. The 2nd bedroom and 3rd bedrooms each have a full sized bed and tasteful furniture. There is also another full bathroom with tub and shower upstairs.This home comes with IVGID beach passes, allowing guests to access Incline Village''s renowned private beaches for a daily use fee. Guests must bring the provided passes to the entry kiosks where the entry fee is charged. One of the two beaches offers beach volleyball, swimming pool and snack stand. Use of the boat launch is also available with the beach pass. Please note- there is no garage available for this home. There are 2 assigned parking spaces available with this property.Book 3 nights and get the 4th free (excluding holiday weeks). ', 'United States', 'Nevada', 'Incline Village', '', '', '89451', '39.260709', '-119.944050', NULL, 0, '', 0, '0', 5.5, 3, 2.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '631c13a2-1961-0d99-7cd7-553184a48eb8', 1, 1, 'Y', 'N', 0, '2015-04-20 22:39:07', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:39:07', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('14af42dc-4e9d-c11c-abe0-553559755206', 'RA346-Chauvet Condo 3A', 'ra346-chauvet-condo-3a-1', 'Hotel Chauvet was originally built in 1906 and celebrated its centennial with a spectacular restoration and renovation, painstakingly accomplished over two years. The result is a historic landmark building with six luxurious vacation rentals, rejuvenated with locally made brick and reappointed by craftsmen, while upscale interior and state-of-the art amenities have been added.The lodging experience at The Chauvet is truly unique! Each unit is generously sized at almost 2,000 square feet. The large master bedrooms include a huge walk-in closet. The other two bedrooms in each unit are spacious as well. Both baths boast designer fixtures but the master features a jetted tub and separate glass enclosed shower with massage jets and rainhead.The kitchen would please any gourmet, and is outfitted with custom cabinetry, stainless steel appliances, granite counter tops, wine cooler and commercial-style gas cooktop, among other delights. Of course, if you don''t want to cook for yourself, you are just steps away from Glen Ellen''s "restaurant row" with a myriad of delicious choices... or walk across the street to Glen Ellen''s own gourmet market.A brief walk south brings you to Jack London Village with the local cheesemonger, chocolate shop (made on site), olive press and market, fantastic deli, market of locally produced gourmet items and another tasting room. Add to this vision the lovely outdoor, heated pool with sundeck patio, accessible from your own wide balcony off the master bedroom, and the views of the surrounding hillsides and native oak trees from every large picture window framed by brick arches.You will be more than comfortable at The Chauvet at any time of year, with energy efficient air conditioning and heating, a gas fireplace, full soundproofing, elevator access and private garage.The unit features: 3 bedrooms, master with king sized bed, 2nd bedroom with queen and the 3rd bedroom with a king sized bed that can convert to two twins upon request in five of the units. Queen sized sofa bed in living room of Unit 1B. 3rd bedroom in 2B only features a twin day bed with a pop up trundle (which can be made up as an Eastern king on request), couch and chaise. 2 luxurious bathrooms - the master has jetted tub, glass enclosed shower with shower panel featuring rain head and massage jets along with European style hand held.Ample closet space throughout, walk-in closet in master bedroomGourmet kitchen and formal dining space, with every amenityGas fireplace in living room, energy efficient central heat and air conditioningHeated outdoor pool surrounded by sun deckWide, private balcony with dining table & chairs, propane BBQWireless internet accessCable with expanded channels and on-demand movies (and a TV in each bedroom and living room)Designer furnishings and dramatic artwork from local artistsPaintings by local artists are exhibited in the unitsSumptuous beds with luxurious linens, and thick & thirsty towelsElevator access, intercom, covered parking in private garageWasher & dryer in the unitCentral location to wineries & tasting rooms, restaurants, farmers'' and gourmet markets - walk or bike within the charming village of Glen EllenLess than a mile from Jack London State ParkIncluded with your stay are complimentary:a bottle of wine and chocolatescookies in the cookie jarcoffee, tea, juice, yogurt, granola and fresh fruitwine passes for six to Arrowood, Chateau St. Jean, Gary Farrell and Taft Street Wineryreserve tastings at Cline and Jacuzzi2 for 1 tastings at Buena Vista, Geyser Peak, Gundlach Bundschu, and Ravenswoodupgraded tastings at LedsonSonoma Valley B & B Association passport for complimentary tastings for each guest at 25+ Sonoma Valley wineries\nPlease note: The pool is open year-round, however is not heated Nov. 1 through May. 14, per County regulations.\n\n Rates reduced for longer stays: Peak 4-5 nights $595/night, 6+ nights $550/night.  Off peak 3-5 nights $495/night, 6+ nights $450/night.  Balance will be adjusted with the final billing.You can also view Condo 1A, Condo 1B, Condo 2A, Condo 2B, and Condo 3B. for larger groups or other available dates. TOT 848N, 849N', 'United States', 'California', 'Glen Ellen', '', '', '95442', '38.362343', '-122.525923', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 21:53:00', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:53:00', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('15cdd801-a669-308b-ac1c-553569b8c167', 'RA494-Chateau Sans Nom, an Excellent 4 Bedroom Condo with Views', 'ra494-chateau-sans-nom-an-excellent-4-bedroom-condo-with-views', 'This two level, four bedroom condominium has a very nice interior with a view of trees and some mountains. There is a fully equipped kitchen, balcony, 5 TVs, 5 VCRs, 5 DVDs, CD player, washer/dryer, telephone (local calls only), woodstove (firewood provided) and wireless high speed internet. Three bedrooms are located on the first floor. The first bedroom has a king bed and flat screen TV. The second bedroom has a queen. The third bedroom has a set of bunk beds and a trundle bed (2 twins). There are two bathrooms on the first floor. The fourth bedroom with the king bed is located on the second floor with a bathroom next door. This unit is non-smoking and has two outside parking spaces behind the condo. The Manager is not responsible for common area facilities at the complex (i.e. spa, sauna, pool, recreation room, etc.). Common area facilities vary at each complex. ', 'United States', 'California', 'Mammoth Lakes', '', '', '93546', '37.637073', '-118.971185', NULL, 0, '', 0, '0', 7, 4, 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-20 23:02:22', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 23:02:22', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('1704468c-4cfd-f483-4002-5532befdbeac', 'RA192-Venice Drive Mountain View', 'ra192-venice-drive-mountain-view', 'You don''t have to think twice about booking this large home in the Tahoe Keys!  A 4 bedroom beauty with incredible views of the mountains and meadow you''ll have it all plus the amenities available to people who book this exclusive community.   Nicely furnished, great for families or large groups, free local and long distance calls, as well as Wireless Internet ensures that you have everything you need at this home away from home.The expansive central living room offers fantastic views of the meadow and mountains while you toast your toes in front of the woodstove.  The open floor plan means that you can help prepare a meal in the fully equipped kitchen while watching a movie on the huge widescreen TV/DVD player with your family.  The dining area has two full sized tables plus bar seating, which will accommodate those extra friends that stop by.   In the warmer weather step out on the deck and take in the views before firing up the BBQ for a cook-out. If the excitement is too much for the kids, there is a cozy smaller living area where they can watch movies and play games.After a long day of skiing, boating, or basking by the pool, you''ll be pleased with the 4 cozy bedrooms (one King, two Queens, and one bedroom with two Twins), and if your group is extra large there is a Queen sized sofa bed.  Please keep in mind that the maximum sleeping capacity for this home is 10. Permit number: VHR#102057', 'United States', 'California', 'South Lake Tahoe', '', '', '96150', '38.931575', '-120.013516', NULL, 0, '', 0, '0', 6.5, 4, 2.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-18 22:29:17', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:29:17', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('185420e7-11f9-f180-3d86-5535665473b8', 'RA439-Wolfgang Family Retreat', 'ra439-wolfgang-family-retreat', 'This high-end luxury home is great for one or more families. Near world-class Tahoe Donner cross country skiing and Equestrian Center.\n\nEntry level:\n-Large living room with TV/DVD/iPOD station, big comfy couches, wood fireplace and lots of light. Living room opens to beautiful dining area with hand carved wood table and seating for the entire group.\n-The newly remodeled kitchen has granite counter tops and stainless steel appliances, including a double oven, gas stovetop, microwave, large fridge and fully stocked kitchen\n-The master bedroom has a Cal King bed with TV and an attached bathroom with a jetted tub, separate shower, double sinks and walk in closet.\n-The entry has a mud room with storage for skis, coats and boots.\n-There is a half bathroom, laundry room and a 2 car garage on this level as well\n- The hot tub sits outside on a large sunny deck surrounded by beautiful pine trees. Propane BBQ set up for summer rentals.\n\nUpper Level:\n-Loft with TV/DVD/Wii. The loft also has a Queen sofa couch available if needed.\n-Bedroom with Regular King bed\n-Bedroom with one Bunk Bed (2 twin mattresses) plus one twin bed with twin Trundle - this room can accommodate 4 people\n- Shared bathroom with Shower / Tub combo\n\nLower Level:\n- Billiard room with TV/DVD and gas fireplace\n- Bedroom with Queen bed\n- Full bathroom with Shower /Tub\n- Lower deck\n\nThis house is set up for families with a Wii game system, lots of board games and DVD''s, crib, high chair, Pak-n-Play, booster seat and plastic cups and plates.\n\n-Hi Speed Wireless Internet! (connection cannot be guaranteed)\n-Outdoor hot tub \n\nBook 3 nights and get the 4th night free (except for holiday weeks).', 'United States', 'California', 'Truckee', '', '', '96161', '39.368770', '-120.252448', NULL, 0, '', 0, '0', 7.5, 4, 3.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-20 22:51:23', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:51:23', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('198338d3-b8ab-20c6-9ea0-55356b2433a9', 'RA506-Juniper Springs #304', 'ra506-juniper-springs-304', 'It''s all about location in this quaint one-bedroom, one-bath condominium at Juniper Springs featuring ski in/ski out access to Eagle Express. This unit features: a fully equipped kitchen, dining for four, gas fireplace, wireless interenet, sofa sleeper, TV with DVD/VCR combo in each room, and a full-extended covered patio (one of few units that have a patio this size) overlooking the pool area and the Sherwin Mountains. The Master bedroom has a King-size bed. Juniper Springs offers underground parking with elevators, a large Hearth room, laundry facilities, ski lockers, and during the summer an outdoor pool, spa, and BBQ. This unit is non-smoking. ', 'United States', 'California', 'Mammoth Lakes', '', '', '93546', '37.635516', '-118.990168', NULL, 0, '', 0, '0', 2, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 23:11:06', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 23:11:06', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('19b371f7-db70-765e-8b7b-55356326b5e5', 'RA403-Fairway Family Cabin', 'ra403-fairway-family-cabin-2', 'This adorable cabin is the perfect mountain getaway. Located right on the 16th fairway, it is quiet and peaceful, and comes with so many amenities! On the Entry level the Living room has a 32" flat-screen TV/DVD with full stereo system, quality furniture, a Double sleeper sofa and real wood stove. The Dining room has seating for 12 with two additional barstools. The Kitchen is fully equipped, including an Espresso machine and pass-through bar.\n\nThe first Bedroom has 1 Queen, the second bedroom has 1 Queen, and they chare a full bath with tub.  Upstairs you will find a loft with a Double futon for extra guests, and a third bedroom with 2 bunk beds, 2 extra Twins, and a Twin sized sleeper sofa (sleeping a total of 7).  There is also a second full bath with tub.  There is a charcoal BBQ available for summer guests.   This rental includes access cards for the Tahoe Donner Recreation Center resident amenities. A nominal charge applies for some activities. Book 3 nights and get the 4th free (excluding holiday weeks).  \n\nThis cabin provide Hi Speed Wireless Internet! (connection cannot be guaranteed)\n-Access to Tahoe Donner amenities (for nominal fee) including Rec center with work-out facility pools and hot tub, downhill ski area (perfect for teaching kids!), cross country ski area, equestrian center, tennis center, 18-hole golf and driving range, hiking, and so much more!\n-Mins from downtown Truckee!\n-Approx. 20 mins to Sugarbowl ski area, 30 mins to Squaw, 15 mins to Northstar, and 40 mins to Lake Tahoe This home comes complete with full kitchen and all linens/towels. \n\nNo Smoking. No Pets.', 'United States', 'California', 'Truckee', '', '', '96161', '39.344927', '-120.240722', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 