('1ada4fc1-2d47-9720-596d-5535604e5fe7', 'RA348-Venice Drive Escape', 'ra348-venice-drive-escape-2', 'Nicely furnished, family style home with a boat dock and access to Tahoe Keys amenities (nominal fee charged). Cute country decor throughout the house. Close to all of the Venice homes for larger groups. This 4 bedroom, 2.5 bath has a King bed in the master bedroom, a Queen in the second bedroom, and three twins in the "bunk room," with a Queen-sized sleeper sofa in the separate TV room.The South Lake Tahoe area features world-class ski resorts, hiking trails, parks, beaches, restaurants, recreation, boating and numerous other tourist attractions, as well as the nearby casinos of Stateline. A perfect year round vacation destination, with fantastic weather and breathtaking scenery.\n\nPermit number: VHR#103358 ', 'United States', 'California', 'South Lake Tahoe', '', '', '96150', '38.930964', '-120.022110', NULL, 0, '', 0, '0', 7, 4, 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-20 22:24:22', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:24:22', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('1bb93244-5927-ecbf-4f24-5532c452c5b3', 'RA222-Spacious Beaver Pond Northstar Home', 'ra222-spacious-beaver-pond-northstar-home-1', 'Come and enjoy this spacious home at Northstar Ski Resort. The first level has a remodeled kitchen, full bath, half bath, dining area, living room and two bedrooms.The living room is sunken off from the dining area and is a great place for gathering and entertaining next to the fireplace. The livingroom has a TV with a VCR and DVD player for those nights you feel like staying in and watching a movie.The first bedroom on the first level hosts a double size bed and a twin size bed. The second bedroom features a queen size bed. The second level of the home hosts two bedrooms, a full bath, and a loft the looks down into the livingroom. The first bedroom on the second level has a queen size bed. The second bedroom has a double bed and 1 set of bunkbeds. The loft hosts a double size sofa bed and a twin size bed.This home comes with free access to the Northstar home owners recreation center! ', 'United States', 'California', 'Truckee', '', '', '96161', '39.281014', '-120.115682', NULL, 0, '', 0, '0', 6.5, 4, 2.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '631c13a2-1961-0d99-7cd7-553184a48eb8', 1, 1, 'Y', 'N', 0, '2015-04-18 22:54:27', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:54:27', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('1bf284b9-da8b-62bd-351d-55354ec2cd5f', 'RA316-Mandala', 'ra316-mandala-1', 'Great, open, and bright 4 bedroom, 3 bath condo. A perfect vacation spot.\n\nGorgeous lake views from the deck -- just a few feet to Lake Tahoe! Enjoy the pool, hot tub, and tennis courts located right at the unit, or cozy up in the living room in from of a widescreen TV with cable and a DVD player.\n\n\nAmenities\nDVD player, Lake View, Parking, Ski, Stereo, Telephone, TV(s), Vacuum Cleaners, Washer/Dryer, Lake Nearby, Skiing Nearby, Golf Nearby, Boating, Games, Horseback Riding, Balcony, Outdoor Furniture, Fully Equipped Kitchen, Grill, Linens, Hi Def Television, Satellite/Cable Television, Wireless Internet, Adventure, Shopping, Photography, Gambling, Child Friendly, Elderly Friendly, Groups, No Smoking, No Pets, Heat Only, Community Pool, Community Hot Tub, Community Tennis, Designated Parking, Books, Skiing, Cycling, Mountain Biking, Water Skiing, Diving, Surfing, Wind-Surfing, Para-gliding, Swimming, Roller Blading, Tennis, Horse Riding, Sailing, Walking, Terrace, Fishing, Golf', 'United States', 'California', 'Tahoe City', '', '', '96145', '39.183668', '-120.118018', NULL, 0, '', 0, '0', 7, 4, 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', 'd3e20359-89bd-8249-981e-553180c9fde7', 1, 1, 'Y', 'N', 0, '2015-04-20 21:05:49', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:05:49', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('1c8d29c4-80b9-5bfd-2493-5535547bda09', 'RA384-Aspen Grove Townhouse', 'ra384-aspen-grove-townhouse', 'This comfortable Northstar condo is perfect for families and is conveniently located just minutes away from the Village, recreation center and lifts. On the entry level you''ll find one bedroom with a Queen bed and private deck and another bedroom with a Full and Twin bunk bed (can sleep 3), as well as a newly remodeled bathroom with tub and shower.The second floor hosts the living room with "Tahoe Lodge" themed decor. The pull-out sofa sleeps 2, and the comfortable furnishings, 42" flat-creen TV, and deck entry with propane right of the side make for a wonderful gathering area for your group. The kitchen, also on the second level, as all the amenities you could need, and the dining area provides seating for 5.The third floor includes the Master bedroom with a King bed, and a newly remodeled bathroom with an extra sink. Other house-wide amenities include hi-speed wireless internet (though connection cannot be guaranteed), and a full set of linen and towels for your stay.With just a 1/2 mile walk to the Village, and Recreation Center access (for a nominal fee) that includes a Hot Tub, Pool, weight room, and kid''s play room, you can''t find a better location. Enjoy the shopping, dining, iceskating, downhill mountain biking, and the on-demand Northstar shuttle that will take you to see it all!Book 3 nights and get the 4th free (excluding holiday weeks). No Smoking. No Pets', 'United States', 'California', 'Truckee', '', '', '96161', '39.279782', '-120.119018', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 21:32:47', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:32:47', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('1d6c883e-de1d-45ce-41ba-5532bba08212', 'RA155-Tahoe Keys Condo', 'ra155-tahoe-keys-condo', 'This lovely Tahoe Keys condo is clean and comfortably furnished with a full kitchen, a washer and dryer, two bedrooms, and one-and-a-half baths. Two queen beds and two twins complete with fresh linens can accommodate up to six people easily. It also features its own boat dock and a patio overlooking the Tahoe Keys marina, equipped with a gas barbeque.As part of the exclusive Tahoe Keys community, you will have access to the many Tahoe Keys facilities such as the indoor and outdoor swimming pools, basketball court, tennis courts, putting green, playground, beach area and pier. There’s even a hot tub!—the perfect way to unwind after a long day outdoors. And of course, don’t forget the many activities available to you outside of this resort. Visit the snowy slopes of Heavenly, a ski resort less than twenty minutes away by car. Go boating, fishing, or take a lake cruise to enjoy the breathtaking scenery from across the water.For those who don’t want to cook or just enjoy a great dinner out, there are plenty of casual and fine dining options in Lake Tahoe. The Fresh Ketch Lakeside Restaurant located right in the Tahoe Keys Marina combines them both with casual dining at its Seafood Bar and fine dining upstairs with a view of the lake. Then return to your condo to relax by the gas fireplace.Nicely furnished, clean and comfortable condo in the Tahoe Keys with a boat dock. Full bath upstairs w/ both of the bedrooms. Nice sized living area, dining area,full kitchen WIFI. \n\nPermit number: VHR#3326', 'United States', 'California', 'South Lake Tahoe', '', '', '96150', '38.931575', '-120.013516', NULL, 0, '', 0, '0', 3.5, 2, 1.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-18 22:16:55', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:16:55', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('1d907541-c5a6-26f9-b955-5532c07845e3', 'RA227-Spacious Basque Northstar Home', 'ra227-spacious-basque-northstar-home', 'Big spacious 4 bedroom + Loft home in Northstar with Hot Tub!Perfect for 2 families with 2 masters that each have a king. Loft with tv and futon gives kids somewhere to play while you can still hear them, but they aren''t taking over the living room. Also includes access to the Northstar HomeOwners Swim and Racquet Club!', 'United States', 'California', 'Truckee', '', '', '96161', '39.292338', '-120.118787', NULL, 0, '', 0, '0', 7, 4, 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '631c13a2-1961-0d99-7cd7-553184a48eb8', 1, 1, 'Y', 'N', 0, '2015-04-18 22:38:20', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:38:20', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('1e3a0392-eaee-8b6e-8903-553558b8e3ec', 'RA328-Chapman', 'ra328-chapman-1', 'If you''re looking for privacy, space and a sense of getting away from it all, Chapman''s Chalet is sure to fit your needs. This spacious four bedroom Truckee vacation home offers a large greatroom with beautiful forested views, adjacent dining area and fully equipped kitchen with plenty of space for your entertaining needs. Located in a quiet remote corner of Truckee, this rental home enjoys easy access to Northstar Ski Resort and is only minutes from downtown Truckee. You will find one queen guest room on the main level with three addtional rooms upstairs along with a separate loft/family room complete with TV/VCR, children''s video collection as well as an assortment of board games. The master bedroom is complete with an extensive library and work desk or just relax after an envigorating day on the slopes in the private jacuzzi tub. Perfect for large families and groups..\n\nAmenities\nBBQ/Picnic area, Business district, CD Player, Dishwasher, DVD player, Fireplace, Games supplied, Jacuzzi, Microwave, Movies supplied, Stereo, Vacuum Cleaners, Washer/Dryer, Satellite/Cable Television, Wireless Internet, Family, No Pets, Skiing, Walking\n\nActivities\nLibrary', 'United States', 'California', 'Truckee', '', '', '96161', '39.314110', '-120.182335', NULL, 0, '', 0, '0', 7, 4, 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '631c13a2-1961-0d99-7cd7-553184a48eb8', 1, 1, 'Y', 'N', 0, '2015-04-20 21:49:49', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:49:49', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('1e47f0ed-8320-96fa-f2c5-5532b96495db', 'RA76-Central Victorian Lower', 'ra76-central-victorian-lower', 'Please note : this Property requires a 30 day minimum stay\n\nCentral Victorian Lower has charm and flexibility! Located on beautiful Buena Vista Park, this gorgeous Victorian can sleep five people. It is just a few blocks away from the exciting Haight Street shopping area, with its numerous restaurants and shopping opportunities.Central Victorian Lower is a pleasant combination of modern convenience and casual comfort. The location is near the center of the San Francisco, yet the unit is quiet and very safe. Access to many of San Francisco’s attractions are close by, including Golden Gate Park, the California Academy of Sciences, the De Young Museum, and the Conservatory of Flowers.Central Victorian has a large living room with a pull out Queen-sized couch. The dining area features a window overlooking Golden Gate Park. The property boasts a large kitchen, with a small breakfast area. There is also a small office that opens onto a stairway which takes you to the backyard. The master bedroom has a Queen-sized bed and a window with a view towards downtown San Francisco. The second bedroom has a pull out couch, allowing the room to be used in several ways.If available and you need more space, this unit may be rented in addition to Central Victorian 1 Bedroom and Central Victorian 2 Bedroom.\n\nNo parking available', 'United States', 'California', 'San Francisco', '', '', '94117', '37.769107', '-122.443407', NULL, 0, '', 0, '0', 3, 2, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', 'b1667c1f-9e1f-85f3-9682-55317452e139', 1, 1, 'Y', 'N', 0, '2015-04-18 22:06:23', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:06:23', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('1f4261f1-1a7f-f2cf-c5f6-55355cbb2a82', 'RA397-Darling Delight Cabin', 'ra397-darling-delight-cabin-1', 'Meander up the stone pathway to your tranquil place of retreat. This quaint getaway is on 5 private acres and features a gourmet kitchen with stainless steel appliances. Relax in front of the stone fireplace, grill on the gas BBQ, or soak in the peaceful hot tub nestled on the sunny deck. Hike miles of trails on Forest Service land, enjoy a bike ride on the paved bike path, stroll down to the nearby private beach with picnic area and playground.  This "old Tahoe" style cabin is a couples delight or perfect setting for a small family.Located just 5 minutes from Tahoe City''s beaches, music festivals, and farmers markets. World class dining is just around the corner, as well as boutique shopping and art galleries. Just 15 minutes to Squaw Valley, Alpine Meadows, and Homewood Mountain Ski Resorts!Downstairs is the Living Room with a pull-out couch (sleeps 2), Fireplace, TV/DVD/Stereo, and beautifully remodeled kitched with granite counters.\nThe Master bedroom has a Queen sized bed and private bath. \n-access to deck with BBQ (summer use only) and private hot tubUpstairs is a loft with two Twins, full bath, and a double sized Aerobed available.  There is no washer/dryer at this cabing, and HOA private beach access is included, as well as high speed wireless internet.  Pets may be considered at an additional cost. -small children''s play area/deskPlease note that during winter months 4-wheel drive + chains highly recommended for driveway.Book 3 nights and get the 4th free (excluding holiday weeks). ', 'United States', 'California', 'Tahoe City', '', '', '96146', '39.145535', '-120.155845', NULL, 0, '', 0, '0', 4, 2, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '631c13a2-1961-0d99-7cd7-553184a48eb8', 1, 1, 'Y', 'N', 0, '2015-04-20 22:09:05', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:09:05', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('1feb0b77-0e05-c8b3-717b-553558c7366e', 'RA330-Gamara', 'ra330-gamara-1', 'Perfect 3 bedroom, 2.5 bath home with hot tub available for a ski lease. This house has been remodeled and looks fabulous! There is pine trim through all of the rooms, new carpet, and newly remodeled bathrooms. Enjoy the hot tub while watching the snow fly, but still staying dry in the atrium. The kitchen has everything that the chef in the family could ask for.\n\nAmenities\nJacuzzi, Vacuum Cleaners, Private Hot Tub', 'United States', 'California', 'Truckee', '', '', '96161', '39.338926', '-120.239115', NULL, 0, '', 0, '0', 5.5, 3, 2.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 21:50:19', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:50:19', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('203e2e0e-4a22-411c-ac43-553551bdad3b', 'RA350-Upper Terrace Cottage', 'ra350-upper-terrace-cottage', 'Located on the ground floor of a uniquely beautiful San Francisco residence, this unit has old world charm plus all the modern conveniences in a private, quiet neighborhood.\n\nUpper Terrace Cottage is centrally located, offering easy access to all of San Francisco while nestled in exclusive Ashbury Heights.  Enjoy glorious views from Buena Vista Park and nearby Twin Peaks, or stroll down the hill to shopping, dining, and entertainment in nearby Cole Valley, Castro or the world-famous Haight-Ashbury district. Golden Gate Park is also nearby, with world-class museums like the De Young and the Cal Academy of Sciences, and year-round activities. Quick commute to downtown via public transportation.This unit comes fully furnished and accessorized for day to day living.Amenities include:Full kitchen with pots, pans, utensilsCoffee Maker, Toaster, Dishwasher, Gas oven and cook top, large refrigerator and microwaveWireless high-speed InternetDedicated phone with free local and domestic long distance callingThree televisions, with the main living room and bedroom flat-screen televisions with full cable packages, featuring HBO, Showtime and other pre-purchased showsPrivate entrance to the unit via a separate access off of a charming pathwayPlease note: Rentals of 7 days or more require a weekly maid service at an additional $50/week.\n                    Unit Sleeps Two guests and bookings for more than two guests are not accepted', 'United States', 'California', 'San Francisco', '', '', '94117', '37.765481', '-122.443031', NULL, 0, '', 0, '0', 2, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', 'b1667c1f-9e1f-85f3-9682-55317452e139', 1, 1, 'Y', 'N', 0, '2015-04-20 21:22:24', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:22:24', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('2295a252-bbfe-87c9-491b-55355ef7037b', 'RA425-Squaw Valley Meadows Condo', 'ra425-squaw-valley-meadows-condo-1', 'This second floor condo has all the modern features for a great get-away. As you enter the property the mudroom offers a great spot for kicking off your hiking boots or dropping your ski gear. The new furniture throughtout make this condo a comfortable place to enjoy life and just relax.The Master bathroom is en suite with a queen bed. The second bedroom has a flat panel TV and queen bed. The second bath is in the hall adjacent to the second bedroom. The living room has comfortable leather couch and chair with a wood burning fireplace and flat panel TV. The upgrades in the kitchen included granite counter tops and stainless appliances. The six person dining table is located between the livingroom and kitchen making it a great space for socializing and dining.The deck has a great gas BBQ. Sitting on the deck you can enjoy 180 degree views of Squaw Meadows and Squaw Valley ski area. After checking the weather from the deck you can walk out the door for a great day on the mountain summer or winter. This place will keep you coming back again and again.It also features free cable and high speed internet access. Parking allowed for two cars with covered parking for one car. Book 3 nights and get the forth night free (excluding the holiday week).No smoking, No pets. ', 'United States', 'California', 'Olympic Valley', '', '', '96146', '39.198610', '-120.228871', NULL, 0, '', 0, '0', 4, 2, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-20 22:17:18', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:17:18', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('23c37bbf-9fb4-8aab-6dc7-5535676e6c92', 'RA468-Aspen Creek Corner Condo with Country Decor', 'ra468-aspen-creek-corner-condo-with-country-decor', 'This one bedroom condominium is on the third floor in building 2 with vaulted ceilings. The bedroom has a queen bed and the living room has a sofa sleeper. There is a fully equipped kitchen, 2 TVs, 2 VCRs, DVD, CD player, telephone (local calls only), woodstove (firewood provided), atrium balcony and mud room for ski/snowboard equipment. For our busy guests, there is high speed internet access . This unit is non-smoking and has one assigned underground parking space (garage height 7''1"). Very nice corner unit with country decor and high speed internet access. Aspen Creek is located within walking distance to the Eagle Lodge and Eagle Express chairlift. It offers underground parking, laundry facilities and elevators in each building, 3 outdoor spas, 3 saunas and a swimming pool open during the summer only.\n\nInternet instruction: USB cable on back of DSL box, plug in into computer, no password.', 'United States', 'California', 'Mammoth Lakes', '', '', '93546', '37.634286', '-118.988993', NULL, 0, '', 0, '0', 2, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 22:54:57', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:54:57', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('25eec3cf-04c6-1a33-2036-553558f12bc1', 'RA345-Chauvet Condo 2B', 'ra345-chauvet-condo-2b-1', 'Hotel Chauvet was originally built in 1906 and celebrated its centennial with a spectacular restoration and renovation, painstakingly accomplished over two years. The result is a historic landmark building with six luxurious vacation rentals, rejuvenated with locally made brick and reappointed by craftsmen, while upscale interior and state-of-the art amenities have been added.The lodging experience at The Chauvet is truly unique! Each unit is generously sized at almost 2,000 square feet. The large master bedrooms include a huge walk-in closet. The other two bedrooms in each unit are spacious as well. Both baths boast designer fixtures but the master features a jetted tub and separate glass enclosed shower with massage jets and rainhead.The kitchen would please any gourmet, and is outfitted with custom cabinetry, stainless steel appliances, granite counter tops, wine cooler and commercial-style gas cooktop, among other delights. Of course, if you don''t want to cook for yourself, you are just steps away from Glen Ellen''s "restaurant row" with a myriad of delicious choices... or walk across the street to Glen Ellen''s own gourmet market.A brief walk south brings you to Jack London Village with the local cheesemonger, chocolate shop (made on site), olive press and market, fantastic deli, market of locally produced gourmet items and another tasting room. Add to this vision the lovely outdoor, heated pool with sundeck patio, accessible from your own wide balcony off the master bedroom, and the views of the surrounding hillsides and native oak trees from every large picture window framed by brick arches.You will be more than comfortable at The Chauvet at any time of year, with energy efficient air conditioning and heating, a gas fireplace, full soundproofing, elevator access and private garage.The unit features: 3 bedrooms, master with king sized bed, 2nd bedroom with queen and the 3rd bedroom with a king sized bed that can convert to two twins upon request in five of the units. Queen sized sofa bed in living room of Unit 1B. 3rd bedroom in 2B only features a twin day bed with a pop up trundle (which can be made up as an Eastern king on request), couch and chaise. 2 luxurious bathrooms - the master has jetted tub, glass enclosed shower with shower panel featuring rain head and massage jets along with European style hand heldAmple closet space throughout, walk-in closet in master bedroomGourmet kitchen and formal dining space, with every amenityGas fireplace in living room, energy efficient central heat and air conditioningHeated outdoor pool surrounded by sun deckWide, private balcony with dining table & chairs, propane BBQWireless internet accessCable with expanded channels and on-demand movies (and a TV in each bedroom and living room)Designer furnishings and dramatic artwork from local artistsPaintings by local artists are exhibited in the unitsSumptuous beds with luxurious linens, thick & thirsty towels and robesElevator access, intercom, covered parking in private garageWasher & dryer in the unitCentral location to wineries & tasting rooms, restaurants, farmers'' and gourmet markets - walk or bike within the charming village of Glen EllenLess than a mile from Jack London State ParkIncluded with your stay are complimentary:a bottle of wine and chocolatescookies in the cookie jarcoffee, tea, juice, yogurt, granola and fresh fruitwine passes for six to Arrowood, Chateau St. Jean, Gary Farrell and Taft Street Wineryreserve tastings at Cline and Jacuzzi2 for 1 tastings at Buena Vista, Geyser Peak, Gundlach Bundschu, and Ravenswoodupgraded tastings at LedsonSonoma Valley B & B Association passport for complimentary tastings for each guest at 25+ Sonoma Valley wineries\nPlease note: The pool is open year-round, however is not heated Nov. 1 through May. 14, per County regulations.\n\n Rates reduced for longer stays: Peak 4-5 nights $595/night, 6+ nights $550/night.  Off peak 3-5 nights $495/night, 6+ nights $450/night.  Balance will be adjusted with the final billing.You can also view Condo 1A, Condo 1B, Condo 2A, Condo 3A, and Condo 3B. for larger groups or other available dates. TOT 848N, 849N', 'United States', 'California', 'Glen Ellen', '', '', '95442', '38.362343', '-122.525923', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 21:52:29', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:52:29', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('25ff56dd-9abd-955e-8bb3-55356b2b10d6', 'RA526-Mammoth West 2 Level 2 Bedroom Condo', 'ra526-mammoth-west-2-level-2-bedroom-condo', 'This two level, two bedroom condominium has been remodeled and refurnished. There is a fully equipped kitchen, small balcony (forest and Mountain views), large dining room table, 2 TVs (one is a 40 inch LCD), VCR/DVD, stereo system with iPod hookup, wireless telephones (local calls only), room humidifiers, and river rock hearth with woodstove (firewood provided). The master bedroom has a king bed and the guest bedroom has two sets of extra long bunk beds. There is also a queen aero bed with bedding for setup in the living room. This unit is non-smoking and has outside parking assigned to Canyon Blvd. Two parking permits will be provided. If necessary, additional parking is also available at the Mammoth RV Park located at the entrance of town (fee required). ', 'United States', 'California', 'Mammoth Lakes', '', '', '93546', '37.648076', '-119.000260', NULL, 0, '', 0, '0', 3.5, 2, 1.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-20 23:11:22', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 23:11:22', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL);
