('2664efac-a6aa-d8af-4b17-5532c11b7bc0', 'RA171-Jacarillo Trail Lodge', 'ra171-jacarillo-trail-lodge-1', 'This spacious and comfortable cabin will really make you feel like you''ve gotten away to the mountains! After a long day of enjoying the slopes, the private hot tub in this quiet woodsy environment will be a dream. The house also features a wood burning fireplace, foosball, and a 2-car garage. The property accommodates up to 12 people in 3 Bedrooms (1 King, 2 Queens, 1 Full, and 2 double futons) and 2 Baths. The South Lake Tahoe area features world-class ski resorts, hiking trails, parks, beaches, restaurants, recreation, boating and numerous other tourist attractions, as well as the nearby casinos of Stateline. A perfect year round vacation destination, with fantastic weather and breathtaking scenery.\n\nPermit number: VHR#750\n', 'United States', 'California', 'South Lake Tahoe', '', '', '96150', '38.903728', '-119.978010', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-18 22:43:08', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:43:08', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('286b7388-62e3-b2a0-833d-553555d0bb8d', 'RA395-Cristallina Greens', 'ra395-cristallina-greens', 'This Tahoe Donner home is great for one or more families. Situated overlooking the 18th fairway at Tahoe Donnner, complete with hot tub, sleeping for 11, remodeled kitchen, and is pet friendly! Main floor contains the raised living room with sectional sofa and wood-burning fireplace, tv/dvd/vcr player and stereo, with seating for 7.  The huge remodeled kitchen has upgraded hickory cabinets, stainless steel appliances, and double ovens. The expansive deck, totally enclosed, overlooks the golf course, and features an easy-access hot tub and gas bbq.  There is a cozy den with pull-out sofa (sleeping for 2), with a tv/dvd/vcr and access to deck, plus its own gas fireplace. The full bath has dual sinks, and all upgraded tile/faucet/cabinets, shower (no tub).  The upstairs bedroom has two Twins with one trundle, total sleeping for 3, plus computer with internet access, fax, and printer. Second level contains the Master bedroom with a King bed, plus a full bathroom (all upgraded), with dual sinks, jetted tub, and seperate shower. The second bedroom has a Queen bed, plus access to upstairs porch.  The third bedroom also has a Queen bed and access to the upstairs porch.  These bedrooms share a full bath with dual sinks, and shower (no tub- not pictured).  There is also a laundry room with washer/dryer.\n\nHi Speed Wireless Internet! (connection cannot be guaranteed) -Outdoor hot tub -Rec center access (for a nominal fee) with hot tub, swimming pool, weight room -Access to Tahoe Donner amenities including Rec center, downhill ski area (perfect for teaching kids!), cross country ski area, equestrian center, tennis center, 18-hole golf and driving range, hiking, and so much more! -Mins from downtown Truckee! -Approx. 20 mins to Sugarbowl ski area, 30 mins to Squaw, 15 mins to Northstar, and 40 mins to Lake Tahoe. This home comes complete with full kitchen and all linens/towels.\n\nPlease note that this Pet Friendly property has a small fee included in its balance. Please let us know how many pets you are bringing, or if you are not bringing pets, and we will adjust the rate accordingly. Book 3 nights and get the 4th free (excluding holiday weeks).  ', 'United States', 'California', 'Truckee', '', '', '96161', '39.349406', '-120.235983', NULL, 0, '', 0, '0', 7, 4, 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 21:35:55', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:35:55', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('2888974b-64c7-d0d1-2c71-5535629d9c42', 'RA359-Elegant 3br Daly City House with View', 'ra359-elegant-3br-daly-city-house-with-view-2', 'This 3br, 2ba home is located in Daly City, just south of San Francisco''s Southern Hills border, only 10 minutes from vibrant SF neighborhoods.Enjoy your vacation in an elegantly decorated, beautifully maintained house with a spacious, modern, fully equipped kitchen.  2 bedrooms have queens, 1 bedroom has a full, and a twin-sized air mattress is available for the 7th guest.This house is a few miles from the coolest restaurants, cafes, shops, theaters and others attractions of San Francisco. Very private, quiet, great location. Stylish and comfortable with all amenities including wireless internet.15 minutes from Dolores park and the hip 20/30-something Valencia corridor with top restaurants, coffee houses, and clubs. Also nearby is Noe Valley, Castro and Mission. Noe Valley is a quaint, young family shopping area; the Castro is the gay capital of the West Coast with nightlife, shops, bars and cafes. The Mission is a young, vibrant neighborhood with a 20''s/30''s crowd, bustling with bars, clubs, interesting shops, restaurants and galleries.The house is conveniently located 10 minutes from San Francisco International Airport and 20 minutes to Embarcadero, Financial District, Moscone Center, Yerba Buena Gardens, Union Square shopping and Civic Center -- with its historic buildings, museums, SF Opera House, Davies Symphony Hall, and more.\n\nOther notes:Pets Not AllowedNon Smoking OnlyCooking UtensilsRefrigeratorParking For RV/Boat/TrailerLinens ProvidedVideo Game Console', 'United States', 'California', 'Daly City', '', '', '94014', '37.707273', '-122.435722', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '84074c2f-7cba-b5fd-c906-55317d9a4878', 1, 1, 'Y', 'N', 0, '2015-04-20 22:32:47', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:32:47', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('298b7871-ace0-8f5a-024b-5532ba5defe0', 'RA103-Garden Suite', 'ra103-garden-suite', 'Please note : this Property requires a 30 day minimum stay\n\nEnjoy an elegant hideaway in the middle of San Francisco. The Garden Suite is finely decorated yet comfortable and convenient. Located in one of the City’s most desirable neighborhoods and across the street from the beautiful Buena Vista Park. This designer quality suite is within walking distance of the upscale Cole Valley neighborhood with its many restaurants and shops. The Castro district is also a short walk away.The Garden Suite is private and stylish. You will enter a small living room with a panoramic view of the professionally landscaped garden. There is a beautiful sleeping area that also includes a kitchenette and eating area. There is a designer quality bathroom.The Garden Suite is a hidden gem. All of the décor has been carefully chosen by the owner to make your visit sublime. The entire space is very private and is perched upon a beautiful garden. The garden is available for the use of the guests. Public transit is within walking distance.If available, this unit may be combined with our Upper unit, the Garden View.\n\nNo parking available.', 'United States', 'California', 'San Francisco', '', '', '94117', '37.766650', '-122.443448', NULL, 0, '', 0, '0', 3, 2, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-18 22:13:14', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:13:14', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('29c381fa-04b6-bf54-b4bd-55355cd4288e', 'RA370-Glen Airdrie', 'ra370-glen-airdrie-1', ' Located next to Jack London Park in Glen Ellen, this estate is truly a summer playground on 5.6 acres with a tennis court, swimming pool, sand volleyball court, and a horse shoe pit.\n\nThe main house has three bedrooms, den with fireplace, solarium, a large glass paneled living room/dining room, and eat-in kitchen with granite counter tops and stainless steel appliances. There is a charming one bedroom guest house with its own porch and kitchenette. The estate offers great privacy and tranquility.\n\nJack London Park, a state park with more than 1,000 acres, has wonderful hiking, mountain biking, and horse trails. There are also tours of Jack London''s museum, Wolf House, and experimental farm.Set amongst mature oaks and trees, it is beautifully landscaped with rock pathways and a charming gazebo. There are numerous olive, fig and citrus trees. With 5.6 acres, the property is secluded and very private. There are excellent restaurants and wine tasting rooms, plus a great local market with gourmet foods and deli just 4 minutes away by car.\n\nNon Smoking Only', 'United States', 'California', 'Glen Ellen', '', '', '95442', '38.358089', '-122.546945', NULL, 0, '', 0, '0', 8, 4, 4, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 22:05:28', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:05:28', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('2a0d040f-6e1f-eb6a-0500-5535620de243', 'RA389-Brockway Shores Charmer', 'ra389-brockway-shores-charmer-2', 'This 3 bedroom, 2.5 bathroom, split level lakefront townhouse sleeps 6 and has an open floor plan to accommodate your gathering. Located in beautiful Brockway Shores, this unit is nestled amongst the tall trees and grassy lawn of the expansive picnic area.Stroll down the back steps to the HOA private beach, or pull your boat up to the pier to take your friends on an evening cruise. Go kayaking or fishing right from the back deck! Go hiking on nearby conservancy land and enjoy refreshments while having a BBQ in the summer.In winter, go snowshoeing for epic views of the lake, or ski at the many nearby resorts. Take in the spectacular views that incorporate the landscape of the lake and mountains...year ''round! This property has an ideal location! Just a few blocks walk along a safe, quiet neighborhood to the heart of downtown Kings Beach''s restaurants, dining, and shopping. The gorgeous sandy beaches are just down the street, with sand-court volleyball and kayak rentals.Cool down with soft-serve ice cream while playing a round of mini-golf or enjoy live music and taco specials after a round of 9-hole golf! Dine on hearty steaks and salad bars lakeside, or be amazed by award-winning all-you-can-eat sushi. There''s even a local movie theater! Just a short drive to the stateline casinos and music venues, there''s year-round fun and activities for the entire family!This split-level condo features, on the downstairs level, a Master bedroom with a King bed, 24"TV/VCR/DVD/Stereo with private bath, and a second bedroom with 2 twins, small TV/VCR and bathroom with Jacuzzi tub. Upstairs is the 3rd bedroom with a Queen and half bath. The Kitchen has granite counters and a 3 person bar. The Living room has a leather sofa, fireplace, 52" HDTV/DVD/Stereo, and the Dining room has seating for 8. Buoys are available for rent so bring your boat (subject to availability).Only 10 minutes from Northstar, this townhouse has HOA private lake access, pier, and picnic area. Walking distance to downtown Kings Beach and beautiful sandy beaches, and nearby to award-winning restaurants and boutique shopping as well as shops for kayaks, skis, and snowboards. Please note: Hi-speed internet access is shared; subject to availability. Book 3 nights and get the 4th free (excluding holiday weeks).No Smoking. No pet. ', 'United States', 'California', 'Kings Beach', '', '', '96143', '39.231617', '-120.015611', NULL, 0, '', 0, '0', 5.5, 3, 2.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-20 22:33:55', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:33:55', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('2b3f38f5-fc2b-42a9-8773-5535500cee2d', 'RA336-Chauvet Condo 1A', 'ra336-chauvet-condo-1a', 'Hotel Chauvet was originally built in 1906 and celebrated its centennial with a spectacular restoration and renovation, painstakingly accomplished over two years. The result is a historic landmark building with six luxurious vacation rentals, rejuvenated with locally made brick and reappointed by craftsmen, while upscale interior and state-of-the art amenities have been added.The lodging experience at The Chauvet is truly unique! Each unit is generously sized at almost 2,000 square feet. The large master bedrooms include a huge walk-in closet. The other two bedrooms in each unit are spacious as well. Both baths boast designer fixtures but the master features a jetted tub and separate glass enclosed shower with massage jets and rainhead. This unit also has handicapped accessible features.The kitchen would please any gourmet, and is outfitted with custom cabinetry, stainless steel appliances, granite counter tops, wine cooler and commercial-style gas cooktop, among other delights. Of course, if you don''t want to cook for yourself, you are just steps away from Glen Ellen''s "restaurant row" with a myriad of delicious choices... or walk across the street to Glen Ellen''s own gourmet market.A brief walk south brings you to Jack London Village with the local cheesemonger, chocolate shop (made on site), olive press and market, fantastic deli, market of locally produced gourmet items and another tasting room. Add to this vision the lovely outdoor, heated pool with sundeck patio, accessible from your own wide balcony off the master bedroom, and the views of the surrounding hillsides and native oak trees from every large picture window framed by brick arches.You will be more than comfortable at The Chauvet at any time of year, with energy efficient air conditioning and heating, a gas fireplace, full soundproofing, elevator access and private garage.The unit features: 3 bedrooms, master with king sized bed, 2nd bedroom with queen and the 3rd bedroom with a king sized bed that can convert to two twins upon request in five of the units. Queen sized sofa bed in living room of Unit 1B. 3rd bedroom in 2B only features a twin day bed with a pop up trundle (which can be made up as an Eastern king on request), couch and chaise. 2 luxurious bathrooms - the master has jetted tub, glass enclosed shower with shower panel featuring rain head and massage jets along with European style hand held.Ample closet space throughout, walk-in closet in master bedroomGourmet kitchen and formal dining space, with every amenityGas fireplace in living room, energy efficient central heat and air conditioningHeated outdoor pool surrounded by sun deckWide, private balcony with dining table & chairs, propane BBQWireless internet accessCable with expanded channels and on-demand movies (and a TV in each bedroom and living room)Designer furnishings and dramatic artwork from local artistsPaintings by local artists are exhibited in the unitsSumptuous beds with luxurious linens, and thick & thirsty towelsElevator access, intercom, covered parking in private garageWasher & dryer in the unitCentral location to wineries & tasting rooms, restaurants, farmers'' and gourmet markets - walk or bike within the charming village of Glen EllenLess than a mile from Jack London State ParkIncluded with your stay are complimentary:a bottle of wine and chocolatescookies in the cookie jarcoffee, tea, juice, yogurt, granola and fresh fruitwine passes for six to Arrowood, Chateau St. Jean, Gary Farrell and Taft Street Wineryreserve tastings at Cline and Jacuzzi2 for 1 tastings at Buena Vista, Geyser Peak, Gundlach Bundschu, and Ravenswoodupgraded tastings at LedsonSonoma Valley B & B Association passport for complimentary tastings for each guest at 25+ Sonoma Valley wineries\nPlease note: The pool is open year-round, however is not heated Nov. 1 through May. 14, per County regulations.\n\n "Travel trained" pets considered in Units 1A and 1B. Additional deposit required.Rates reduced for longer stays: Peak 4-5 nights $595/night, 6+ nights $550/night.  Off peak 3-5 nights $495/night, 6+ nights $450/night.  Balance will be adjusted with the final billing.You can also view Condo 1B, Condo 2A, Condo 2B, Condo 3A, and Condo 3B. for larger groups or other available dates. TOT 848N, 849N', 'United States', 'California', 'Glen Ellen', '', '', '95442', '38.362343', '-122.525923', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 21:15:27', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:15:27', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
