('2bebc12c-70ed-0551-b189-5532c3e83fc0', 'RA206-Herbert Avenue Condo', 'ra206-herbert-avenue-condo-1', 'Top of the Line total Remodel/2007. Hardwood floors, granite countertops. Views of Heavenly, summer pool. Cls to Heavenly, casinos and walk to Lake Tahoe. School with playground, baseball field is nearby. Q, Q, Tw Bunk, Qhab, Charcoal Grill Has wi-fi.\nPrices do not reflect taxes and cleaning fee.\n\nPermit number: VHR#102096', 'United States', 'California', 'South Lake Tahoe', '', '', '96150', '38.941370', '-119.960163', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-18 22:50:51', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:50:51', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('2c883710-e8c0-7d58-5b2d-5532bea4c679', 'RA189-Venice Drive Beauty', 'ra189-venice-drive-beauty', 'Beautiful home in Tahoe Keys on the lagoon. Very peaceful and serene. House is tastefully furnished with lots of personal touches. Formal Dining Room, brick f/p with gas insert in Living Room and Master Bedroom. Outside has beautiful double lot, deck and hot tub!\n\nPermit number: VHR#5815', 'United States', 'California', 'South Lake Tahoe', '', '', '96150', '38.927872', '-120.013900', NULL, 0, '', 0, '0', 5.5, 3, 2.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-18 22:28:14', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:28:14', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('2dceebd2-0ede-5a03-ce61-5532ba80dd00', 'RA86-Pacific Studio South', 'ra86-pacific-studio-south', 'Please note : this Property requires a 30 day minimum stay\n\nThe Pacific Studio is an oasis of tranquility in one of San Francisco''s most prestigious neighborhoods.  The studio is in a classic Pacific Heights building and features a view onto a professionally landscaped garden.  The dynamic shopping and dining area of upper Fillmore is only a block away, yet the studio itself is very quiet.  The location of the property is very central and also just one block away from public transportation.Enter the building lobby and climb the stairs to the second floor.  As you enter the studio, you will find a Queen sized bed, a dining table, and a desk.  There is a full bank of windows in the bedroom overlooking a beautiful garden.  There is a separate and fully stocked kitchen adjacent to the bedroom.  At the end of the hall there is a full bathroom including a bathtub.The unit has a deck that is shared with one other unit and all guests also have access to the garden below.  Coin operated laundry in the basement.  Amenities include cable, internet, linens and cooking equipment.  Our Pacific Studio is perfect for a couple or an individual who requires an extended stay in San Francisco.  The great natural light, comfortable furnishings, and excellent location make this property a great choice for any visitor!\n\nNo parking available', 'United States', 'California', 'San Francisco', '', '', '94115', '37.615470', '-122.389645', NULL, 0, '', 0, '0', 3, 2, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', 'b1667c1f-9e1f-85f3-9682-55317452e139', 1, 1, 'Y', 'N', 0, '2015-04-18 22:10:21', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:10:21', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('2debf2f9-dee0-3517-386c-5532bdb810fd', 'RA170-Pasadena Hideaway', 'ra170-pasadena-hideaway', 'This cute duplex is located only 3 blocks from Lake Tahoe, so you can enjoy lovely walks to the lake or to local restaurants and shops!The property is only minutes to Heavenly for hikes or winter sports, or to the casinos for hours of fun. You''ll love the patio and garden with a BBQ grill! Enjoy all the comforts of home with wireless internet, a large wood burning fireplace & washer/dryer. 4 people will sleep comfortably in this house with 2 bedrooms and 1.5 baths. Rent together with Pasadena Haven for larger groups!The South Lake Tahoe area features world-class ski resorts, hiking trails, parks, beaches, restaurants, recreation, boating and numerous other tourist attractions, as well as the nearby casinos of Stateline. A perfect year round vacation destination, with fantastic weather and breathtaking scenery.\n\nPermit number: VHR#2047 ', 'United States', 'California', 'South Lake Tahoe', '', '', '96150', '38.940821', '-119.979917', NULL, 0, '', 0, '0', 3.5, 2, 1.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-18 22:23:23', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:23:23', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('2e6f051d-d5c4-00af-410d-5532c52a0263', 'RA307-Hale Maluhia', 'ra307-hale-maluhia-1', 'Hale Maluhia is a one-of-a-kind beachfront home on Hanalei Bay and is perfect for honeymooners or a small party looking for a luxurious getaway. This is a fabulous home is located on Hanalei Bay. The Saturday morning farmers and fresh produce market is just a few blocks away.The house is fully equipped with upscale furnishings and amenities. Master bedroom with king bed has garden views, flat screen TV with cable and stereo. The master bath has shower/jacuzzi tub. The living area offers a queen punee bed for additional sleeping arrangements or lounging area. Off of the living area is a small alcove area with twin size bed and half bath. The manicured gardens is very private. Gas lined tiki torches and garden gazebo encourage outdoor entertaining and dining.\n\nThis home is located on the end of the bay near the surf spot Pinetrees. Hanalei town is just a short five to ten minute walk. The Saturday morning farmers and fresh produce market is just a few blocks away.\n\nLocated on the north shore of Kauai west of Princeville, the small, peaceful town of Hanalei is rich in both history and art with landmarks such as the Waioli Mission House and Hanalei Pier. The many art galleries here feature art and carvings made in Kauai, inspired by the island’s natural beauty. Come enjoy a ukulele concert at the Hanalei Community Center or relax and watch the sunset at the end of the day over Hanalei Bay.\n\nOther amenities included:RefrigeratorToasterCookwareCeiling FansLinensIroning BoardAlarm SystemOutdoor ShowerGazeboGas lined Tiki torchesBusiness: Nearby ATM, Nearby Post Office, Nearby Internet Cafe, Nearby FedEx, Nearby Bank, TAT # W59473247-01Convenience: Nearby Medical Services, Nearby Grocery, Golf Course, Walking distant to townGeographic: On Beach, On Bay or Sound, Close to Town', 'United States', 'Hawaii', 'Hanalei', '', '', '96714', '22.201731', '-159.504954', NULL, 0, '', 0, '0', 2, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '7563d166-94d8-834c-3042-553185ff9837', 1, 1, 'Y', 'N', 0, '2015-04-18 22:58:40', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:58:40', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('2f9cb53c-eaea-267f-5614-553559b21e11', 'RA350-Upper Terrace Cottage', 'ra350-upper-terrace-cottage-1', 'Located on the ground floor of a uniquely beautiful San Francisco residence, this unit has old world charm plus all the modern conveniences in a private, quiet neighborhood.\n\nUpper Terrace Cottage is centrally located, offering easy access to all of San Francisco while nestled in exclusive Ashbury Heights.  Enjoy glorious views from Buena Vista Park and nearby Twin Peaks, or stroll down the hill to shopping, dining, and entertainment in nearby Cole Valley, Castro or the world-famous Haight-Ashbury district. Golden Gate Park is also nearby, with world-class museums like the De Young and the Cal Academy of Sciences, and year-round activities. Quick commute to downtown via public transportation.This unit comes fully furnished and accessorized for day to day living.Amenities include:Full kitchen with pots, pans, utensilsCoffee Maker, Toaster, Dishwasher, Gas oven and cook top, large refrigerator and microwaveWireless high-speed InternetDedicated phone with free local and domestic long distance callingThree televisions, with the main living room and bedroom flat-screen televisions with full cable packages, featuring HBO, Showtime and other pre-purchased showsPrivate entrance to the unit via a separate access off of a charming pathwayPlease note: Rentals of 7 days or more require a weekly maid service at an additional $50/week.\n                    Unit Sleeps Two guests and bookings for more than two guests are not accepted', 'United States', 'California', 'San Francisco', '', '', '94117', '37.765481', '-122.443031', NULL, 0, '', 0, '0', 2, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', 'b1667c1f-9e1f-85f3-9682-55317452e139', 1, 1, 'Y', 'N', 0, '2015-04-20 21:55:46', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:55:46', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('2ff91ed0-e87b-ce95-6792-55356b7feca5', 'RA532-Snowcreek 2 Bedroom Condo with Great Mountain Views', 'ra532-snowcreek-2-bedroom-condo-with-great-mountain-views', 'This two bedroom + loft has great mountain views and oak decor. This property features a fully equipped kitchen, balcony, 3 TVs (with extended service cable: living room, master bedroom and loft), VCR, DVD, washer/dryer, telephone (local calls only) and woodstove (firewood provided). The master bedroom downstairs has a King bed and during the summer, you can walk out to a lawn area. The guest bedroom downstairs has a queen bed. The loft has a Queen and twin bed. This unit is non-smoking and has two outside parking spaces (unassigned). During winter, the red line shuttle route is located on Minaret Road to the Village and Main Lodge. If the distance is too far to walk, then we recommend driving to the mountain. Eagle Lodge is the closest ski area located within a couple of miles. ', 'United States', 'California', 'Mammoth Lakes', '', '', '93546', '37.634849', '-118.974059', NULL, 0, '', 0, '0', 4, 2, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-20 23:11:26', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 23:11:26', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('30ce477d-6835-bfee-a1ed-5532b9532b92', 'RA82-Pierce Place Upper Unit', 'ra82-pierce-place-upper-unit', 'Please note : this Property requires a 30 day minimum stay\n\nOur newly remodeled (May ''08) Pierce Place house is conveniently located in the Northern end of the historic Fillmore District.  Travel south along Fillmore Street and within 10 minutes you will enjoy the remnants of the Jazz era complete with nightclubs, theaters, and restaurants.In the mood for Sushi, within the same time you can tour the Japan town District located within 5 easy city blocks. In the mood for fine dining? Travel north along Fillmore to Pacific Heights, Cow Hollow, all within the ever popular and historic Marina District.The Pierce Place home is newly carpeted with hardwood kitchen floors. A medium sized kitchen will suit all your cooking and hosting needs and is fully equipped with all necessary and basic utensils and appliances.  The Queen bed and full sofa-bed will provide relaxing accommodations for 4 guests. If available, you can combine this house with the lower unit and double your occupancy to 8.Interested in venturing out around the neighborhood? Be sure to visit Alta Plaza Park just 2 blocks away. With it''s sprawling views of the bay and city skyline, as well as a fully equipped playground, it''s no wonder this park is a popular hangout for young parents and their children. Equally attractive to pet owners: The first Sunday of every month is informally known as "Pug Day." Weather permitting, up to 50 pooches and their owners congregate at the north end of this off-leash park during the afternoon for a giant play date.If available and you need more space, this unit may be rented in addition to Pierce Place Lower Unit.\n\nNo parking available', 'United States', 'California', 'San Francisco', '', '', '94115', '37.788778', '-122.437168', NULL, 0, '', 0, '0', 2, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-18 22:08:13', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:08:13', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('30e0bd4b-4d5c-a569-78e6-5535566019a7', 'RA406-Glacier Luxury Lodge', 'ra406-glacier-luxury-lodge', 'Set atop Glacier Way, with almost 360 degree panoramic views of Truckee, the Pacific Crest and the mountains at Squaw and Northstar. Guests are entitled to use the full facilities of Tahoe Donner, including downhill and nordic center, a private beach club at Donner Lake, year-round pool, hot tubs and workout facility. The property overlooks the back side of Tahoe Donner Downhill Ski Area, a favorite area for families and kids. Adjacent to trails, including Donner Ridge Trail, one of the most popular hiking, snow-shoeing and cross-country trails in the area. For the more adventuresome, join the many locals on the hills and trails behind the house for backcountry skiing as well!\n\nThis is a hand crafted, post and beam, luxury timberframe home, immaculately appointed with the highest quality finishes and furnishings. Built in 2002, it is widely considered to be one of the most unique and magical homes in Tahoe Donner. Its 4200+ square feet offers 4 en suite bedrooms sleeping 10 comfortably. The main attraction though is the gourmet kitchen, dining area and spectacular great room with wine bar, satellite TV, and surround sound. Panoramic views are majestically framed by gorgeous woodwork throughout. There''s enough room for a large group for any occasion. Enjoy several outdoor decks for entertaining friends and family as well as a gourmet natural gas barbecue (summer use only due to snow).\n\nUpstairs Master Bedroom - Queen Size Bed - Sleeps 2; Upstairs Guest Suite East Wing - Queen Size Bed & Window Twin Bed - Sleeps 3; Upstairs Guest Suite East Wing - Queen Size Bed & Window Twin Bed - Sleeps 3; The east wing suites are located over the garage and are connected with a delightful breezeway to the main great room. Downstairs Guest Suite - Queen Size Bed - Sleeps 2. Attached 2 Car Garage\n\nVerizon and AT&T are accessible for guests with mobile data services. Currently, local broadband and WiFi is not available. Because the property is located at the top of Tahoe Donner, it may be exposed to extreme conditions and drifts during winter storms. Please use the garage door entrance in winter. 4X4 vehicles are mandatory in winter to access this property and it is recommended that you drive up and down the rear side of Skislope from Alder Creek if it is snowing. The driveway is level and melts quickly when the sun shines. ', 'United States', 'California', 'Truckee', '', '', '96161', '39.345199', '-120.270105', NULL, 0, '', 0, '0', 8.5, 4, 4.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-20 21:41:01', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:41:01', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('30f5b35b-32ed-2f03-45dd-5532c169b454', 'RA315-Grossman', 'ra315-grossman', 'This townhouse feels more like a single family home. Not attached to other units. Very spacious "reverse" floorplan with 3 bedrooms/2 baths downstairs, Living, Dining, Kitchen, 1 Bedroom and 1 Bath upstairs. Cathedral, open-beam ceilings and comfortable decor with mountain accents. The unit looks out to the outdoor pool and hot tub. Ideal for a group, large family or two small families. This townhouse is equipped with microwave, dishwasher, washer/dryer, Large screen TV with cable, VCR & DVD Player. Propane barbecue for summer use.\n\n\nAmenities\nCD Player, Dishwasher, DVD player, Microwave, Stereo, Telephone, TV(s), Vacuum Cleaners, Washer/Dryer, Lake Nearby, Skiing Nearby, Balcony, Linens, Satellite/Cable Television, Groups, Community Pool, Community Hot Tub, Community Tennis, Designated Parking, Skiing, Swimming, Tennis\n\nActivities\nWater activities, Winter sports', 'United States', 'California', 'Tahoe City', '', '', '96145', '39.183668', '-120.118018', NULL, 0, '', 0, '0', 7, 4, 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-18 22:43:04', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:43:04', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('328e2007-d0d5-1f01-c693-5532c108abc5', 'RA305-Lani Kai', 'ra305-lani-kai', 'Located beachfront on the enchanting Hanalei Bay, Lani Kai ("Heavenly Ocean Home") is a newly remodeled four bedroom, three bathroom home ideal for a large family or couples traveling together wanting some well-deserved space. Recent renovations include slate floors, Hawaiian chic furnishings and Koa wood throughout-- including the bedrooms, bathrooms, kitchen and custom crafted doors. There are two carpeted master bedrooms featuring a California-King and a private bathroom with both a soaking tub and private outdoor shower. The third bedroom, also carpeted has two doubles and the fourth room is an office/lounge fusion featuring a desk, fax and two twin sized pune''e, perfect for an afternoon nap or supplemental sleeping areas. The spacious living area is fit for family time while the gourmet kitchen affords the culinary types ample space to prepare a feast. While the vaulted ceilings throughout expand the sense of space, the numerous floor to ceiling windows allow for maximum light exposure, letting that sweet Hawaiian sunshine beckon all to play in the beachside grassy yard or the waters of Hanalei Bay just beyond.\n\nLocated on the north shore of Kauai west of Princeville, the small, peaceful town of Hanalei is rich in both history and art with landmarks such as the Waioli Mission House and Hanalei Pier. The many art galleries here feature art and carvings made in Kauai, inspired by the island’s natural beauty. Come enjoy a ukulele concert at the Hanalei Community Center or relax and watch the sunset at the end of the day over Hanalei Bay.\n\n\nOther amenities:Kitchen: Refrigerator, Toaster, Cookware, Viking Appliances, Dining for 8-10, Island bar seats 3, Filtered WaterLiving: Ceiling Fans, Linens, Ironing Board, Alarm System, Bose Stereo SystemBusiness: Nearby ATM, Nearby Post Office, Nearby Internet Cafe, Nearby FedEx, Nearby Bank, TAT # W40972174-01, Printer/Fax/Copier available, TVNC 1155Convenience: Nearby Grocery, Walking distant to town, Close to Hanalei Pavilion, Short walk to Hanalei town, Near beach volleyballOutdoor: Outdoor Shower, Beachfront Grassy yard,Geographic: On Beach,Close to Town, 8 miles to Ke''e Beach, 8 miles to NaPali Trail, 60 minutes from Lihue airport, Walking distance to cofee shop, Near surf break\n ', 'United States', 'Hawaii', 'Hanalei', '', '', '96714', '22.201727', '-159.504757', NULL, 0, '', 0, '0', 7, 4, 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '7563d166-94d8-834c-3042-553185ff9837', 1, 1, 'Y', 'N', 0, '2015-04-18 22:40:57', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:40:57', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('3356e44e-0cf7-d26a-1a44-5535625c84a5', 'RA370-Glen Airdrie', 'ra370-glen-airdrie-2', ' Located next to Jack London Park in Glen Ellen, this estate is truly a summer playground on 5.6 acres with a tennis court, swimming pool, sand volleyball court, and a horse shoe pit.\n\nThe main house has three bedrooms, den with fireplace, solarium, a large glass paneled living room/dining room, and eat-in kitchen with granite counter tops and stainless steel appliances. There is a charming one bedroom guest house with its own porch and kitchenette. The estate offers great privacy and tranquility.\n\nJack London Park, a state park with more than 1,000 acres, has wonderful hiking, mountain biking, and horse trails. There are also tours of Jack London''s museum, Wolf House, and experimental farm.Set amongst mature oaks and trees, it is beautifully landscaped with rock pathways and a charming gazebo. There are numerous olive, fig and citrus trees. With 5.6 acres, the property is secluded and very private. There are excellent restaurants and wine tasting rooms, plus a great local market with gourmet foods and deli just 4 minutes away by car.\n\nNon Smoking Only', 'United States', 'California', 'Glen Ellen', '', '', '95442', '38.358089', '-122.546945', NULL, 0, '', 0, '0', 8, 4, 4, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 22:32:50', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:32:50', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('33c20e4a-274a-5831-6dda-55356bb8d0ce', 'RA536-Snowcreek Condo Perfect for 2', 'ra536-snowcreek-condo-perfect-for-2', 'This upstairs, one bedroom condominium has a view of the Sherwin Mountains and a pond and lawn area in front of the building. There is a fully equipped kitchen, small balcony, 2 TVs, 2 VCRs, DVD, CD player, telephone (local calls only) and fireplace (wood provided). The bedroom has a king bed. This unit is non-smoking and has one outside parking space (unassigned). Maximum occupancy is 2. During winter, the red line shuttle route is located on Minaret Road to the Village and Main Lodge. If the distance is too far to walk, then we recommend driving to the mountain. Eagle Lodge is the closest ski area located within a couple of miles.\n\nThere is an Athletic Club with additional fee.', 'United States', 'California', 'Mammoth Lakes', '', '', '93546', '37.634849', '-118.974059', NULL, 0, '', 0, '0', 2, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-20 23:11:30', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 23:11:30', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
