('36ac95c7-f5d7-274c-a632-5532c15a8dda', 'RA178-Sky Meadows Court', 'ra178-sky-meadows-court-1', 'This two-bedroom home is located in a quiet, wooded neighborhood in South Lake Tahoe. You can take advantage of the peace and beautiful surroundings by whipping up a meal on the charcoal barbeque or simply relaxing on the patio. The full kitchen—complete with coffeemaker, microwave, and dishwasher—along with the washer and dryer cover all your family’s basic needs so that you can easily enjoy your vacation. Access to satellite and cable TV and a DVD player makes it all just that much better. What’s more, if you’re traveling with a large party, this home is mere seconds away from several other rental properties! Just look for the Sky Meadows Retreat and Sky Meadows Home.Located in Sky Meadows, this home gives you easy access to a variety of venues from great restaurants to shops, galleries and more! Treat yourself to some fantastic food at the Fresh Ketch Lakeside Restaurant in the Tahoe Keys Marina a mere four minutes drive away. Not only does it have a Seafood Bar, it also offers fine dining upstairs with a view of the lake. Also only four minutes away is the Eagle Valley Frames and Art Gallery and Hanifin’s Arts and Antiques where you can find a collection of works by local artists. If you came to ski, a fourteen minute drive will take you to the Heavenly Ski Resort! You can also go boating and fishing or hike one of the area’s many trails as you enjoy Tahoe’s breathtaking scenery.Permit number: VHR#384', 'United States', 'California', 'South Lake Tahoe', '', '', '96150', '38.922919', '-119.994978', NULL, 0, '', 0, '0', 4, 2, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-18 22:43:26', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:43:26', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('38174c47-d671-e916-ac4c-553556258d77', 'RA408-Herringbone Hideout', 'ra408-herringbone-hideout', 'What a delightful Tahoe Donner vacation retreat! This 3 bedroom, 2.5 bath home will sleep 8 comfortably, and less than 2 miles to the Tahoe Donner ski hill.\n\nUpstairs:\n-Master suite: queen bed, oversized reading chair, entrance to small private deck and master bath with tub/shower and dual sinks\n-Living room with gas fireplace, TV/DVD, seating for 5,\n-Dining area with seating for 6, open to kitchen and living room\n-fully stocked kitchen with bar seating for 1, open to dining and living room\n-entrance to back deck with charcoal BBQ (summer use only)\n-attached 2 car garage\n\nDownstairs:\n-Bedroom 2: queen bed\n-full bathroom with shower/tub\n-Bedroom 3: 2 bunk beds (4 twins- total sleeping for 4)\n-downstairs half bathroom\n\n-Hi Speed Wireless Internet! (connection cannot be guaranteed)\n-Access to Tahoe Donner amenities (for nominal fee) including Rec center with work-out facility pools and hot tub, downhill ski area (perfect for teaching kids!), cross country ski area, equestrian center, tennis center, 18-hole golf and driving range, hiking, and so much more!\n', 'United States', 'California', 'Truckee', '', '', '96161', '39.337873', '-120.236000', NULL, 0, '', 0, '0', 5.5, 3, 2.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 21:42:28', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:42:28', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('38dc3f25-6cdc-9fd2-1e26-55356716d756', 'RA471-Aspen Creek Condo Only Short Walk to Chair 15', 'ra471-aspen-creek-condo-only-short-walk-to-chair-15', 'This one bedroom, corner condominium has a view of trees and is walking distance to chair 15. It is located on the fourth floor in building 4. There is a fully equipped kitchen, 2 TVs (large screen TV in living Rm), 2 VCRs, 2 DVDs(BluRay in Living Rm), CD player, telephone (local calls only),wireless internet, fireplace (firewood provided), atrium balcony and mud room for ski/snowboard equipment. The bedroom has a king bed and the living room has a sofa sleeper. This unit is non-smoking and has one assigned underground parking space (garage height 8''0"). ', 'United States', 'California', 'Mammoth Lakes', '', '', '93546', '37.634286', '-118.988993', NULL, 0, '', 0, '0', 2, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 22:55:58', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:55:58', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('3c3c0f1e-723f-f1ec-8b08-55355db36cb7', 'RA403-Fairway Family Cabin', 'ra403-fairway-family-cabin-1', 'This adorable cabin is the perfect mountain getaway. Located right on the 16th fairway, it is quiet and peaceful, and comes with so many amenities! On the Entry level the Living room has a 32" flat-screen TV/DVD with full stereo system, quality furniture, a Double sleeper sofa and real wood stove. The Dining room has seating for 12 with two additional barstools. The Kitchen is fully equipped, including an Espresso machine and pass-through bar.\n\nThe first Bedroom has 1 Queen, the second bedroom has 1 Queen, and they chare a full bath with tub.  Upstairs you will find a loft with a Double futon for extra guests, and a third bedroom with 2 bunk beds, 2 extra Twins, and a Twin sized sleeper sofa (sleeping a total of 7).  There is also a second full bath with tub.  There is a charcoal BBQ available for summer guests.   This rental includes access cards for the Tahoe Donner Recreation Center resident amenities. A nominal charge applies for some activities. Book 3 nights and get the 4th free (excluding holiday weeks).  \n\nThis cabin provide Hi Speed Wireless Internet! (connection cannot be guaranteed)\n-Access to Tahoe Donner amenities (for nominal fee) including Rec center with work-out facility pools and hot tub, downhill ski area (perfect for teaching kids!), cross country ski area, equestrian center, tennis center, 18-hole golf and driving range, hiking, and so much more!\n-Mins from downtown Truckee!\n-Approx. 20 mins to Sugarbowl ski area, 30 mins to Squaw, 15 mins to Northstar, and 40 mins to Lake Tahoe This home comes complete with full kitchen and all linens/towels. \n\nNo Smoking. No Pets.', 'United States', 'California', 'Truckee', '', '', '96161', '39.344927', '-120.240722', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 22:11:43', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:11:43', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL);
