('3d3b17bb-a924-4d91-a880-55354f5705a6', 'RA323-Springsteen', 'ra323-springsteen', 'Pride of ownership shows throughout in this darling Lake Tahoe vacation home. If you''re looking for the perfect little cabin in the woods, this west shore Lake Tahoe rental property will be sure to meet your needs. Conveniently located, this cozy cabin is just minutes from the Tahoe Park Homeowner''s Association beach and recreation area as well as the back side entrance to Alpine Meadows Ski Area and lakeside dining at Sunnyside Resort. With three bedrooms and two bathrooms, this rental property is perfect for a family or small group. Summer guests will love the large outdoor deck with full size charcoal BBQ and a complete set of patio furniture for outdoor dining.\n\nAmenities\nBusiness district, CD Player, Dishwasher, Fireplace, Microwave, Stereo, Telephone, Vacuum Cleaners, VCR players, Washer/Dryer, Beach Access, Lake Nearby, Boating, Satellite/Cable Television, Community Tennis, Skiing, Walking, Golf\n ', 'United States', 'California', 'Tahoe City', '', '', '96146', '39.142170', '-120.160016', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 21:12:31', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:12:31', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('3d820b77-ba09-5588-1497-553567b05289', 'RA453-Aspen Creek 2 Bedroom Condo on 1st Floor', 'ra453-aspen-creek-2-bedroom-condo-on-1st-floor', 'Beautiful single level, 2 bedroom, 2 bathroom condominium is a short, quick walk to Eagle Lodge and Eagle Express (Chair 15). This completely remodeled, family friendly unit is in building #1, and is the closest to the lift of all units in the Aspen Creek complex.\n\nFeatures include; fully equipped kitchen with stainless steel appliances, new 42" TV in living room (with DVD player), new carpet, cable TV in living room and both bedrooms, atrium balcony and mud room for ski/snowboard equipment. King bed in the master bedroom (with down comforter), Queen bed in the guest bedroom (with down comforter) and new sofa sleeper in the living room. This wonderful unit is non-smoking and has one underground parking space (garage height 8''4").\n\nAspen Creek offers laundry facilities and elevator, 3 outdoor jacuzzis, 3 saunas and a swimming pool (open during summer only).', 'United States', 'California', 'Mammoth Lakes', '', '', '93546', '37.634286', '-118.988993', NULL, 0, '', 0, '0', 4, 2, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 22:53:19', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:53:19', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('3de8d5b8-b5c8-d888-55b3-553553297f53', 'RA352-Tahoe Diamond', 'ra352-tahoe-diamond', 'This gorgeous end unit features 2 private lake view decks in the Mountain Shadow complex.Conveniently located close to Hyatt and Diamond Peak, with access to two exclusive beaches in Incline Village (one with heated pool and slide), this large condo is perfect for any seaon. Recent renovations include fresh paint, new wood laminate, newly carpeted rooms, fully remodeled tiled bathrooms, a new electric fireplace insert, dual pane vinyl windows, and new top-down window coverings for bedrooms. Tahoe Diamond features vaulted ceilings and open floor plan.Included in your stay at Tahoe Diamond are passes to two seasonal pools, open after Memorial Day.  Incline Village features stunning mountain retreats, relaxing beaches and a plethora of lakeside activities. In summer, mountain biking, hiking, and water activities abound, while theatergoers flock to the Lake Tahoe Shakespeare Festival. Winter attractions include Diamond Peak Ski Area (within city limits) and Mt. Rose. And the casinos are quite lively all year! ', 'United States', 'Nevada', 'Incline Village', '', '', '89451', '39.246755', '-119.935543', NULL, 0, '', 0, '0', 5.5, 3, 2.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 21:27:36', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:27:36', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('3e0f7450-1e29-fbe3-9a92-5532c574f7a2', 'RA300-Honu Lani', 'ra300-honu-lani-1', 'Welcome to our Kauai vacation rental accommodations at Kilauea near Princeville and Hanalei on Kauai''s North Shore.\n\nThe interior floor plan of Honu Lani was designed to accommodate families or small gatherings of friends. The large family room is at the center of the house, with the master bedroom on one side with adjoining bath and two bedrooms on the other with a shared bath, for a total of three bedrooms and two baths. The large kitchen, dining and living area separates these two wings of the home. The expansive lanai is accessed by large pocket doors that disappear in the walls and thus open the whole living and dining area to an inside/outside family room.\n\nBeautifully decorated and well maintained, this perfect retreat is surrounded with lush tropical vegetation and greenery! Perched above the ocean and mountains, Honu Lani features breathtaking views of both! Relax and unwind in this 3br, 2ba house, where you will find all the comforts of home: a fully stocked kitchen, entertainment center, family room, master bedroom with king bed, 2 additional bedrooms with queen beds, beach towels, and much more.\n\nKilauea is conveniently located on the North Shore of Kauai between Kapaa and Hanalei. It is minutes away from an abundance of shopping, fine restaurants, and world class golf. Anini Beach is a beautiful, tropical ocean front community that has been home to various celebrity residents. It is known for its long barrier reef and calm water inside the reef.\n\nOther amenities included:RefrigeratorToasterCookwareCeiling FansLinensIroning BoardBusiness: Nearby ATM, Nearby Post Office, Nearby Internet Cafe, Nearby BankConvenience: Nearby Medical Services, Nearby Grocery, Golf CourseGeographic: Near Beach, Close to Town, TVNC-4213, NCU 4213, TAT # W40354318-01 ', 'United States', 'Hawaii', 'Kilauea', '', '', '96754', '22.211944', '-159.412222', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '7563d166-94d8-834c-3042-553185ff9837', 1, 1, 'Y', 'N', 0, '2015-04-18 22:57:12', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:57:12', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('3e350039-03bf-1f73-0560-5532b9e1376a', 'RA66-Parkview', 'ra66-parkview', 'Please note : this Property requires a 30 day minimum stay\n\nThe Parkview flat is ideal for families or groups traveling together. The unit is in a great location near the exciting Haight Street shopping area with its numerous restaurants, shopping, and nightlife opportunities. Parkview is one block from Buena Vista Park and public transit.Parkview offers great comfort to our guests with tasteful décor. The flat is spacious with generous bedrooms. The views towards Golden Gate Park and Saint Ignatius are stunning. And Buena Vista Park offers one of the most beautiful vistas in the whole city, incorporating the Pacific Ocean, the Golden Gate Bridge, and downtown San Francisco. Golden Gate Park and the Panhandle Park are only blocks away, offering more opportunities to stroll in the sunshine and appreciate the unique flora and fauna of San Francisco, with sites such as the Conservatory of Flowers, the De Young Museum, the Japanese Tea Gardens and the kid-friendly California Academy of Sciences within walking distance.Upon entering Parkview you will find the living room with windows along the wall looking towards the North and West. There is a gas fireplace and pull out Queen-sized couch. Adjacent to the living room is a bedroom with two single beds. Two large master-sized bedrooms hold Queen beds. The large kitchen is fully equipped and includes a dishwasher and a kitchen table suitable for seating eight. The flat contains one full bathroom and one half bathroom.You won''t forget your experience staying at Parkview, with its unforgettable views and perfect central location!\n\nNo parking available', 'United States', 'California', 'San Francisco', '', '', '94117', '37.769440', '-122.443846', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-18 22:05:32', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:05:32', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('3edffb5c-44d0-e0a5-7066-5532ba1c43b4', 'RA90-Montgomery Suite', 'ra90-montgomery-suite', 'Please note : this Property requires a 30 day minimum stay\n\nSet near the top of Telegraph Hill, our Montgomery Suite offers a calm abode with numerous tourist activities nearby. The spacious studio is located on a private, nicely maintained patio, providing absolute privacy with a very homey setting.You access Montgomery Suite through a private entrance. As you enter the studio you will find a living area, complete with a couch, chair, desk and fireplace. The sleeping area is slightly separated from the living area, with an adjacent bathroom. There is a totally separate and fully outfitted kitchen. The patio has a charming seating area and a bbq.This location could not be more convenient! North Beach, with its many restaurants and shopping opportunities, is a few blocks away. San Francisco''s waterfront can be accessed with a ten minute walk down pedestrian stairs surrounded by gardens and parrots. The financial district is also within a ten minute walk. In the midst of all of these activities, the neighborhood is very quiet. Perfect for a couple visiting San Francisco or an executive requiring a longer stay, our Montgomery Suite provides a full unit at an economical price.\n\nNo parking available', 'United States', 'California', 'San Francisco', '', '', '94133', '37.800717', '-122.404134', NULL, 0, '', 0, '0', 3, 2, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-18 22:11:39', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:11:39', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('43ef15eb-1648-53cd-2344-553561b29ae3', 'RA352-Tahoe Diamond', 'ra352-tahoe-diamond-2', 'This gorgeous end unit features 2 private lake view decks in the Mountain Shadow complex.Conveniently located close to Hyatt and Diamond Peak, with access to two exclusive beaches in Incline Village (one with heated pool and slide), this large condo is perfect for any seaon. Recent renovations include fresh paint, new wood laminate, newly carpeted rooms, fully remodeled tiled bathrooms, a new electric fireplace insert, dual pane vinyl windows, and new top-down window coverings for bedrooms. Tahoe Diamond features vaulted ceilings and open floor plan.Included in your stay at Tahoe Diamond are passes to two seasonal pools, open after Memorial Day.  Incline Village features stunning mountain retreats, relaxing beaches and a plethora of lakeside activities. In summer, mountain biking, hiking, and water activities abound, while theatergoers flock to the Lake Tahoe Shakespeare Festival. Winter attractions include Diamond Peak Ski Area (within city limits) and Mt. Rose. And the casinos are quite lively all year! ', 'United States', 'Nevada', 'Incline Village', '', '', '89451', '39.246755', '-119.935543', NULL, 0, '', 0, '0', 5.5, 3, 2.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 22:29:29', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:29:29', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('46200b84-d9c8-fe96-ad31-55356bb284a4', 'RA520-Mountain Shadows Studio Condo Family Friendly', 'ra520-mountain-shadows-studio-condo-family-friendly', 'This downstairs, studio condominium is very nice, comfortable and family friendly. It has a fully equipped kitchen (excluding dishwasher), TV, VCR, CD player and fireplace (wood provided). There is a queen bed and the living room has a sofa sleeper. The alcove area by the entryway has a set of bunk beds. This unit is non-smoking and has one outside parking space (unassigned). Don''t forget your cell phone because this unit does not have a telephone. Dog unit rules: 1) Do not leave your dog alone in the unit. 2) Pick up after your dog. 3) Keep your dog on a leash (it''s the law). If you do not follow these rules, there will be a $100.00 fine.\n\nBBQ (Summer)\nPool (Summer Only)', 'United States', 'California', 'Mammoth Lakes', '', '', '93546', '37.641639', '-118.969058', NULL, 0, '', 0, '0', 3, 2, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 23:11:15', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 23:11:15', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('4648ec74-bc6c-296d-bb94-5532c046ddaa', 'RA222-Spacious Beaver Pond Northstar Home', 'ra222-spacious-beaver-pond-northstar-home', 'Come and enjoy this spacious home at Northstar Ski Resort. The first level has a remodeled kitchen, full bath, half bath, dining area, living room and two bedrooms.The living room is sunken off from the dining area and is a great place for gathering and entertaining next to the fireplace. The livingroom has a TV with a VCR and DVD player for those nights you feel like staying in and watching a movie.The first bedroom on the first level hosts a double size bed and a twin size bed. The second bedroom features a queen size bed. The second level of the home hosts two bedrooms, a full bath, and a loft the looks down into the livingroom. The first bedroom on the second level has a queen size bed. The second bedroom has a double bed and 1 set of bunkbeds. The loft hosts a double size sofa bed and a twin size bed.This home comes with free access to the Northstar home owners recreation center! ', 'United States', 'California', 'Truckee', '', '', '96161', '39.281014', '-120.115682', NULL, 0, '', 0, '0', 6.5, 4, 2.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '631c13a2-1961-0d99-7cd7-553184a48eb8', 1, 1, 'Y', 'N', 0, '2015-04-18 22:37:56', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:37:56', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('4753b3f4-354e-c1e7-3cbb-5532c3fcda4e', 'RA208-Cozy Lodi Escape', 'ra208-cozy-lodi-escape-1', 'Relax in the private hot tub after a long day outdoors at the mountains or the lake. Come inside and stay warm in the spacious living room with a huge wood burning fireplace, 2 couches, and recliner.8 people will sleep comfortably in this house with 3 bedrooms and 2 baths. Centrally located, this property is very close to close to our Lindberg Chalet for larger groups. The South Lake Tahoe area features world-class ski resorts, hiking trails, parks, beaches, restaurants, recreation, boating and numerous other tourist attractions, as well as the nearby casinos of Stateline. A perfect year round vacation destination, with fantastic weather and breathtaking scenery.\n\nPermit number: VHR#2090 ', 'United States', 'California', 'South Lake Tahoe', '', '', '96150', '38.919926', '-119.984345', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-18 22:52:07', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:52:07', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('4808a174-fae1-7a68-2f06-5535631113a1', 'RA406-Glacier Luxury Lodge', 'ra406-glacier-luxury-lodge-2', 'Set atop Glacier Way, with almost 360 degree panoramic views of Truckee, the Pacific Crest and the mountains at Squaw and Northstar. Guests are entitled to use the full facilities of Tahoe Donner, including downhill and nordic center, a private beach club at Donner Lake, year-round pool, hot tubs and workout facility. The property overlooks the back side of Tahoe Donner Downhill Ski Area, a favorite area for families and kids. Adjacent to trails, including Donner Ridge Trail, one of the most popular hiking, snow-shoeing and cross-country trails in the area. For the more adventuresome, join the many locals on the hills and trails behind the house for backcountry skiing as well!\n\nThis is a hand crafted, post and beam, luxury timberframe home, immaculately appointed with the highest quality finishes and furnishings. Built in 2002, it is widely considered to be one of the most unique and magical homes in Tahoe Donner. Its 4200+ square feet offers 4 en suite bedrooms sleeping 10 comfortably. The main attraction though is the gourmet kitchen, dining area and spectacular great room with wine bar, satellite TV, and surround sound. Panoramic views are majestically framed by gorgeous woodwork throughout. There''s enough room for a large group for any occasion. Enjoy several outdoor decks for entertaining friends and family as well as a gourmet natural gas barbecue (summer use only due to snow).\n\nUpstairs Master Bedroom - Queen Size Bed - Sleeps 2; Upstairs Guest Suite East Wing - Queen Size Bed & Window Twin Bed - Sleeps 3; Upstairs Guest Suite East Wing - Queen Size Bed & Window Twin Bed - Sleeps 3; The east wing suites are located over the garage and are connected with a delightful breezeway to the main great room. Downstairs Guest Suite - Queen Size Bed - Sleeps 2. Attached 2 Car Garage\n\nVerizon and AT&T are accessible for guests with mobile data services. Currently, local broadband and WiFi is not available. Because the property is located at the top of Tahoe Donner, it may be exposed to extreme conditions and drifts during winter storms. Please use the garage door entrance in winter. 4X4 vehicles are mandatory in winter to access this property and it is recommended that you drive up and down the rear side of Skislope from Alder Creek if it is snowing. The driveway is level and melts quickly when the sun shines. ', 'United States', 'California', 'Truckee', '', '', '96161', '39.345199', '-120.270105', NULL, 0, '', 0, '0', 8.5, 4, 4.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-20 22:38:33', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:38:33', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('484730c7-92f1-1876-a382-55355f98d1d8', 'RA343-Chauvet Condo 1B', 'ra343-chauvet-condo-1b-2', 'Hotel Chauvet was originally built in 1906 and celebrated its centennial with a spectacular restoration and renovation, painstakingly accomplished over two years. The result is a historic landmark building with six luxurious vacation rentals, rejuvenated with locally made brick and reappointed by craftsmen, while upscale interior and state-of-the art amenities have been added.The lodging experience at The Chauvet is truly unique! Each unit is generously sized at almost 2,000 square feet. The large master bedrooms include a huge walk-in closet. The other two bedrooms in each unit are spacious as well. Both baths boast designer fixtures but the master features a jetted tub and separate glass enclosed shower with massage jets and rainhead. This unit also has handicapped accessible features.The kitchen would please any gourmet, and is outfitted with custom cabinetry, stainless steel appliances, granite counter tops, wine cooler and commercial-style gas cooktop, among other delights. Of course, if you don''t want to cook for yourself, you are just steps away from Glen Ellen''s "restaurant row" with a myriad of delicious choices... or walk across the street to Glen Ellen''s own gourmet market.A brief walk south brings you to Jack London Village with the local cheesemonger, chocolate shop (made on site), olive press and market, fantastic deli, market of locally produced gourmet items and another tasting room. Add to this vision the lovely outdoor, heated pool with sundeck patio, accessible from your own wide balcony off the master bedroom, and the views of the surrounding hillsides and native oak trees from every large picture window framed by brick arches.You will be more than comfortable at The Chauvet at any time of year, with energy efficient air conditioning and heating, a gas fireplace, full soundproofing, elevator access and private garage.The unit features: 3 bedrooms, master with king sized bed, 2nd bedroom with queen and the 3rd bedroom with a king sized bed that can convert to two twins upon request in five of the units. Queen sized sofa bed in living room of Unit 1B. 3rd bedroom in 2B only features a twin day bed with a pop up trundle (which can be made up as an Eastern king on request), couch and chaise. 2 luxurious bathrooms - the master has jetted tub, glass enclosed shower with shower panel featuring rain head and massage jets along with European style hand held.Ample closet space throughout, walk-in closet in master bedroomGourmet kitchen and formal dining space, with every amenityGas fireplace in living room, energy efficient central heat and air conditioningHeated outdoor pool surrounded by sun deckWide, private balcony with dining table & chairs, propane BBQWireless internet accessCable with expanded channels and on-demand movies (and a TV in each bedroom and living room)Designer furnishings and dramatic artwork from local artistsPaintings by local artists are exhibited in the unitsSumptuous beds with luxurious linens, and thick & thirsty towelsElevator access, intercom, covered parking in private garageWasher & dryer in the unitCentral location to wineries & tasting rooms, restaurants, farmers'' and gourmet markets - walk or bike within the charming village of Glen EllenLess than a mile from Jack London State ParkIncluded with your stay are complimentary:a bottle of wine and chocolatescookies in the cookie jarcoffee, tea, juice, yogurt, granola and fresh fruitwine passes for six to Arrowood, Chateau St. Jean, Gary Farrell and Taft Street Wineryreserve tastings at Cline and Jacuzzi2 for 1 tastings at Buena Vista, Geyser Peak, Gundlach Bundschu, and Ravenswoodupgraded tastings at LedsonSonoma Valley B & B Association passport for complimentary tastings for each guest at 25+ Sonoma Valley wineries\nPlease note: The pool is open year-round, however is not heated Nov. 1 through May. 14, per County regulations.\n\n\n"Travel trained" pets considered in Units 1A and 1B. Additional deposit required.Rates reduced for longer stays: Peak 4-5 nights $595/night, 6+ nights $550/night.  Off peak 3-5 nights $495/night, 6+ nights $450/night.  Balance will be adjusted with the final billing.You can also view Condo 1A, Condo 2A, Condo 2B, Condo 3A, and Condo 3B. for larger groups or other available dates. TOT 848N, 849N', 'United States', 'California', 'Glen Ellen', '', '', '95442', '38.362343', '-122.525923', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 22:21:50', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:21:50', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('4889f619-2463-c2f8-7689-5535652da4a4', 'RA437-Twin Top Lakefront ', 'ra437-twin-top-lakefront', '3 night minimum stay required during winter months. Please note that only 12 guests can access the beach at any time during peak summer months, no other visitors or friends outside of the renting party may use the beach. Guests can only use the beach area to the left of the pier as the beach to the right of the pier is private property belonging to the neighbor.\n\n"Twin Top Lodge with buoy and shared beach"\n\nTake a step back in time and experience Lake Tahoe as it once was! This quintessential old-Tahoe estate is extremely private and is steeped in charm and history.\n\nNote: The cabin style is modeled after old Lake Tahoe homes which were known for their rustic charm and wood cabin feel.\n\nA true Old Tahoe lake front home situated in a serene neighborhood. Two stone crafted fireplaces create a warm and inviting setting for your gathering. The living room has a grand piano for the music enthusiast while lake views from the dining room will add to the experience. Rustic and comfortable; this lakefront estate will accommodate your perfect family/business getaway!\n\nFive bedrooms in the main house and guest bunkhouse will accommodate up to 15 people. Stroll down to the private sandy beach or lounge on the grassy grounds and take in the beauty of Lake Tahoe. The landscaped yard has room for games of croquet and bocci ball. Enjoy kayaking, swimming, and boating right from the private dock.\n\nMt. Rose and Diamond Peak ski areas are just minutes away as well as the Hyatt casino, boutique shops, and fine dining restaurants. Enjoy a round of championship golf or take a ride down the bike path along beautiful Lakeshore Drive. There are plenty of easily accessible activities for the entire family!\n\nGround level:\n\nMain living room - Wood fireplace, grand piano, and card table\nDining room - Lake view with seating for at least 10 people\nKitchen - Simple, yet well-equipped\nSecond living room - Double pullout couch, 32" flat screen TV, VCR, DVD, and wood fireplace that can be closed for privacy\n\nBedroom 1 - Twin and double with exit to stone patio\nBathroom 1 - (attached)\nBedroom 2 - Bunk bed (2 twins), TV, VCR, and mini-fridge!\nBathroom 2\nMaster bedroom - King, 32" flat screen, TV, VCR, DVD\nMaster bathroom\n\nUpstairs:\n\nBedroom 4 - King, 32" flat screen, TV, VCR, and DVD\nBathroom 4 - (adjoining)\nBedroom 5 - King, 32" flats creen, TV, and VCR\nBookshelf balcony with skylights overlooking living room\n\nBunkhouse:\n\nBedroom 5 - King and bunk bed (2 twins), mini-fridge, microwave, 32" flat screen, TV, and VCR\n\nBathroom 5\n\nGrassy, landscaped grounds are very private! There are 2 canoes for guests'' use. Stroll the wooded path directly to the large, sandy beach and private pier. From the beach, you can''t see the house or grounds at all!\n\n- Private hot tub\n- 6 bedrooms (5 in main house plus bunkhouse studio)\n- Deck and patio with plenty of furniture\n- Private beach and pier!\n- Plenty of parking and privacy\n- Basketball hoop\n\nBring your boat! This home has a private buoy and plenty of parking. The majority of guests must be over the age of 25.\n\n**No pets, no smoking**', 'United States', 'Nevada', 'Incline Village', '', '', '89451', '39.234431', '-119.935581', NULL, 0, '', 0, '0', 11, 6, 5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', 'd3e20359-89bd-8249-981e-553180c9fde7', 1, 1, 'Y', 'N', 0, '2015-04-20 22:47:33', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:47:33', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('4bbe7384-5cc9-c717-0139-5532c49936fb', 'RA248-SummerHouse Cottage', 'ra248-summerhouse-cottage-1', 'Surrounded by roses and a vineyard, the Summer House cottage offers secluded country tranquility just 2 miles east of downtown Sonoma and an easy bike ride to four nearby wineries. This 600 square foot one bedroom, one bath guest house sleeps six and includes a spacious living room, fully equipped kitchenette and has a private entrance.\n\nThe wrap-around covered porch encourages relaxation, conviviality and the perfect place to discuss the day''s events. This property is perfect for a romantic get away or the ultimate girls weekend.\n\nCheck-in time is 3PM and check-out time is 11AM.\n\nSorry, no pets! Non Smoking Only! We do not recommend that children under 12 stay at the guest house. Wheel chair not accessible.\n\nYour hosts are on property and may be available to assist in dinner or winery suggestions!Note: This property does not accept same-day turnaround. There must be at least one full day between bookings.', 'United States', 'California', 'Sonoma', '', '', '95476', '38.285989', '-122.425496', NULL, 0, '', 0, '0', 2, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-18 22:56:04', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:56:04', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('4cb491d9-8140-a6a9-d5a9-55356b20a325', 'RA503-Hidden Valley Condo Perfect for a Couple   ', 'ra503-hidden-valley-condo-perfect-for-a-couple', 'This downstairs, condominium is located in building D. The perfect place for a couple. There is a fully equipped kitchen, small balcony, TV, VCR, DVD, CD player, telephone (local calls only) and woodstove (firewood provided). It has queen bed. This unit is non-smoking and has one outside parking space (unassigned).\n\nBBQ (Summer)\nPool (Summer Only)', 'United States', 'California', 'Mammoth Lakes', '', '', '93546', '37.646307', '-118.985406', NULL, 0, '', 0, '0', 3, 2, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 23:11:01', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 23:11:01', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('4e093f84-27d0-1ed7-f785-553558c5f052', 'RA323-Springsteen', 'ra323-springsteen-1', 'Pride of ownership shows throughout in this darling Lake Tahoe vacation home. If you''re looking for the perfect little cabin in the woods, this west shore Lake Tahoe rental property will be sure to meet your needs. Conveniently located, this cozy cabin is just minutes from the Tahoe Park Homeowner''s Association beach and recreation area as well as the back side entrance to Alpine Meadows Ski Area and lakeside dining at Sunnyside Resort. With three bedrooms and two bathrooms, this rental property is perfect for a family or small group. Summer guests will love the large outdoor deck with full size charcoal BBQ and a complete set of patio furniture for outdoor dining.\n\nAmenities\nBusiness district, CD Player, Dishwasher, Fireplace, Microwave, Stereo, Telephone, Vacuum Cleaners, VCR players, Washer/Dryer, Beach Access, Lake Nearby, Boating, Satellite/Cable Television, Community Tennis, Skiing, Walking, Golf\n ', 'United States', 'California', 'Tahoe City', '', '', '96146', '39.142170', '-120.160016', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 21:49:01', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:49:01', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('50d62fb6-090d-263f-120c-553559da0cf4', 'RA348-Venice Drive Escape', 'ra348-venice-drive-escape-1', 'Nicely furnished, family style home with a boat dock and access to Tahoe Keys amenities (nominal fee charged). Cute country decor throughout the house. Close to all of the Venice homes for larger groups. This 4 bedroom, 2.5 bath has a King bed in the master bedroom, a Queen in the second bedroom, and three twins in the "bunk room," with a Queen-sized sleeper sofa in the separate TV room.The South Lake Tahoe area features world-class ski resorts, hiking trails, parks, beaches, restaurants, recreation, boating and numerous other tourist attractions, as well as the nearby casinos of Stateline. A perfect year round vacation destination, with fantastic weather and breathtaking scenery.\n\nPermit number: VHR#103358 ', 'United States', 'California', 'South Lake Tahoe', '', '', '96150', '38.930964', '-120.022110', NULL, 0, '', 0, '0', 7, 4, 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-20 21:54:01', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:54:01', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('5377bd95-d786-f002-e6ce-553564e93fc7', 'RA414-Lucky Tree Cabin', 'ra414-lucky-tree-cabin-2', 'This authentic, hand built log cabin is furnished in the classic "Old Tahoe" tradition right down to the soft leather sofa, club chair and Oriental carpets. Filled with Lake Tahoe''s charming history, there is a timeless, rustic mountain feel in every room. This is a single level home. The living room has soft leather furnishing that provide seating for 5, plus a wood stove and TV/DVD/VCR system. The Dining area has a table that seats 4 and the kitchen is fully stocked with gas stovetop and all other amenities. The deck has and charcoal BBQ and seating for 3, which overlook forested open space. The Master bedroom has a full sized bed with TV/DVD player and full bathroom attached. The second and third bedrooms also have Full sized beds. This economy rated cabin is nestled in the hills above Truckee and is a cozy, romantic, welcoming retreat. Quiet, yet close to most everything, it has great winter access and is perfect for a Tahoe skiing and snowboarding vacation. "Lucky Tree Cabin" is located in Tahoe Donner, and include access (with nominal fee) to the following amenities- championship 18 Hole Golf Course, pro shop, downhill ski resort, a cross country ski resort (featuring several warming huts and a ski-in cafe), the fine Lodge restaurant, deli/market, tennis courts, equestrian center, hot tub, swimming pools and a brand new, year-round gym to just name a few. Also includes access to a private marina, beach and boat launch at Donner Lake. The beach features a cafe, concession stand, chaise lounges, boat rentals, (including kayaks), and a designated swimming area. Tahoe Donner is located approx. 5 mins to downtown Truckee, and 10-30 mins to Sugar Bowl, Northstar, Squaw Valley, Alpine Meadows, Boreal ski resorts. \n\nPet friendly.', 'United States', 'California', 'Truckee', '', '', '96161', '39.339606', '-120.217924', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '631c13a2-1961-0d99-7cd7-553184a48eb8', 1, 1, 'Y', 'N', 0, '2015-04-20 22:40:10', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:40:10', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
