('56af71fa-ff9a-6928-54b8-553568e901a5', 'RA478-Bigwood #56', 'ra478-bigwood-56', 'Come and enjoy the Mammoth experience in this two level, one bedroom + loft, two full bath condominium at Bigwood, located in building K. This unit features an enclosed mud room for ski/snowboard storage, a fully equipped kitchen, dining for six plus three stools at the bar, 32" TV with DVD player, balcony, wireless internet, full bath downstairs, and wood burning fireplace (firewood provided). There is a King size bed and a TV in the Master bedroom. In the loft there is a queen bed, two full beds, TV, and a Full Private bath. This unit is non-smoking and has a single car garage (only one parking pass is given for the second vehicle to park outside). Mammoth Property Reservations is not responsible for common area facilities at the complex (i.e. spa, sauna, pool, recreation room, etc.).', 'United States', 'California', 'Mammoth Lakes', '', '', '93546', '37.644044', '-118.988564', NULL, 0, '', 0, '0', 3, 1, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 22:56:38', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:56:38', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('56c7540c-33df-4d64-85ac-5535574d98e1', 'RA424-Silver Strike at Northstar', 'ra424-silver-strike-at-northstar', 'This warm and comfortable condo is conveniently located just steps away from the Village and lifts.Enjoy modern luxuries such as a large flat screen TV, gas fireplace, and leather furnishings. The kitchen is gourmet quality with beautiful woodwork, granite counters, and stainless steel appliances is perfect for creating family meals and wonderful memories.The entry level of this home contains the Master bedroom with a Queen bed, flat screen TV, private deck entry, and Master bathroom with shower and in-floor heating. The second bedroom contains two Twin beds (sleeping for 2), as well as a bathroom with shower and in-floor heating.The upper level of the home contains a living room with gas fireplace, 42" large flat-screen TV/VCR/DVD/Stereo, and Double sleeper sofa (sleeping for 2), with deck entry. The full kitchen comes with deluxe appliances and dining table for 6, plus 2 at side table. It also features a full laundry room, and high speed wireless Internet.\n\nThis home comes complete with full kitchen and all linens/towels.  This home does not have a barbeque grill!\n\nNo Smoking. No PetsBook 3 nights and get the 4th free (excluding holiday weeks).', 'United States', 'California', 'Truckee', '', '', '96161', '39.279135', '-120.118340', NULL, 0, '', 0, '0', 4, 2, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 21:45:48', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:45:48', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('574273c1-a80a-17ff-7997-5532c4df3fb7', 'RA209-Lindberg Chalet', 'ra209-lindberg-chalet-1', '\nThis cozy chalet style 3 bedroom home is centrally located with beautiful views of Barton meadow.  Enjoy your private hot tub with a view! This pet-friendly home has plenty of outdoor space to play! Adults and children will love playing horseshoes in the pit in the backyard while others can relax on the deck or in the hot tub.  On cool evenings, you can light a fire in the huge stone fireplace in the living room. This property is very centrally located, and is close to our Cozy Lodi Escape for larger groups. The South Lake Tahoe area features world-class ski resorts, hiking trails, parks, beaches, restaurants, recreation, boating and numerous other tourist attractions, as well as the nearby casinos of Stateline. A perfect year round vacation destination, with fantastic weather and breathtaking scenery\n\nPermit number: VHR#3700 ', 'United States', 'California', 'South Lake Tahoe', '', '', '96150', '38.919324', '-119.985573', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', 'd3e20359-89bd-8249-981e-553180c9fde7', 1, 1, 'Y', 'N', 0, '2015-04-18 22:52:58', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:52:58', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('59300945-e1f4-b86a-8f59-5532c27efd88', 'RA188-Venice Drive Hideaway', 'ra188-venice-drive-hideaway-1', 'Very nice Tahoe Keys home. Private, fenced backyard w/ Private Hot Tub on Lake Tallac. Open Floor Plan w/Pool table & Access to all of Tahoe Keys Amenities. Near 2052 Venice for larger groups. King, Queen, Full, Twin, Queen HAB. Prices do not reflect taxes and cleaning fee. Holiday''s Excluded.\n\nPermit number: VHR#2717', 'United States', 'California', 'South Lake Tahoe', '', '', '96150', '38.927686', '-120.013702', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-18 22:45:55', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:45:55', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('5d8c34b4-fc24-12d9-2d9a-5532bd8c6af5', 'RA178-Sky Meadows Court', 'ra178-sky-meadows-court', 'This two-bedroom home is located in a quiet, wooded neighborhood in South Lake Tahoe. You can take advantage of the peace and beautiful surroundings by whipping up a meal on the charcoal barbeque or simply relaxing on the patio. The full kitchen—complete with coffeemaker, microwave, and dishwasher—along with the washer and dryer cover all your family’s basic needs so that you can easily enjoy your vacation. Access to satellite and cable TV and a DVD player makes it all just that much better. What’s more, if you’re traveling with a large party, this home is mere seconds away from several other rental properties! Just look for the Sky Meadows Retreat and Sky Meadows Home.Located in Sky Meadows, this home gives you easy access to a variety of venues from great restaurants to shops, galleries and more! Treat yourself to some fantastic food at the Fresh Ketch Lakeside Restaurant in the Tahoe Keys Marina a mere four minutes drive away. Not only does it have a Seafood Bar, it also offers fine dining upstairs with a view of the lake. Also only four minutes away is the Eagle Valley Frames and Art Gallery and Hanifin’s Arts and Antiques where you can find a collection of works by local artists. If you came to ski, a fourteen minute drive will take you to the Heavenly Ski Resort! You can also go boating and fishing or hike one of the area’s many trails as you enjoy Tahoe’s breathtaking scenery.Permit number: VHR#384', 'United States', 'California', 'South Lake Tahoe', '', '', '96150', '38.922919', '-119.994978', NULL, 0, '', 0, '0', 4, 2, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-18 22:25:00', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:25:00', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('5d997d17-5533-c1d6-b0db-55356bd726ed', 'RA540-Snowcreek Phase 4 Condo Sleeps 6', 'ra540-snowcreek-phase-4-condo-sleeps-6', 'This downstairs, two bedroom condominium is located in Phase 4. There is a fully equipped kitchen, deck, 2 TVs, VCR, DVD, telephone (local calls only), forced air heating, washer/dryer, wireless internet, and gas fireplace. The master bedroom has a king bed and a TV and the guest bedroom has a queen bed. The living room has a sofa sleeper. This unit is non-smoking and has two outside parking spaces (unassigned). ', 'United States', 'California', 'Mammoth Lakes', '', '', '93546', '37.631785', '-118.978702', NULL, 0, '', 0, '0', 4, 2, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 23:11:33', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 23:11:33', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('5ddd8bee-2254-818d-d855-55355fa164f9', 'RA330-Gamara', 'ra330-gamara-2', 'Perfect 3 bedroom, 2.5 bath home with hot tub available for a ski lease. This house has been remodeled and looks fabulous! There is pine trim through all of the rooms, new carpet, and newly remodeled bathrooms. Enjoy the hot tub while watching the snow fly, but still staying dry in the atrium. The kitchen has everything that the chef in the family could ask for.\n\nAmenities\nJacuzzi, Vacuum Cleaners, Private Hot Tub', 'United States', 'California', 'Truckee', '', '', '96161', '39.338926', '-120.239115', NULL, 0, '', 0, '0', 5.5, 3, 2.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 22:20:41', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:20:41', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL);
