('5ea95f0c-3e62-db88-ee83-55355ff64643', 'RA328-Chapman', 'ra328-chapman-2', 'If you''re looking for privacy, space and a sense of getting away from it all, Chapman''s Chalet is sure to fit your needs. This spacious four bedroom Truckee vacation home offers a large greatroom with beautiful forested views, adjacent dining area and fully equipped kitchen with plenty of space for your entertaining needs. Located in a quiet remote corner of Truckee, this rental home enjoys easy access to Northstar Ski Resort and is only minutes from downtown Truckee. You will find one queen guest room on the main level with three addtional rooms upstairs along with a separate loft/family room complete with TV/VCR, children''s video collection as well as an assortment of board games. The master bedroom is complete with an extensive library and work desk or just relax after an envigorating day on the slopes in the private jacuzzi tub. Perfect for large families and groups..\n\nAmenities\nBBQ/Picnic area, Business district, CD Player, Dishwasher, DVD player, Fireplace, Games supplied, Jacuzzi, Microwave, Movies supplied, Stereo, Vacuum Cleaners, Washer/Dryer, Satellite/Cable Television, Wireless Internet, Family, No Pets, Skiing, Walking\n\nActivities\nLibrary', 'United States', 'California', 'Truckee', '', '', '96161', '39.314110', '-120.182335', NULL, 0, '', 0, '0', 7, 4, 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '631c13a2-1961-0d99-7cd7-553184a48eb8', 1, 1, 'Y', 'N', 0, '2015-04-20 22:20:12', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:20:12', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('5ead827a-9ace-f125-c59f-55356b88ce32', 'RA560-San Sierra Beautifully Furnished 1 Bedroom Condo', 'ra560-san-sierra-beautifully-furnished-1-bedroom-condo', 'Beautifully furnished one bedroom condominium with brand new furnishings as of 2007. This is a one level, downstairs unit. There is a fully equipped kitchen, small balcony, 42" Wall Mounted Flat Screen TV in the living room and a 47" Wall Mounted Flat Screen TV in the Master bedroom, 2 DVDs, telephone (local calls only), and a woodstove (firewood provided). For our busy guests, this unit has high speed internet access. The Master bedroom has a king bed. The living room has two sofa sleepers. This unit is non-smoking and has one unassigned outside parking space. ', 'United States', 'California', 'Mammoth Lakes', '', '', '93546', '37.647325', '-118.987986', NULL, 0, '', 0, '0', 2, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 23:11:45', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 23:11:45', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('60306015-1a6f-8e7e-d256-55356b762df8', 'RA511-La Vista Blanc Expansive Condo with Mountain Views', 'ra511-la-vista-blanc-expansive-condo-with-mountain-views', 'This upstairs, three bedroom + loft condominium has oak furniture and mountain views. There is a fully equipped kitchen, balcony, 3 TVs, 2 VCRs, DVD, ceiling fan in the living room, wireless internet, telephone (local calls only) and woodstove (firewood provided). For children, the Mammoth Creek Park is next to the complex with easy access during the summer. The master bedroom is located on the first floor with a king bed. The second floor has two bedrooms with a king in one bedroom and a double bed in the other. The loft has three twins. This unit is non-smoking and has two outside parking spaces (unassigned). ', 'United States', 'California', 'Mammoth Lakes', '', '', '93546', '37.635721', '-118.969443', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-20 23:11:09', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 23:11:09', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('60f1a9bf-316c-5398-9e19-5532ba935cda', 'RA95-Civic Center Vista', 'ra95-civic-center-vista', 'Please note : this Property requires a 30 day minimum stay\n\nThe Civic Center Vista offers visitors the opportunity to stay near San Francisco’s City Hall by the historic Alamo Square while enjoying all of the comforts of home. This centrally located apartment is within walking distance of the San Francisco Opera House, Main Library, Victorian “Painted Ladies”, and Symphony Hall. There are numerous restaurants and shopping opportunities nearby in vibrant Hayes Valley and the Lower Haight district. Public transport is less than a block away. Not even fifteen minutes in the car will take you to the Golden Gate Bridge where you can enjoy breathtaking views of the bridge and the ocean either by car or on foot. If you go a little further, you can also find Golden Gate Park with the many museums and attractions in and around it, including the Conservatory of Flowers, the De Young Museum, the Japanese Tea Gardens, and the California Academy of Sciences.\n\nThe flat has a living room with fantastic views of downtown San Francisco, featuring a desk and a pull-out couch. The modern kitchen can be closed off so as not to disturb those in the living room, and is fully equipped with a coffeemaker and a small, eat-in area. There are two bedrooms—one master bedroom with a queen-sized bed and a second bedroom with two single beds. Fresh linens are provided and the bathroom contains both a shower and a bath tub.\n\nStreet parking', 'United States', 'California', 'San Francisco', '', '', '94117', '37.774781', '-122.431823', NULL, 0, '', 0, '0', 3, 2, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', 'b1667c1f-9e1f-85f3-9682-55317452e139', 1, 1, 'Y', 'N', 0, '2015-04-18 22:12:53', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:12:53', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('60f4e487-6683-4ffc-3232-55356bcea99c', 'RA542-Snowcreek Condo with Panoramic Views', 'ra542-snowcreek-condo-with-panoramic-views', 'This two-level, two bedroom + loft condominium has wireless internet and a panoramic view of Mammoth Rock, the Sherwin Mountains, and a lovely creek with lawn area steps away from the front door of the unit. There is a fully equipped kitchen, balcony, 2 TVs, DVD, VCR, washer/dryer, and a wood burning fireplace (firewood provided). The master bedroom downstairs has a king bed and guest bedroom has two twins. The open area loft has a queen bed. This unit is non-smoking and has two outside parking spaces (unassigned). During winter, the red line shuttle route is located on Minaret Road to the Village and Main Lodge. If the distance is too far to walk, then we recommend driving to the mountain. Eagle Lodge is the closest ski area located within a couple of miles.', 'United States', 'California', 'Mammoth Lakes', '', '', '93546', '37.631785', '-118.978702', NULL, 0, '', 0, '0', 4, 2, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-20 23:11:35', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 23:11:35', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('618705fc-8b06-f4cc-2c14-55355776ddc7', 'RA420-Pinnacle View', 'ra420-pinnacle-view', 'Located on Pinnacle Loop, this home has wonderful views of the mountains and is just minutes from Truckee and a short drive to all the major North Shore area ski resorts, Donner Lake, and Lake Tahoe. This modest but clean and comfy home will sleep 9 people max. There is a walkway with stairs that lead you down to the covered front door.\n\nOn the main level:\nFull kitchen with plenty of counter space and kitchen bar to sit at.\nLiving room has a wood burning stove, wrap around couch and lots of light\nDining area has a large table which seats 8\nThere are 2 bedrooms with Queen beds and a full bathroom with a shower/tub combo\n\nUpper level:\nMaster bedroom with King bed\nFull bathroom with shower / tub\nLoft area has 3 Twin beds along with a sofa seat that pulls out to a small Twin\nTV is located in the loft\n\nThere is flat parking for 4-5 cars, No garage.\n\nPlease let us know how many pets you are bringing, or if you are not bringing pets, and we will adjust the rate accordingly. Book 3 nights and get the 4th free (excluding holiday weeks). \n\nNo Smoking. Well behaved pets ok with approval and additional cleaning fee. ', 'United States', 'California', 'Truckee', '', '', '96161', '39.366870', '-120.248029', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-20 21:44:50', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:44:50', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('62d5b880-083e-6554-54a6-5535542f316c', 'RA370-Glen Airdrie', 'ra370-glen-airdrie', ' Located next to Jack London Park in Glen Ellen, this estate is truly a summer playground on 5.6 acres with a tennis court, swimming pool, sand volleyball court, and a horse shoe pit.\n\nThe main house has three bedrooms, den with fireplace, solarium, a large glass paneled living room/dining room, and eat-in kitchen with granite counter tops and stainless steel appliances. There is a charming one bedroom guest house with its own porch and kitchenette. The estate offers great privacy and tranquility.\n\nJack London Park, a state park with more than 1,000 acres, has wonderful hiking, mountain biking, and horse trails. There are also tours of Jack London''s museum, Wolf House, and experimental farm.Set amongst mature oaks and trees, it is beautifully landscaped with rock pathways and a charming gazebo. There are numerous olive, fig and citrus trees. With 5.6 acres, the property is secluded and very private. There are excellent restaurants and wine tasting rooms, plus a great local market with gourmet foods and deli just 4 minutes away by car.\n\nNon Smoking Only', 'United States', 'California', 'Glen Ellen', '', '', '95442', '38.358089', '-122.546945', NULL, 0, '', 0, '0', 8, 4, 4, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 21:32:36', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:32:36', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('6526cbfb-f245-5b7e-c5fd-55355f323128', 'RA333-Rivkin', 'ra333-rivkin-2', 'Beautiful custom home located on 11 acres in Tahoe Donner is the perfect place to get away from it all.  Brand new home with three bedrooms, loft, two and a half baths, and huge two car garage.  This home is located on a very desireable and quiet street in Tahoe Donner and has everything that you need.  The chef of the family will love the gourmet kitchen, which is fully stocked.\n\n\nAmenities\nDishwasher, DVD player, Fireplace, Freezer, Microwave, Oven, Refrigerator, Toaster, Vacuum Cleaners, Washer/Dryer, Pet Friendly, Garage, Lake Nearby, Skiing Nearby, Cooking Utensils Provided, Spices, Boating, River, Horseback Riding, Deck, Deck Furniture, Fully Equipped Kitchen, Gourmet Kitchen, Garbage Disposal, Linens, Television, Satellite/Cable Television, Hunting, Child Friendly, Elderly Friendly, Ice Maker, Coffee Maker, Stove Top Burner, Skiing, Cycling, Mountain Biking, Water Skiing, Wind-Surfing, Para-gliding, Swimming, Roller Blading, Tennis, Horse Riding, Sailing, Walking, Fishing, Golf', 'United States', 'California', 'Truckee', '', '', '96161', '39.355663', '-120.234259', NULL, 0, '', 0, '0', 6, 3, 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 22:21:04', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:21:04', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('65954512-ce7c-f666-c257-55355f72ec45', 'RA336-Chauvet Condo 1A', 'ra336-chauvet-condo-1a-2', 'Hotel Chauvet was originally built in 1906 and celebrated its centennial with a spectacular restoration and renovation, painstakingly accomplished over two years. The result is a historic landmark building with six luxurious vacation rentals, rejuvenated with locally made brick and reappointed by craftsmen, while upscale interior and state-of-the art amenities have been added.The lodging experience at The Chauvet is truly unique! Each unit is generously sized at almost 2,000 square feet. The large master bedrooms include a huge walk-in closet. The other two bedrooms in each unit are spacious as well. Both baths boast designer fixtures but the master features a jetted tub and separate glass enclosed shower with massage jets and rainhead. This unit also has handicapped accessible features.The kitchen would please any gourmet, and is outfitted with custom cabinetry, stainless steel appliances, granite counter tops, wine cooler and commercial-style gas cooktop, among other delights. Of course, if you don''t want to cook for yourself, you are just steps away from Glen Ellen''s "restaurant row" with a myriad of delicious choices... or walk across the street to Glen Ellen''s own gourmet market.A brief walk south brings you to Jack London Village with the local cheesemonger, chocolate shop (made on site), olive press and market, fantastic deli, market of locally produced gourmet items and another tasting room. Add to this vision the lovely outdoor, heated pool with sundeck patio, accessible from your own wide balcony off the master bedroom, and the views of the surrounding hillsides and native oak trees from every large picture window framed by brick arches.You will be more than comfortable at The Chauvet at any time of year, with energy efficient air conditioning and heating, a gas fireplace, full soundproofing, elevator access and private garage.The unit features: 3 bedrooms, master with king sized bed, 2nd bedroom with queen and the 3rd bedroom with a king sized bed that can convert to two twins upon request in five of the units. Queen sized sofa bed in living room of Unit 1B. 3rd bedroom in 2B only features a twin day bed with a pop up trundle (which can be made up as an Eastern king on request), couch and chaise. 2 luxurious bathrooms - the master has jetted tub, glass enclosed shower with shower panel featuring rain head and massage jets along with European style hand held.Ample closet space throughout, walk-in closet in master bedroomGourmet kitchen and formal dining space, with every amenityGas fireplace in living room, energy efficient central heat and air conditioningHeated outdoor pool surrounded by sun deckWide, private balcony with dining table & chairs, propane BBQWireless internet accessCable with expanded channels and on-demand movies (and a TV in each bedroom and living room)Designer furnishings and dramatic artwork from local artistsPaintings by local artists are exhibited in the unitsSumptuous beds with luxurious linens, and thick & thirsty towelsElevator access, intercom, covered parking in private garageWasher & dryer in the unitCentral location to wineries & tasting rooms, restaurants, farmers'' and gourmet markets - walk or bike within the charming village of Glen EllenLess than a mile from Jack London State ParkIncluded with your stay are complimentary:a bottle of wine and chocolatescookies in the cookie jarcoffee, tea, juice, yogurt, granola and fresh fruitwine passes for six to Arrowood, Chateau St. Jean, Gary Farrell and Taft Street Wineryreserve tastings at Cline and Jacuzzi2 for 1 tastings at Buena Vista, Geyser Peak, Gundlach Bundschu, and Ravenswoodupgraded tastings at LedsonSonoma Valley B & B Association passport for complimentary tastings for each guest at 25+ Sonoma Valley wineries\nPlease note: The pool is open year-round, however is not heated Nov. 1 through May. 14, per County regulations.\n\n "Travel trained" pets considered in Units 1A and 1B. Additional deposit required.Rates reduced for longer stays: Peak 4-5 nights $595/night, 6+ nights $550/night.  Off peak 3-5 nights $495/night, 6+ nights $450/night.  Balance will be adjusted with the final billing.You can also view Condo 1B, Condo 2A, Condo 2B, Condo 3A, and Condo 3B. for larger groups or other available dates. TOT 848N, 849N', 'United States', 'California', 'Glen Ellen', '', '', '95442', '38.362343', '-122.525923', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 22:21:17', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:21:17', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
