('66d0e7bd-5eb5-9211-1022-5535568f657d', 'RA403-Fairway Family Cabin', 'ra403-fairway-family-cabin', 'This adorable cabin is the perfect mountain getaway. Located right on the 16th fairway, it is quiet and peaceful, and comes with so many amenities! On the Entry level the Living room has a 32" flat-screen TV/DVD with full stereo system, quality furniture, a Double sleeper sofa and real wood stove. The Dining room has seating for 12 with two additional barstools. The Kitchen is fully equipped, including an Espresso machine and pass-through bar.\n\nThe first Bedroom has 1 Queen, the second bedroom has 1 Queen, and they chare a full bath with tub.  Upstairs you will find a loft with a Double futon for extra guests, and a third bedroom with 2 bunk beds, 2 extra Twins, and a Twin sized sleeper sofa (sleeping a total of 7).  There is also a second full bath with tub.  There is a charcoal BBQ available for summer guests.   This rental includes access cards for the Tahoe Donner Recreation Center resident amenities. A nominal charge applies for some activities. Book 3 nights and get the 4th free (excluding holiday weeks).  \n\nThis cabin provide Hi Speed Wireless Internet! (connection cannot be guaranteed)\n-Access to Tahoe Donner amenities (for nominal fee) including Rec center with work-out facility pools and hot tub, downhill ski area (perfect for teaching kids!), cross country ski area, equestrian center, tennis center, 18-hole golf and driving range, hiking, and so much more!\n-Mins from downtown Truckee!\n-Approx. 20 mins to Sugarbowl ski area, 30 mins to Squaw, 15 mins to Northstar, and 40 mins to Lake Tahoe This home comes complete with full kitchen and all linens/towels. \n\nNo Smoking. No Pets.', 'United States', 'California', 'Truckee', '', '', '96161', '39.344927', '-120.240722', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 21