('6c3b5aec-384f-44e4-07e4-5532c0f77200', 'RA233-Basque Northstar House', 'ra233-basque-northstar-house', 'This beautiful, three-bedroom home has a bright, open living room and stone fireplace, giving you and your family a comfortable space in which to spend some quality time together. In addition, this home grants you access to the Northstar Homeowners Swim and Racquet Club. This includes access to a pool, tennis courts, and even a hot tub! Located in Truckee, this home also places you within easy reach of all the fun that Lake Tahoe has to offer. A mere five minute drive will bring you to the Northstar Ski Resort where you can enjoy downhill and cross-country skiing along beautiful, tree-lined runs. The Northstar area also offers horseback riding, ice skating, mountain biking, tubing, hiking, fishing, and even a rock climbing wall! Then, when you’ve gotten off the slopes and want to unwind, you can spend some time browsing the many stylish boutiques and galleries or sit down for a meal at your choice of cafés and restaurants. For those with children seven and under, make sure to visit KidZone—a children’s museum with fun, interactive exhibits designed just for kids. With all this and more, this area is the perfect choice for your next getaway whether you’re looking for excitement or just some peace and quiet with breathtaking views.    ', 'United States', 'California', 'Truckee', '', '', '96161', '39.293083', '-120.126450', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '631c13a2-1961-0d99-7cd7-553184a48eb8', 1, 1, 'Y', 'N', 0, '2015-04-18 22:38:40', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:38:40', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('6ca78deb-348c-5bd6-3e87-5532bd2998d7', 'RA171-Jacarillo Trail Lodge', 'ra171-jacarillo-trail-lodge', 'This spacious and comfortable cabin will really make you feel like you''ve gotten away to the mountains! After a long day of enjoying the slopes, the private hot tub in this quiet woodsy environment will be a dream. The house also features a wood burning fireplace, foosball, and a 2-car garage. The property accommodates up to 12 people in 3 Bedrooms (1 King, 2 Queens, 1 Full, and 2 double futons) and 2 Baths. The South Lake Tahoe area features world-class ski resorts, hiking trails, parks, beaches, restaurants, recreation, boating and numerous other tourist attractions, as well as the nearby casinos of Stateline. A perfect year round vacation destination, with fantastic weather and breathtaking scenery.\n\nPermit number: VHR#750\n', 'United States', 'California', 'South Lake Tahoe', '', '', '96150', '38.903728', '-119.978010', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-18 22:24:32', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:24:32', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('6dfebbde-4879-089c-a060-55356b966521', 'RA545-Snowcreek Spacious Condo with Full View of Mammoth Mountain', 'ra545-snowcreek-spacious-condo-with-full-view-of-mammoth-mountain', 'This two bedroom plus loft, three bathroom condominium is spacious and beautifully furnished! Entry is located on the first floor and then up a flight of stairs to the main living area. This unit features a fully-equipped kitchen, balcony with full view of Mammoth Mountain, fireplace (decorative only), cable TV and wireless internet. There is a private washer/dryer in the unit. The living room has a Queen sofa sleeper. The Master bedroom has a King bed, private bath, and a flat screen TV. The second bedroom has a Queen bed with flat screen TV. The loft area has two twin beds along with a private full-size bathroom. Bring your cell phones, this unit has no telephone. No pets allowed.', 'United States', 'California', 'Mammoth Lakes', '', '', '93546', '37.624291', '-118.975781', NULL, 0, '', 0, '0', 5, 2, 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-20 23:11:37', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 23:11:37', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
