('6f8000b7-db60-e551-3615-5535642bff32', 'RA408-Herringbone Hideout', 'ra408-herringbone-hideout-2', 'What a delightful Tahoe Donner vacation retreat! This 3 bedroom, 2.5 bath home will sleep 8 comfortably, and less than 2 miles to the Tahoe Donner ski hill.\n\nUpstairs:\n-Master suite: queen bed, oversized reading chair, entrance to small private deck and master bath with tub/shower and dual sinks\n-Living room with gas fireplace, TV/DVD, seating for 5,\n-Dining area with seating for 6, open to kitchen and living room\n-fully stocked kitchen with bar seating for 1, open to dining and living room\n-entrance to back deck with charcoal BBQ (summer use only)\n-attached 2 car garage\n\nDownstairs:\n-Bedroom 2: queen bed\n-full bathroom with shower/tub\n-Bedroom 3: 2 bunk beds (4 twins- total sleeping for 4)\n-downstairs half bathroom\n\n-Hi Speed Wireless Internet! (connection cannot be guaranteed)\n-Access to Tahoe Donner amenities (for nominal fee) including Rec center with work-out facility pools and hot tub, downhill ski area (perfect for teaching kids!), cross country ski area, equestrian center, tennis center, 18-hole golf and driving range, hiking, and so much more!\n', 'United States', 'California', 'Truckee', '', '', '96161', '39.337873', '-120.236000', NULL, 0, '', 0, '0', 5.5, 3, 2.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 22:39:31', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:39:31', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('70c84e94-211b-fc61-9af4-553564b12641', 'RA429-St. Croix', 'ra429-st-croix-2', 'This adorable cabin is the perfect mountain getaway. It set set up for entertaining a large group and comes with so many amenities.\n\nThe entry level of this home includes living room, dining room and kitchen. There is also a gas fireplace, TV/DVD, cable and wireless internet. The kitchen has everything you may need for creating a feast and serving it up with style. There is a half bath in the hall across from the first Bedroom which has a Queen bed (sleeping for 2). The master bedroom is right next door with a Queen bed, TV and an attached bathroom with shower/tub. There is a Pak-n-Play in the closet as well. The second floor has a loft with a TV which open over the living room and 2 small beds suitable for kids. There are two bedrooms, one has a Queen bed and another one has 2 Twin beds (sleeping for 2). These rooms share a bathroom with a fuly shower/tub.\n\nThis home comes with a full kitchen and all linens and towels, and hi-speed wireless Internet access. 2 car garage along with slightly sloped driveway which can fit 4 cars are other available amenities. For summer guests, there is charcoal BBQ available.\n\nThis home comes with access cards to the Tahoe Donner HOA amenities including Beach Club Marina, Tennis Club, Golf, Equestrian center, Rec center with Fitness room, pools, hot tubs, and both cross-country and downhill skiing. Book 3 nights and get the 4th free (excluding holiday weeks).\n\n\n', 'United States', 'California', 'Truckee', '', '', '96161', '39.360380', '-120.241053', NULL, 0, '', 0, '0', 6.5, 4, 2.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '631c13a2-1961-0d99-7cd7-553184a48eb8', 1, 1, 'Y', 'N', 0, '2015-04-20 22:43:07', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:43:07', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('7337542c-37ce-29f1-cda3-55355e2b68f1', 'RA419-Pine Needle Meadows', 'ra419-pine-needle-meadows-1', 'Remodeled from head-to-toe, Ponderosa Palisades home has brand new hardwood flooring and carpet, granite counters and upgraded tile, full of sunlight and warm finishes. This home is perfect for families and their dogs, too!The main level of Poderosa Palisades has a large living area with seating for 5, plus a brand new 40" plasma TV (not pictured), as well as lots of sunlight and open space! The remodeled kitchen comes with granite counters, TWO dual sinks, and looks out over the large yard. The dining room has plenty of seating, and there is a full bathroom with shower, as well as laundry room - all with up-scale tile and granite.Sleeping on the main floor includes one bedroom with a Full futon, and another bedroom with a Twin/Full bunkbed (sleeping 3). The entrance to the large deck area is also on the main floor. Step onto the deck through the sliding doors and enjoy views of the large yard while cooking on the gas BBQ.Upstairs you will find the Master bedroom with King bed (Please note that there are 2 window benches that can sleep one child each, measure approx. 3'' x 5'', and not included in total sleeping number as they do not sleep adults) and Master bathroom, with large jetted tub and separate shower, dual sinks . . . all upgraded! High speed wireless Internet is available (subject to connectivity)Large yard, quiet neighborhood...located within 20 mins to all ski resorts and Lake Tahoe, why rent a hotel room when you can have a home for the same price! Please note that there is parking for 4, but the garage is non-accessible storage space. This Pet Friendly property has a small fee included in its balance. Please let us know how many pets you are bringing, or if you are not bringing pets, and we will adjust the rate accordingly. However, no cats are permitted due to allergies. ', 'United States', 'California', 'Truckee', '', '', '96161', '39.312745', '-120.175490', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '631c13a2-1961-0d99-7cd7-553184a48eb8', 1, 1, 'Y', 'N', 0, '2015-04-20 22:14:37', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:14:37', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('7669c8ea-1273-ea7b-f15a-553564de7c1d', 'RA426-Squaw Valley Paradise ', 'ra426-squaw-valley-paradise-2', 'Fabulous and private, this house is completely remodeled and newly furnished. It is only one minute from the Village at Squaw and 5 minutes from the Resort at Squaw Creek for skiing. The bike path is across the street from the house, allowing easy access for walking to the village and hiking in the summer.The spacious open-plan living plan with entertainment area, kitchen, dining and living room creates the perfect atmosphere for entertaining and family gatherings. The pristine condition, new furnishings, linens, all new spa-like bathrooms, appliances and kitchen make this house a relaxing no hassle get away.You will enjoy the two master suites with California King beds (sleeping for 4), one en suite Queen bedroom, one Queen guest room with extra Twin, and private hall bathroom and the six bunk kids room.The house also features an oversized one garage with parking for an additional 5 cars in the driveway, 8 person hot tub, entertainment area with flat screen satellite TV, DVD, and surround sound, wood burning fireplace in the living room with separate overhead stereo system, mud room with lots of storage and washer/dryer.With an exceptional floor plan and a lovely yard with deck and hot tub set off the road up a gently graded driveway you find paradise in this house. It is superb convenience to year round activities on your doorstep. This home is exceptional and the amenities and decor will make this a memorable vacation. ', 'United States', 'California', 'Olympic Valley', '', '', '96146', '39.201403', '-120.224917', NULL, 0, '', 0, '0', 9, 5, 4, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '631c13a2-1961-0d99-7cd7-553184a48eb8', 1, 1, 'Y', 'N', 0, '2015-04-20 22:42:36', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:42:36', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('76e0fe9c-ccc5-e56b-9ba3-5535638989bd', 'RA397-Darling Delight Cabin', 'ra397-darling-delight-cabin-2', 'Meander up the stone pathway to your tranquil place of retreat. This quaint getaway is on 5 private acres and features a gourmet kitchen with stainless steel appliances. Relax in front of the stone fireplace, grill on the gas BBQ, or soak in the peaceful hot tub nestled on the sunny deck. Hike miles of trails on Forest Service land, enjoy a bike ride on the paved bike path, stroll down to the nearby private beach with picnic area and playground.  This "old Tahoe" style cabin is a couples delight or perfect setting for a small family.Located just 5 minutes from Tahoe City''s beaches, music festivals, and farmers markets. World class dining is just around the corner, as well as boutique shopping and art galleries. Just 15 minutes to Squaw Valley, Alpine Meadows, and Homewood Mountain Ski Resorts!Downstairs is the Living Room with a pull-out couch (sleeps 2), Fireplace, TV/DVD/Stereo, and beautifully remodeled kitched with granite counters.\nThe Master bedroom has a Queen sized bed and private bath. \n-access to deck with BBQ (summer use only) and private hot tubUpstairs is a loft with two Twins, full bath, and a double sized Aerobed available.  There is no washer/dryer at this cabing, and HOA private beach access is included, as well as high speed wireless internet.  Pets may be considered at an additional cost. -small children''s play area/deskPlease note that during winter months 4-wheel drive + chains highly recommended for driveway.Book 3 nights and get the 4th free (excluding holiday weeks). ', 'United States', 'California', 'Tahoe City', '', '', '96146', '39.145535', '-120.155845', NULL, 0, '', 0, '0', 4, 2, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '631c13a2-1961-0d99-7cd7-553184a48eb8', 1, 1, 'Y', 'N', 0, '2015-04-20 22:35:36', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:35:36', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('77e08730-2dde-928f-43fd-55355d21685d', 'RA408-Herringbone Hideout', 'ra408-herringbone-hideout-1', 'What a delightful Tahoe Donner vacation retreat! This 3 bedroom, 2.5 bath home will sleep 8 comfortably, and less than 2 miles to the Tahoe Donner ski hill.\n\nUpstairs:\n-Master suite: queen bed, oversized reading chair, entrance to small private deck and master bath with tub/shower and dual sinks\n-Living room with gas fireplace, TV/DVD, seating for 5,\n-Dining area with seating for 6, open to kitchen and living room\n-fully stocked kitchen with bar seating for 1, open to dining and living room\n-entrance to back deck with charcoal BBQ (summer use only)\n-attached 2 car garage\n\nDownstairs:\n-Bedroom 2: queen bed\n-full bathroom with shower/tub\n-Bedroom 3: 2 bunk beds (4 twins- total sleeping for 4)\n-downstairs half bathroom\n\n-Hi Speed Wireless Internet! (connection cannot be guaranteed)\n-Access to Tahoe Donner amenities (for nominal fee) including Rec center with work-out facility pools and hot tub, downhill ski area (perfect for teaching kids!), cross country ski area, equestrian center, tennis center, 18-hole golf and driving range, hiking, and so much more!\n', 'United States', 'California', 'Truckee', '', '', '96161', '39.337873', '-120.236000', NULL, 0, '', 0, '0', 5.5, 3, 2.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 22:13:33', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:13:33', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL);
