('78c47b6e-1e19-1cdf-803a-5532bf0ce409', 'RA200-Donner Lane Home', 'ra200-donner-lane-home', 'This large family home is within walking distance to Heavenly Ski Resort, and features an upstairs living / family area and pool table. Front deck has a hot tub and patio seating.You will also find a swedish fireplace with conversation area, and a CD Stereo with MP3 jack. There is a private hot tub on the front deck for your enjoyment. All bedrooms are located downstairs for easy access. This property sleeps 12 in 4 Bedrooms (1 King, 2 Queens, 1 Full, 3 Twins, and 1 Queen Hide-a-Bed) and 3 bathrooms.The South Lake Tahoe area features world-class ski resorts, hiking trails, parks, beaches, restaurants, recreation, boating and numerous other tourist attractions, as well as the nearby casinos of Stateline. A perfect year round vacation destination, with fantastic weather and breathtaking scenery.Permit number: VHR#103740', 'United States', 'California', 'South Lake Tahoe', '', '', '96150', '38.939708', '-119.946412', NULL, 0, '', 0, '0', 7, 4, 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-18 22:33:16', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:33:16', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('7a1a90a4-c6f3-4a8f-0f02-55355ce637ac', 'RA384-Aspen Grove Townhouse', 'ra384-aspen-grove-townhouse-1', 'This comfortable Northstar condo is perfect for families and is conveniently located just minutes away from the Village, recreation center and lifts. On the entry level you''ll find one bedroom with a Queen bed and private deck and another bedroom with a Full and Twin bunk bed (can sleep 3), as well as a newly remodeled bathroom with tub and shower.The second floor hosts the living room with "Tahoe Lodge" themed decor. The pull-out sofa sleeps 2, and the comfortable furnishings, 42" flat-creen TV, and deck entry with propane right of the side make for a wonderful gathering area for your group. The kitchen, also on the second level, as all the amenities you could need, and the dining area provides seating for 5.The third floor includes the Master bedroom with a King bed, and a newly remodeled bathroom with an extra sink. Other house-wide amenities include hi-speed wireless internet (though connection cannot be guaranteed), and a full set of linen and towels for your stay.With just a 1/2 mile walk to the Village, and Recreation Center access (for a nominal fee) that includes a Hot Tub, Pool, weight room, and kid''s play room, you can''t find a better location. Enjoy the shopping, dining, iceskating, downhill mountain biking, and the on-demand Northstar shuttle that will take you to see it all!Book 3 nights and get the 4th free (excluding holiday weeks). No Smoking. No Pets', 'United States', 'California', 'Truckee', '', '', '96161', '39.279782', '-120.119018', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 22:05:39', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:05:39', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('7dbfbabd-3326-5ad7-2439-553558ec5333', 'RA343-Chauvet Condo 1B', 'ra343-chauvet-condo-1b-1', 'Hotel Chauvet was originally built in 1906 and celebrated its centennial with a spectacular restoration and renovation, painstakingly accomplished over two years. The result is a historic landmark building with six luxurious vacation rentals, rejuvenated with locally made brick and reappointed by craftsmen, while upscale interior and state-of-the art amenities have been added.The lodging experience at The Chauvet is truly unique! Each unit is generously sized at almost 2,000 square feet. The large master bedrooms include a huge walk-in closet. The other two bedrooms in each unit are spacious as well. Both baths boast designer fixtures but the master features a jetted tub and separate glass enclosed shower with massage jets and rainhead. This unit also has handicapped accessible features.The kitchen would please any gourmet, and is outfitted with custom cabinetry, stainless steel appliances, granite counter tops, wine cooler and commercial-style gas cooktop, among other delights. Of course, if you don''t want to cook for yourself, you are just steps away from Glen Ellen''s "restaurant row" with a myriad of delicious choices... or walk across the street to Glen Ellen''s own gourmet market.A brief walk south brings you to Jack London Village with the local cheesemonger, chocolate shop (made on site), olive press and market, fantastic deli, market of locally produced gourmet items and another tasting room. Add to this vision the lovely outdoor, heated pool with sundeck patio, accessible from your own wide balcony off the master bedroom, and the views of the surrounding hillsides and native oak trees from every large picture window framed by brick arches.You will be more than comfortable at The Chauvet at any time of year, with energy efficient air conditioning and heating, a gas fireplace, full soundproofing, elevator access and private garage.The unit features: 3 bedrooms, master with king sized bed, 2nd bedroom with queen and the 3rd bedroom with a king sized bed that can convert to two twins upon request in five of the units. Queen sized sofa bed in living room of Unit 1B. 3rd bedroom in 2B only features a twin day bed with a pop up trundle (which can be made up as an Eastern king on request), couch and chaise. 2 luxurious bathrooms - the master has jetted tub, glass enclosed shower with shower panel featuring rain head and massage jets along with European style hand held.Ample closet space throughout, walk-in closet in master bedroomGourmet kitchen and formal dining space, with every amenityGas fireplace in living room, energy efficient central heat and air conditioningHeated outdoor pool surrounded by sun deckWide, private balcony with dining table & chairs, propane BBQWireless internet accessCable with expanded channels and on-demand movies (and a TV in each bedroom and living room)Designer furnishings and dramatic artwork from local artistsPaintings by local artists are exhibited in the unitsSumptuous beds with luxurious linens, and thick & thirsty towelsElevator access, intercom, covered parking in private garageWasher & dryer in the unitCentral location to wineries & tasting rooms, restaurants, farmers'' and gourmet markets - walk or bike within the charming village of Glen EllenLess than a mile from Jack London State ParkIncluded with your stay are complimentary:a bottle of wine and chocolatescookies in the cookie jarcoffee, tea, juice, yogurt, granola and fresh fruitwine passes for six to Arrowood, Chateau St. Jean, Gary Farrell and Taft Street Wineryreserve tastings at Cline and Jacuzzi2 for 1 tastings at Buena Vista, Geyser Peak, Gundlach Bundschu, and Ravenswoodupgraded tastings at LedsonSonoma Valley B & B Association passport for complimentary tastings for each guest at 25+ Sonoma Valley wineries\nPlease note: The pool is open year-round, however is not heated Nov. 1 through May. 14, per County regulations.\n\n\n"Travel trained" pets considered in Units 1A and 1B. Additional deposit required.Rates reduced for longer stays: Peak 4-5 nights $595/night, 6+ nights $550/night.  Off peak 3-5 nights $495/night, 6+ nights $450/night.  Balance will be adjusted with the final billing.You can also view Condo 1A, Condo 2A, Condo 2B, Condo 3A, and Condo 3B. for larger groups or other available dates. TOT 848N, 849N', 'United States', 'California', 'Glen Ellen', '', '', '95442', '38.362343', '-122.525923', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 21:51:26', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:51:26', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('7dc20a08-952d-3213-3a2d-5532bd05584b', 'RA180-Sky Meadows Retreat', 'ra180-sky-meadows-retreat', 'This comfortably furnished home is located in a peaceful, wooded neighborhood of South Lake Tahoe. With two bedrooms and a loft, it has plenty of room for everyone in your family. The washer and dryer make laundry easy. Add the fully quipped kitchen and you’re set with all your basic needs covered so that you can focus on what really matters—enjoying your vacation! Watch a movie in comfort on the wide-screen TV with a fire in the hearth or enjoy the scenery from the patio with some sizzling, fresh barbeque. If you’re traveling with an extra large party, this home is also mere seconds away from several other rental properties. Just look for the Sky Meadows Court and Sky Meadows Home.Located in Sky Meadows, this home gives you easy access to a variety of venues from great restaurants to shops, galleries and more! Treat yourself to some fantastic food at the Fresh Ketch Lakeside Restaurant in the Tahoe Keys Marina a mere four minutes drive away. Not only does it have a Seafood Bar, it also offers fine dining upstairs with a view of the lake. Also only four minutes away is the Eagle Valley Frames and Art Gallery and Hanifin’s Arts and Antiques where you can find a collection of works by local artists. If you came to ski, a fourteen minute drive will take you to the Heavenly Ski Resort! You can also go boating and fishing or hike one of the area’s many trails as you enjoy Tahoe’s breathtaking scenery.2 night minimum required. Prices do not reflect taxes and cleaning fee. Holiday Weekends Excluded. \n\nPermit number: VHR#102449', 'United States', 'California', 'South Lake Tahoe', '', '', '96150', '38.922129', '-119.995299', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-18 22:26:01', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:26:01', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
