('7e2416c1-ad0c-9799-b0be-55355cb5d5e1', 'RA386-Bernese Mountain Home', 'ra386-bernese-mountain-home-1', 'Welcome to The Bernese Mountain Home, a very private and newer 3 bedroom, 2.5 bathroom home in lower Tahoe Donner just a short drive to Truckee and all major Tahoe ski resorts. The home is accessed through a covered walkway (perfect for snowy days and all your gear) or directly from the two-car garage.\n\nUpstairs is the living room, kitchen, half-bath, and Master bedroom with a full bath and walk-in closet.\n\nDownstairs are two more bedrooms with a shared second bath. There are three decks; a primary deck off the living room, and two smaller decks off the master and second guest bedroom leading directly to a private backyard. The main living area upstairs includes a fully stocked kitchen open to the dinning area and living room. There is countertop seating as well as a dining area with seating for six. The living room is wide open with high vaulted ceilings and full-length windows offering lots of light with great sun exposure. There is a queen sized sofa couch in the living room. On-site amenities include TV/DVD/Cable/Phone and high speed wireless internet. There is a gas fireplace in the living room for a cozy evening with friends, and a gas BBQ for summer fun on the large main deck. The Master bedroom has a King Duxiana bed, TV/Cable, walk-in closet, and a full bathroom with shower/tub and double sinks. Downstairs are the guest bedrooms, one with a Queen bed and direct access to the backyard; and the other (perfect kids room) has two bunk beds (sleeping 4). The guest rooms share a full bathroom with a shower/tub combo and single sink. The Bernese Mountain Home is only about two miles to the Tahoe Donner downhill ski area.\n\nTahoe Donner is a wonderful, mountain resort community with its own private downhill ski area, a fantastic cross country ski center, a sledding hill, small market/deli, and Recreation Center. The Center offers hot tubs, a heated pool, fitness center, saunas, health spa, tennis courts, downhill and cross country ski resorts, equestrian center, Golf Club with 18-hole course and driving range, a public restaurant (The Lodge at Tahoe Donner), and a private beach on Donner Lake. Tahoe Donner is conveniently situated at the upper west end of Truckee and is just minutes to downtown shopping and restaurants. Ski area resorts including Northstar at Tahoe, Squaw, Alpine Meadows, Sugarbowl, Soda Spring, Donner Ski Ranch, and Royal Gorge Cross Country Center are just a short 15-30 minutes away. Your rental of The Bernese Mountain Home includes access cards for the Tahoe Donner Recreation Center resident amenities. A nominal charge applies for some activities. Please note that the driveway is sloped, so 4WD or chains are recommended for all winter visitors. ', 'United States', 'California', 'Truckee', '', '', '96161', '39.338785', '-120.218375', NULL, 0, '', 0, '0', 5.5, 3, 2.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 22:06:39', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:06:39', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('7e999691-8a20-39fd-1d87-55356b41b515', 'RA517-Mountain Shadows Affordable Studio Condo', 'ra517-mountain-shadows-affordable-studio-condo', 'This downstairs, studio condominium has been newly decorated and furnished with a tropical theme. There is a fully equipped kitchen without a dishwasher, small balcony, TV, DVD, CD player and woodstove (firewood provided). Don''t forget your cell phone because this unit does not have a telephone. The queen bed is a Murphy bed that pulls out of the wall. The alcove area by the entrance has a set of bunk beds. This unit is non-smoking and has one outside parking space (unassigned).\n\nShared pool can be used summer only.', 'United States', 'California', 'Mammoth Lakes', '', '', '93546', '37.641639', '-118.969058', NULL, 0, '', 0, '0', 3, 2, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 23:11:13', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 23:11:13', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('7eceee57-b060-dc34-9be3-5532b8d5ebc4', 'RA64-Ocean View Terrace', 'ra64-ocean-view-terrace', 'Ocean View Terrace is an unforgettable property in one of San Francisco''s most exciting and desirable areas. From the car garage, take the private elevator up to a home perched on a cliff and marvel at the panoramic view from the Golden Gate Bridge to the Ferry Building. While the property rests atop the tourist activity of North Beach''s Ghiradelli Square, Fisherman’s Wharf, Coit Tower, and Lombard Street, it still offers a serene and relaxing environment.Upon entering the unit you will find a gracious living room with a complete entertainment area and plasma television. The dining area is located next to the living room and boasts the same fantastic views of the San Francisco Bay and waterfront. The modern kitchen is fully equipped to service up to eight people. There is a very comfortable solarium that opens onto a large terrace. On the terrace you will find a gas grill and furniture to facilitate outdoor dining. Every area is filled with natural lightThe master bedroom is elegantly appointed and has a separate seating area. It includes a private and spacious bathroom with a view towards the South Bay. The second bedroom has two single beds that can be turned into a King, as well as a full bathroom. The property sleeps four comfortably.\n\nStreet parking', 'United States', 'California', 'San Francisco', '', '', '94133', '37.804392', '-122.406590', NULL, 0, '', 0, '0', 4, 2, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', 'b1667c1f-9e1f-85f3-9682-55317452e139', 1, 1, 'Y', 'N', 0, '2015-04-18 22:04:59', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:04:59', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('7f68afef-0cb1-7ab8-2c9d-553565533c10', 'RA433-Tahoe Donner Classic', 'ra433-tahoe-donner-classic', 'Retreat to this newly constructed, classic home with year-round amenities. Enjoy the winter playgrounds nearby with Alpine and Nordic skiing, snowboarding, snowshoeing, and snowmobiling. After an active day, relax in peaceful Tahoe Donner by the warm fireplace.\n\nDuring the summer months the home owners'' association hosts activities including hiking, horseback riding, golfing, water sports, kayaking, mountain biking. HOA amenities include a full recreation center and workout facility, equestrian center, private lake beach, golf, and 2 pool areas.\n\nUpstairs: Open and Bright Living Room with Leather Sofas, 32" TV/DVD, gas Fireplace Gourmet Kitchen with Granite Counters, Stainless Steel Appliances, Breakfast Bar\n\nMaster bedroom with KING bed and private deck. Master bathroom with Jacuzzi tub and double-head shower. Sunny Deck with Wooded View\n\nDownstairs: Bedroom 2 with QUEEN bed\nBedroom 3 with QUEEN bed\nBedroom 4 with TWIN Bunkbed and TWIN sleeper sofa\nBathroom with Double Sinks and Shower/Tub Second Living Room with DOUBLE pullout couch, 27" TV/VCR/DVD, gas Fireplace, Foosball, and Deck\n\nPull your boots off or hang your water sports toys in the mudroom just off the two-car garage.\nThis home comes complete with full kitchen and all linens and towels.\n\nWi-Fi Access Available (connection not always guaranteed.) Gas Barbeque and Deck furniture available for summer guests. The majority of guests must be over the age of 25.\n\n**No Smoking**No Pets**\n\nBook for 3 nights, 4th Night Free! (some exclusions may apply)\n', 'United States', 'California', 'Truckee', '', '', '12345', '39.360461', '-120.241346', NULL, 0, '', 0, '0', 6.5, 4, 2.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 22:45:02', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:45: