('808f2e47-2765-5559-e351-55356b646c6d', 'RA529-Rainbow Villas Townhouse Style Condo with Sunny Exposure', 'ra529-rainbow-villas-townhouse-style-condo-with-sunny-exposure', 'This three level, two bedroom + loft condominium is townhouse style with sunny exposure and views of trees and Lincoln Mountain. The two master bedrooms on the first level have a queen bed. The loft has a twin bed and a set of bunk beds with a double on the bottom and twin on top. There is a fully equipped kitchen, balcony, 4 TVs, 2 DVDs, VCR, telephone (local calls only) and woodstove (firewood provided). This unit is non-smoking and has two outside parking spaces (unassigned).\n\nPlease Note: Spa closed for the summer months (will reopen by Thanksgiving).', 'United States', 'California', 'Mammoth Lakes', '', '', '93546', '37.646836', '-118.997305', NULL, 0, '', 0, '0', 5, 2, 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 23:11:24', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 23:11:24', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('80ab3120-3611-3138-f522-5532c14c257b', 'RA303-Kuuipo', 'ra303-kuuipo', 'On Kauai’s north shore in the charming town of Hanalei, this Hawaiian plantation style home is very comfortable and has a fenced yard that is ideal for families.\n\nIts location, across the street from a beach access path makes it a very short walk to the beach at crescent shaped Hanalei Bay.\n\n2 houses on one property (Ipo Hale). Rent both homes for larger groups, Kuuipo is the front house and smaller of the two.\n\n\nOther amenities:Kitchen: Refrigerator, Toaster, CookwareLiving: Ceiling Fans, Linens, Ironing BoardBusiness: Nearby ATM, Nearby Post Office, Nearby Internet Cafe, Nearby FedEx, Nearby Bank, TAT # W35432026-01, TVR 1159Convenience: Nearby Medical Services, Nearby Grocery, Walking distant to townGeographic: Near Beach, Close to Town ', 'United States', 'Hawaii', 'Hanalei', '', '', '96714', '22.205062', '-159.497635', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '7563d166-94d8-834c-3042-553185ff9837', 1, 1, 'Y', 'N', 0, '2015-04-18 22:40:38', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:40:38', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('81f54845-a32a-30e5-e4af-553563fcd224', 'RA402-Eagle''s Nest', 'ra402-eagle-s-nest-2', 'Lovely home in Tahoe Donner with open, light living area, plenty of room for one or more families. You may bring the pets (with prior approval).\nThe driveway can be icy and slippery in the winter months and can be difficult to get up even with a 4WD vehicle. We recommend a 4WD vehicle + chains for entry when ice is present, or parking at the bottom of the driveway (be sure to park off the road and off the neighbor''s driveway)\n\nWhat a delightful Tahoe Donner vacation retreat! This 3 bedroom, 2.5 bath home will sleep 10 comfortably.Main level (upstairs): Master bedroom: Queen bed. Master bath with shower/jacuzzi tub, dual sinks. Living room: open and inviting with wood fireplace, TV/DVD, game table and reading chair, plus pull-out sofa with seating for 6+. Dining area: seating for 6. Entrance to attached garage. 1 bay open for guests. Entrance to back deck with gas BBQ (summer use only)Downstairs: Bedroom 2: Queen bed. Bedroom 3: 1 bunk bed (Twin and Double) plus additional Twin (total sleeping for 4). Full bathroom with shower/tub. Half bathroomLoft: Queen futon with small TVThe driveway is short but very steep. Can be icy and slippery in the winter months and can be difficult to get up even with a 4WD vehicle. 4WD vehicle only + chains for entry when ice is present, or parking at the bottom of the driveway for 1 car only (be sure to park off the road and off the neighbor''s driveway). Hi Speed Wireless Internet! (connection cannot be guaranteed). Access to Tahoe Donner amenities (for nominal fee) including Rec center with work-out facility pools and hot tub, downhill ski area (perfect for teaching kids), cross country ski area, equestrian center, tennis center, 18-hole golf and driving range, hiking, and so much more. Mins from downtown Truckee. Approx. 20 mins to Sugarbowl ski area, 30 mins to Squaw, 15 mins to Northstar, and 40 mins to Lake Tahoe This home comes complete with full kitchen and all linens/towels.\n\n**No Smoking** ***Pets allowed with prior approval*** The majority of guests must be over the age of 25.', 'United States', 'California', 'Truckee', '', '', '96161', '39.357024', '-120.223562', NULL, 0, '', 0, '0', 5.5, 3, 2.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '631c13a2-1961-0d99-7cd7-553184a48eb8', 1, 1, 'Y', 'N', 0, '2015-04-20 22:37:14', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:37:14', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('836a0325-9443-e92b-c970-5532ba4b3794', 'RA87-Petite Noe Cottage', 'ra87-petite-noe-cottage', 'Please note : this Property requires a 30 day minimum stay\n\nThe Petite Noe Cottage offers everything you need for your stay in San Francisco at a very economical rate.The cottage is completely private and located in the heart of the Noe Valley district. Just minutes within walking distance of the exciting Mission District, this unit is designed for the couple or single guests who require less space.For less than the cost of a hotel room the cottage is quite generous. To maximize convenience the queen-sized sofa bed can be folded away during the day thereby enlarging the area. There is a large flat screen television and a full kitchen in the same vicinity adjacent to the full-sized bathroom.The cottage also has a private deck in the back yard with a very nice seating area. In addition to the yard, guests also have access to the buildings washer and dryer. \n\n\nNo parking available', 'United States', 'California', 'San Francisco', '', '', '94131', '37.748576', '-122.426197', NULL, 0, '', 0, '0', 3, 2, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-18 22:10:46', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:10:46', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('847911a0-85ad-39a8-d3bf-55356a1a19aa', 'RA495-Spacious Discovery 2 Bedroom Condo', 'ra495-spacious-discovery-2-bedroom-condo', 'This two bedroom plus loft, two and a half bathroom condominium is located on the second floor. Entryway opens up to a mud room with significant storage for boots, skis, and snowboards. It has a spacious living room with 32" TV (cable provided) and DVD player and a wood burning fireplace, a dining area for seven, and a fully equipped kitchen with newer appliances, and wireless internet. There is a balcony off of the dining area which is used for firewood storage. The master bedroom has a King size bed with a private bath (stand up shower only) and a TV (cable provided) and DVD player. The 2nd bedroom has a King size bed with a TV (cable provided) and DVD player. The open loft area has four twin beds and a half bath (no shower/tub). ', 'United States', 'California', 'Mammoth Lakes', '', '', '93546', '37.642364', '-118.994208', NULL, 0, '', 0, '0', 4.5, 2, 2.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 23:06:01', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 23:06:01', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('849986d6-3a0f-9f78-497e-55356ba660fc', 'RA558-Sierra Megeve 3 Bedroom Condo with Spa Tub      ', 'ra558-sierra-megeve-3-bedroom-condo-with-spa-tub', 'This second floor, three bedroom condominium is located in building 4. There is a fully equipped kitchen, balcony, 3 TVs, DVD, VCR, telephone (local calls only) and woodstove (firewood provided). Both master bedrooms have a king bed. The master bedroom upstairs has a spa tub in the bathroom. Great for relaxation! The guest bedroom downstairs has a twin bed and a set of bunk beds. The living room has a sofa sleeper. This unit is non-smoking and has one assigned underground parking space (garage height 7''2"). One additional vehicle parks in guest spot underground or outside depending on parking availability. ', 'United States', 'California', 'Mammoth Lakes', '', '', '93546', '37.644083', '-118.999806', NULL, 0, '', 0, '0', 6, 3, 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 23:11:43', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 23:11:43', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('84f30331-abda-6fc3-29a0-5532c07f13dc', 'RA248-SummerHouse Cottage', 'ra248-summerhouse-cottage', 'Surrounded by roses and a vineyard, the Summer House cottage offers secluded country tranquility just 2 miles east of downtown Sonoma and an easy bike ride to four nearby wineries. This 600 square foot one bedroom, one bath guest house sleeps six and includes a spacious living room, fully equipped kitchenette and has a private entrance.\n\nThe wrap-around covered porch encourages relaxation, conviviality and the perfect place to discuss the day''s events. This property is perfect for a romantic get away or the ultimate girls weekend.\n\nCheck-in time is 3PM and check-out time is 11AM.\n\nSorry, no pets! Non Smoking Only! We do not recommend that children under 12 stay at the guest house. Wheel chair not accessible.\n\nYour hosts are on property and may be available to assist in dinner or winery suggestions!Note: This property does not accept same-day turnaround. There must be at least one full day between bookings.', 'United States', 'California', 'Sonoma', '', '', '95476', '38.285989', '-122.425496', NULL, 0, '', 0, '0', 2, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-18 22:38:53', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:38:53', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('8707f52e-fea5-4779-008c-5532c35c3e09', 'RA199-June Way Cabin', 'ra199-june-way-cabin-1', 'Have your perfect Tahoe retreat in this awesome ski cabin. This cozy vacation home is just a half a block walk from world-renowned Heavenly. Featuring an indoor sauna, private hot tub, and horseshoe pit, June Way Cabin has all the comforts of home, and then some! This property is perfect for large groups with five comfortable bedrooms: one containing a King bed, three with Queen beds, and bunk room (Double/Twin). There is a full sized kitchen with basic supplies, washer/dryer, cable TV, 2 DVD players, and inset living room seating around the fireplace. The two decks have plenty of space, a BBQ, and excellent views of Heavenly. Have the relaxed vacation of your dreams with family or friends (and your pets!) any time of year.The South Lake Tahoe area features world-class ski resorts, hiking trails, parks, beaches, restaurants, recreation, boating and numerous other tourist attractions, as well as the nearby casinos of Stateline. A perfect year round vacation destination, with fantastic weather and breathtaking scenery.\n\nPermit number: VHR#2364\n\n ', 'United States', 'California', 'South Lake Tahoe', '', '', '96150', '38.937051', '-119.942328', NULL, 0, '', 0, '0', 7.5, 5, 2.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-18 22:48:22', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:48:22', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('8899166c-a4b9-bfac-676a-5532bb88aa7b', 'RA135-Fabulous, Modern ''Green'' Mission Home - Wind & Sun Powered', 'ra135-fabulous-modern-green-mission-home-wind-sun-powered', 'Please note that there is a 72 hr cancellation policy. Contact RedAwning directly for Availability. \nThis 2 story, 2 unit building with private street entrance was built 3 years ago and has been featured in countless magazines, television shows, commercials and more. The Discovery Channel calls it one of the "World''s Greenest Homes."It is powered by the sun and the wind and features all the latest in green energy and design.1,800 square feet make this spacious flat extremely comfortable for a couple, a family or a bunch of friends and is an experience in itself. You probably won''t want to leave! The ground floor sleeps 8 comfortably in 3 bedrooms, 2 full baths - one with a hot tub and one with a steam room.The second floor is an open floor plan with living room, kitchen and dining room that open onto a deck, a powder room and a laundry room. The pull out couch on this level can also sleep 2 more.There are 2 televisions with cable tv. The location is in the heart of the famous Mission district and walking distance from everything you will want and need including public transportation. The Mission district is famous for having the best restaurants and nightlife in the city. Enjoy San Francisco''s best weather in the sunny Mission! Many beautiful parks and shopping are all walking distance.The owner has been in this amazing city for over 20 years and can fill you in on the best of the best in San Francisco.\n\nNon smoking only!\n\n\nAdditional amenities:Towels ProvidedLinens ProvidedHeatingWater CoolerFiltered WaterActivities GuideLocal MapsParking Off Street: parking space right in front of houseParking On StreetCommunal Pool: The public pool is located a short block away. It is a huge pool for laps, work out or fun\nAttractions:Bay/SoundBotanical GardenChurchesCinemasLibraryMuseumsPlaygroundRecreation CenterTheme ParksLive TheaterArboretumRestaurantsZooHealth/Beauty Spa\nLeisure Activities:Horseback RidingBeachcombingBird WatchingEco TourismAntiquingWhale WatchingSight SeeingHorseshoesMiniature GolfShoppingWildlife ViewingBoating\nLocal services and businesses:ATM/BankBabysitterMassage TherapistMedical ServicesFitness CenterGroceriesHospitalLaundromat\nSports and adventure activities:SailingMountain BikingBasketball CourtSnorkeling/DivingParasailingRock ClimbingKayakingSnorkelingSurf FishingSwimmingTennisCyclingGolfWind-SurfingScuba Diving Or SnorkelingSurfingHikingJet Skiing\n Please note: Rates are based on 5 guests; additional booking fee of $50 per person per night for parties of 6 or more (children included). House trained pets may be approved after discussion with the owner. 3 night minimum rental but inquire with RedAwning for shorter stays, which may be possible.\n ', 'United States', 'California', 'San Francisco', '', '', '94110', '37.750971', '-122.410793', NULL, 0, '', 0, '0', 5.5, 3, 2.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '84074c2f-7cba-b5fd-c906-55317d9a4878', 1, 1, 'Y', 'N', 0, '2015-04-18 22:14:42', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:14:42', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('88b32885-1fb9-4d04-d99d-55355814d928', 'RA325-Briggs', 'ra325-briggs-1', 'This is a beautiful home with room for everyone. This would be great home for two families or a large group of people. The downstairs is set up as a "mother in law unit" with a full kitchen and living area, as well as two bedrooms. The upstairs is light and bright and open, with a comfortable living room, dining area and kitchen.\n\nAmenities\nBusiness district, CD Player, Dishwasher, DVD player, Fireplace, Microwave, Stereo, Telephone, TV(s), VCR players, Washer/Dryer, Pet Friendly, Garage, Lake Nearby, Skiing Nearby, Golf Nearby, Boating, Satellite/Cable Television, Dialup/DSL Internet Access, No Smoking, Community Pool, Community Hot Tub, Community Tennis, Skiing, Horse Riding, Walking, Golf\n ', 'United States', 'California', 'Truckee', '', '', '96161', '39.348288', '-120.222002', NULL, 0, '', 0, '0', 8, 5, 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 21:49:38', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:49:38', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('88bb716a-df8f-13d8-c131-55355c923c38', 'RA389-Brockway Shores Charmer', 'ra389-brockway-shores-charmer-1', 'This 3 bedroom, 2.5 bathroom, split level lakefront townhouse sleeps 6 and has an open floor plan to accommodate your gathering. Located in beautiful Brockway Shores, this unit is nestled amongst the tall trees and grassy lawn of the expansive picnic area.Stroll down the back steps to the HOA private beach, or pull your boat up to the pier to take your friends on an evening cruise. Go kayaking or fishing right from the back deck! Go hiking on nearby conservancy land and enjoy refreshments while having a BBQ in the summer.In winter, go snowshoeing for epic views of the lake, or ski at the many nearby resorts. Take in the spectacular views that incorporate the landscape of the lake and mountains...year ''round! This property has an ideal location! Just a few blocks walk along a safe, quiet neighborhood to the heart of downtown Kings Beach''s restaurants, dining, and shopping. The gorgeous sandy beaches are just down the street, with sand-court volleyball and kayak rentals.Cool down with soft-serve ice cream while playing a round of mini-golf or enjoy live music and taco specials after a round of 9-hole golf! Dine on hearty steaks and salad bars lakeside, or be amazed by award-winning all-you-can-eat sushi. There''s even a local movie theater! Just a short drive to the stateline casinos and music venues, there''s year-round fun and activities for the entire family!This split-level condo features, on the downstairs level, a Master bedroom with a King bed, 24"TV/VCR/DVD/Stereo with private bath, and a second bedroom with 2 twins, small TV/VCR and bathroom with Jacuzzi tub. Upstairs is the 3rd bedroom with a Queen and half bath. The Kitchen has granite counters and a 3 person bar. The Living room has a leather sofa, fireplace, 52" HDTV/DVD/Stereo, and the Dining room has seating for 8. Buoys are available for rent so bring your boat (subject to availability).Only 10 minutes from Northstar, this townhouse has HOA private lake access, pier, and picnic area. Walking distance to downtown Kings Beach and beautiful sandy beaches, and nearby to award-winning restaurants and boutique shopping as well as shops for kayaks, skis, and snowboards. Please note: Hi-speed internet access is shared; subject to availability. Book 3 nights and get the 4th free (excluding holiday weeks).No Smoking. No pet. ', 'United States', 'California', 'Kings Beach', '', '', '96143', '39.231617', '-120.015611', NULL, 0, '', 0, '0', 5.5, 3, 2.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-20 22:07:04', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:07:04', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('88eaaef5-5884-7036-cd63-553555258909', 'RA399-Deer Path Hot Tub', 'ra399-deer-path-hot-tub', 'What a delightful Northstar vacation retreat! This 2 bedroom, 2 bath home will sleep 6 comfortably or 8 if you choose to use the daybed in the living room as well as the sleeper loveseat in the loft.Bedding includes a Queen in the master suite downstairs, 2 Single beds in the upstairs bedroom, and another 2 Single beds along with a Single loveseat sleeper in the loft upstairs. There are 2 bathrooms downstairs. The bathroom which attaches to the Master bedroom has a Tub with no Shower. It does have a shower hose to use if you are sitting in the tub. The second bathroom has a Shower with no Tub.Downstairs has an open floor plan encompassing the dining room, living room, daybed nook, and reading area. There is also an office desk just near the kitchen if you need to sneak some work in on vacation. The kitchen is fully stocked with plateware and cooking needs. It has an electric stovetop, microwave, toaster, coffee maker and dishwasher. There is a mudroom as you enter to store any winter coats or wet boots as well as a ski closet outside for ski equipment.This home also has a large sunny deck for summer BBQ''s as well as a hot tub for warming up after the slopes. *Please note there is a Pak-N-Play available for guest use in the Master bedroom closet. Please note that pets are allowed. This Pet Friendly property has a small fee included in its balance. Please let us know how many pets you are bringing, or if you are not bringing pets, and we will adjust the rate accordingly. Book 3 nights and get the 4th free (excluding holiday weeks). ', 'United States', 'California', 'Truckee', '', '', '96161', '39.288299', '-120.121105', NULL, 0, '', 0, '0', 4, 2, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 21:37:42', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:37:42', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL);
