('899410cc-a9ad-93c7-50b8-55355c40a21d', 'RA395-Cristallina Greens', 'ra395-cristallina-greens-1', 'This Tahoe Donner home is great for one or more families. Situated overlooking the 18th fairway at Tahoe Donnner, complete with hot tub, sleeping for 11, remodeled kitchen, and is pet friendly! Main floor contains the raised living room with sectional sofa and wood-burning fireplace, tv/dvd/vcr player and stereo, with seating for 7.  The huge remodeled kitchen has upgraded hickory cabinets, stainless steel appliances, and double ovens. The expansive deck, totally enclosed, overlooks the golf course, and features an easy-access hot tub and gas bbq.  There is a cozy den with pull-out sofa (sleeping for 2), with a tv/dvd/vcr and access to deck, plus its own gas fireplace. The full bath has dual sinks, and all upgraded tile/faucet/cabinets, shower (no tub).  The upstairs bedroom has two Twins with one trundle, total sleeping for 3, plus computer with internet access, fax, and printer. Second level contains the Master bedroom with a King bed, plus a full bathroom (all upgraded), with dual sinks, jetted tub, and seperate shower. The second bedroom has a Queen bed, plus access to upstairs porch.  The third bedroom also has a Queen bed and access to the upstairs porch.  These bedrooms share a full bath with dual sinks, and shower (no tub- not pictured).  There is also a laundry room with washer/dryer.\n\nHi Speed Wireless Internet! (connection cannot be guaranteed) -Outdoor hot tub -Rec center access (for a nominal fee) with hot tub, swimming pool, weight room -Access to Tahoe Donner amenities including Rec center, downhill ski area (perfect for teaching kids!), cross country ski area, equestrian center, tennis center, 18-hole golf and driving range, hiking, and so much more! -Mins from downtown Truckee! -Approx. 20 mins to Sugarbowl ski area, 30 mins to Squaw, 15 mins to Northstar, and 40 mins to Lake Tahoe. This home comes complete with full kitchen and all linens/towels.\n\nPlease note that this Pet Friendly property has a small fee included in its balance. Please let us know how many pets you are bringing, or if you are not bringing pets, and we will adjust the rate accordingly. Book 3 nights and get the 4th free (excluding holiday weeks).  ', 'United States', 'California', 'Truckee', '', '', '96161', '39.349406', '-120.235983', NULL, 0, '', 0, '0', 7, 4, 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 22:08:23', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:08:23', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('8a381685-dddd-1775-ba77-553568492c77', 'RA484-Chamonix #057', 'ra484-chamonix-057', 'This downstairs, roomy one bedroom condominium in building C is charming with a fully equipped kitchen, 2 flat screen TVs with cable service, DVD, CD player, telephone (local calls only), free Wi-Fi internet connection, woodstove (firewood provided) and a balcony. The bedroom has a queen bed and there is a queen size sofa sleeper in the living room. This unit is non-smoking and has one outside parking space (unassigned). Chamonix is the second closest complex to Canyon Lodge on Canyon Boulevard. Walk to Canyon Lodge and Gondola!\n', 'United States', 'California', 'Mammoth Lakes', '', '', '93546', '37.647012', '-118.997657', NULL, 0, '', 0, '0', 2, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 22:57:22', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:57:22', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('8a5a26a0-0d19-2e79-b9f9-553557d4124b', 'RA425-Squaw Valley Meadows Condo', 'ra425-squaw-valley-meadows-condo', 'This second floor condo has all the modern features for a great get-away. As you enter the property the mudroom offers a great spot for kicking off your hiking boots or dropping your ski gear. The new furniture throughtout make this condo a comfortable place to enjoy life and just relax.The Master bathroom is en suite with a queen bed. The second bedroom has a flat panel TV and queen bed. The second bath is in the hall adjacent to the second bedroom. The living room has comfortable leather couch and chair with a wood burning fireplace and flat panel TV. The upgrades in the kitchen included granite counter tops and stainless appliances. The six person dining table is located between the livingroom and kitchen making it a great space for socializing and dining.The deck has a great gas BBQ. Sitting on the deck you can enjoy 180 degree views of Squaw Meadows and Squaw Valley ski area. After checking the weather from the deck you can walk out the door for a great day on the mountain summer or winter. This place will keep you coming back again and again.It also features free cable and high speed internet access. Parking allowed for two cars with covered parking for one car. Book 3 nights and get the forth night free (excluding the holiday week).No smoking, No pets. ', 'United States', 'California', 'Olympic Valley', '', '', '96146', '39.198610', '-120.228871', NULL, 0, '', 0, '0', 4, 2, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-20 21:46:36', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:46:36', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('8a5c4f27-014e-ca09-d833-55354e2866b3', 'RA318-Pettingell', 'ra318-pettingell', 'This is a great three bedroom, 2 bath townhouse located in Lake Forest Glen, just minutes to Downtown Tahoe City. Very open and bright floorplan with plenty of room for everyone. Enjoy the amenities that Lake Forest Glen has to offer, pool, hot tub, and tennis courts. Enjoy the walking, hiking, biking trails throughout Tahoe City. \n\nAmenities\nCD Player, DVD player, Ski, Stereo, Telephone, Vacuum Cleaners, Washer/Dryer, Lake Nearby, Skiing Nearby, Golf Nearby, Boating, Games, Deck, Deck Furniture, Fully Equipped Kitchen, Iron/Ironing Board, Linens, Beach Towels, Satellite/Cable Television, Beach, Shopping, Gambling, Hunting, Family, Child Friendly, Elderly Friendly, Groups, No Smoking, No Pets, Community Pool, Community Hot Tub, Community Tennis, Books, Movie Library, Skiing, Cycling, Mountain Biking, Water Skiing, Diving, Surfing, Para-gliding, Swimming, Roller Blading, Tennis, Horse Riding, Sailing, Walking, Fishing, Golf', 'United States', 'California', 'Tahoe City', '', '', '96145', '39.185894', '-120.113358', NULL, 0, '', 0, '0', 5.5, 3, 2.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 21:06:38', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:06:38', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('8adb7da9-18c0-cf5c-c594-5532b9568961', 'RA77-Garden View', 'ra77-garden-view', 'Come enjoy this elegant hideaway in the middle of San Francisco, located across from the beautiful Buena Vista Park and within walking distance of the Castro district and the upscale Cole Valley neighborhood with its many restaurants and shops. The exciting Haight Street shopping area is also nearby with its numerous, shopping, dining, and nightlife opportunities. Visit the famous Golden Gate Bridge, only fifteen minutes away by car, and don’t forget the many museums and other attractions in and around Golden Gate Park, one of the most visited city parks in the United States. Sites such as the Conservatory of Flowers, the De Young Museum, the Japanese Tea Gardens, and the kid-friendly California Academy of Sciences make San Francisco an unforgettable experience.\n\nThis finely decorated home is spacious and well lit. Upon entering, you will find yourself in a carefully arranged living room with high ceilings and an excellent view of the lovely, landscaped garden. Perched above this garden, the home is peaceful and private with a full kitchen ad two baths. The master bedroom has a comfortable, queen-sized bed and the second bedroom holds two single beds. Cable/satellite television and wireless Internet access are both provided for your convenience, and public transit is also within walking distance.\n\nIf available, this unit may be combined with our lower unit, the Garden Suite.\n\nNo parking available', 'United States', 'California', 'San Francisco', '', '', '94117', '37.766650', '-122.443448', NULL, 0, '', 0, '0', 4, 2, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-18 22:06:57', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:06:57', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('8b59de77-324b-f296-19c0-5535509ffaff', 'RA330-Gamara', 'ra330-gamara', 'Perfect 3 bedroom, 2.5 bath home with hot tub available for a ski lease. This house has been remodeled and looks fabulous! There is pine trim through all of the rooms, new carpet, and newly remodeled bathrooms. Enjoy the hot tub while watching the snow fly, but still staying dry in the atrium. The kitchen has everything that the chef in the family could ask for.\n\nAmenities\nJacuzzi, Vacuum Cleaners, Private Hot Tub', 'United States', 'California', 'Truckee', '', '', '96161', '39.338926', '-120.239115', NULL, 0, '', 0, '0', 5.5, 3, 2.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 21:14:20', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:14:20', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('8bc4350d-59ea-7b5c-4d8b-5535589eb3a5', 'RA333-Rivkin', 'ra333-rivkin-1', 'Beautiful custom home located on 11 acres in Tahoe Donner is the perfect place to get away from it all.  Brand new home with three bedrooms, loft, two and a half baths, and huge two car garage.  This home is located on a very desireable and quiet street in Tahoe Donner and has everything that you need.  The chef of the family will love the gourmet kitchen, which is fully stocked.\n\n\nAmenities\nDishwasher, DVD player, Fireplace, Freezer, Microwave, Oven, Refrigerator, Toaster, Vacuum Cleaners, Washer/Dryer, Pet Friendly, Garage, Lake Nearby, Skiing Nearby, Cooking Utensils Provided, Spices, Boating, River, Horseback Riding, Deck, Deck Furniture, Fully Equipped Kitchen, Gourmet Kitchen, Garbage Disposal, Linens, Television, Satellite/Cable Television, Hunting, Child Friendly, Elderly Friendly, Ice Maker, Coffee Maker, Stove Top Burner, Skiing, Cycling, Mountain Biking, Water Skiing, Wind-Surfing, Para-gliding, Swimming, Roller Blading, Tennis, Horse Riding, Sailing, Walking, Fishing, Golf', 'United States', 'California', 'Truckee', '', '', '96161', '39.355663', '-120.234259', NULL, 0, '', 0, '0', 6, 3, 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 21:50:45', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:50:45', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('8d19641d-39e8-fd6b-d221-553564dad4c9', 'RA424-Silver Strike at Northstar', 'ra424-silver-strike-at-northstar-2', 'This warm and comfortable condo is conveniently located just steps away from the Village and lifts.Enjoy modern luxuries such as a large flat screen TV, gas fireplace, and leather furnishings. The kitchen is gourmet quality with beautiful woodwork, granite counters, and stainless steel appliances is perfect for creating family meals and wonderful memories.The entry level of this home contains the Master bedroom with a Queen bed, flat screen TV, private deck entry, and Master bathroom with shower and in-floor heating. The second bedroom contains two Twin beds (sleeping for 2), as well as a bathroom with shower and in-floor heating.The upper level of the home contains a living room with gas fireplace, 42" large flat-screen TV/VCR/DVD/Stereo, and Double sleeper sofa (sleeping for 2), with deck entry. The full kitchen comes with deluxe appliances and dining table for 6, plus 2 at side table. It also features a full laundry room, and high speed wireless Internet.\n\nThis home comes complete with full kitchen and all linens/towels.  This home does not have a barbeque grill!\n\nNo Smoking. No PetsBook 3 nights and get the 4th free (excluding holiday weeks).', 'United States', 'California', 'Truckee', '', '', '96161', '39.279135', '-120.118340', NULL, 0, '', 0, '0', 4, 2, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 22:41:29', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:41:29', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('8d704b01-e15d-1af7-b88c-5532c076ff35', 'RA209-Lindberg Chalet', 'ra209-lindberg-chalet', '\nThis cozy chalet style 3 bedroom home is centrally located with beautiful views of Barton meadow.  Enjoy your private hot tub with a view! This pet-friendly home has plenty of outdoor space to play! Adults and children will love playing horseshoes in the pit in the backyard while others can relax on the deck or in the hot tub.  On cool evenings, you can light a fire in the huge stone fireplace in the living room. This property is very centrally located, and is close to our Cozy Lodi Escape for larger groups. The South Lake Tahoe area features world-class ski resorts, hiking trails, parks, beaches, restaurants, recreation, boating and numerous other tourist attractions, as well as the nearby casinos of Stateline. A perfect year round vacation destination, with fantastic weather and breathtaking scenery\n\nPermit number: VHR#3700 ', 'United States', 'California', 'South Lake Tahoe', '', '', '96150', '38.919324', '-119.985573', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', 'd3e20359-89bd-8249-981e-553180c9fde7', 1, 1, 'Y', 'N', 0, '2015-04-18 22:36:03', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:36:03', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('8d74994e-653b-9e01-a56c-5535673f6c3b', 'RA456-Aspen Creek 2 Bedroom Condo with Newer Furnishings', 'ra456-aspen-creek-2-bedroom-condo-with-newer-furnishings', 'This one level, two bedroom condominium has been updated with newer furnishings. Lovely two bedroom condominium nestled in the forest type setting of Aspen Creek. This property features: a fully equipped kitchen, dining for four to six, 3 Flatscreen TVs, 2 DVDs, woodstove (firewood provided), atrium balcony and mud room for ski/snowboard equipment. Make sure to bring your cell phone, this unit has no phone. The Master bedroom has a King-size bed and a private bath. The second bedroom has a King-sized bed. The living room has a sofa sleeper. This unit is non-smoking and has one assigned underground parking space (garage height 7''1").\n\nAspen Creek is located within walking distance to the Eagle Lodge and Eagle Express chairlift. Aspen Creek has underground parking (one space), laundry facilities and elevators in each building, 3 outdoor spas, 3 saunas and a swimming pool open during the summer only.Unit is facing hillside towards Majestic Pines street in building #2. ', 'United States', 'California', 'Mammoth Lakes', '', '', '93546', '37.633365', '-118.986083', NULL, 0, '', 0, '0', 4, 2, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 22:54:11', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:54:11', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('8dc43591-f608-adb2-c83a-55355f5eb881', 'RA429-St. Croix', 'ra429-st-croix-1', 'This adorable cabin is the perfect mountain getaway. It set set up for entertaining a large group and comes with so many amenities.\n\nThe entry level of this home includes living room, dining room and kitchen. There is also a gas fireplace, TV/DVD, cable and wireless internet. The kitchen has everything you may need for creating a feast and serving it up with style. There is a half bath in the hall across from the first Bedroom which has a Queen bed (sleeping for 2). The master bedroom is right next door with a Queen bed, TV and an attached bathroom with shower/tub. There is a Pak-n-Play in the closet as well. The second floor has a loft with a TV which open over the living room and 2 small beds suitable for kids. There are two bedrooms, one has a Queen bed and another one has 2 Twin beds (sleeping for 2). These rooms share a bathroom with a fuly shower/tub.\n\nThis home comes with a full kitchen and all linens and towels, and hi-speed wireless Internet access. 2 car garage along with slightly sloped driveway which can fit 4 cars are other available amenities. For summer guests, there is charcoal BBQ available.\n\nThis home comes with access cards to the Tahoe Donner HOA amenities including Beach Club Marina, Tennis Club, Golf, Equestrian center, Rec center with Fitness room, pools, hot tubs, and both cross-country and downhill skiing. Book 3 nights and get the 4th free (excluding holiday weeks).\n\n\n', 'United States', 'California', 'Truckee', '', '', '96161', '39.360380', '-120.241053', NULL, 0, '', 0, '0', 6.5, 4, 2.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '631c13a2-1961-0d99-7cd7-553184a48eb8', 1, 1, 'Y', 'N', 0, '2015-04-20 22:18:57', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:18:57', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('8deb0d29-4b0e-4060-183e-5535598c7df4', 'RA347-Chauvet Condo 3B', 'ra347-chauvet-condo-3b-1', 'Hotel Chauvet was originally built in 1906 and celebrated its centennial with a spectacular restoration and renovation, painstakingly accomplished over two years. The result is a historic landmark building with six luxurious vacation rentals, rejuvenated with locally made brick and reappointed by craftsmen, while upscale interior and state-of-the art amenities have been added.The lodging experience at The Chauvet is truly unique! Each unit is generously sized at almost 2,000 square feet. The large master bedrooms include a huge walk-in closet. The other two bedrooms in each unit are spacious as well. Both baths boast designer fixtures but the master features a jetted tub and separate glass enclosed shower with massage jets and rainhead.The kitchen would please any gourmet, and is outfitted with custom cabinetry, stainless steel appliances, granite counter tops, wine cooler and commercial-style gas cooktop, among other delights. Of course, if you don''t want to cook for yourself, you are just steps away from Glen Ellen''s "restaurant row" with a myriad of delicious choices... or walk across the street to Glen Ellen''s own gourmet market.A brief walk south brings you to Jack London Village with the local cheesemonger, chocolate shop (made on site), olive press and market, fantastic deli, market of locally produced gourmet items and another tasting room. Add to this vision the lovely outdoor, heated pool with sundeck patio, accessible from your own wide balcony off the master bedroom, and the views of the surrounding hillsides and native oak trees from every large picture window framed by brick arches.You will be more than comfortable at The Chauvet at any time of year, with energy efficient air conditioning and heating, a gas fireplace, full soundproofing, elevator access and private garage.The unit features: 3 bedrooms, master with king sized bed, 2nd bedroom with queen and the 3rd bedroom with a king sized bed that can convert to two twins upon request in five of the units. Queen sized sofa bed in living room of Unit 1B. 3rd bedroom in 2B only features a twin day bed with a pop up trundle (which can be made up as an Eastern king on request), couch and chaise. 2 luxurious bathrooms - the master has jetted tub, glass enclosed shower with shower panel featuring rain head and massage jets along with European style hand held.Ample closet space throughout, walk-in closet in master bedroomGourmet kitchen and formal dining space, with every amenityGas fireplace in living room, energy efficient central heat and air conditioningHeated outdoor pool surrounded by sun deckWide, private balcony with dining table & chairs, propane BBQWireless internet accessCable with expanded channels and on-demand movies (and a TV in each bedroom and living room)Designer furnishings and dramatic artwork from local artistsPaintings by local artists are exhibited in the unitsSumptuous beds with luxurious linens, and thick & thirsty towelsElevator access, intercom, covered parking in private garageWasher & dryer in the unitCentral location to wineries & tasting rooms, restaurants, farmers'' and gourmet markets - walk or bike within the charming village of Glen EllenLess than a mile from Jack London State ParkIncluded with your stay are complimentary:a bottle of wine and chocolatescookies in the cookie jarcoffee, tea, juice, yogurt, granola and fresh fruitwine passes for six to Arrowood, Chateau St. Jean, Gary Farrell and Taft Street Wineryreserve tastings at Cline and Jacuzzi2 for 1 tastings at Buena Vista, Geyser Peak, Gundlach Bundschu, and Ravenswoodupgraded tastings at LedsonSonoma Valley B & B Association passport for complimentary tastings for each guest at 25+ Sonoma Valley wineries\nPlease note: The pool is open year-round, however is not heated Nov. 1 through May. 14, per County regulations.\n\n Rates reduced for longer stays: Peak 4-5 nights $595/night, 6+ nights $550/night.  Off peak 3-5 nights $495/night, 6+ nights $450/night.  Balance will be adjusted with the final billing.You can also view Condo 1A, Condo 1B, Condo 2A, Condo 2B, and Condo 3A. for larger groups or other available dates. TOT 848N, 849N', 'United States', 'California', 'Glen Ellen', '', '', '95442', '38.362343', '-122.525923', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 21:53:27', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:53:27', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('8dfbe949-fc59-f735-4665-5532bab4c352', 'RA94-Duboce Studio', 'ra94-duboce-studio', 'Please note : this Property requires a 30 day minimum stay\n\nThe Duboce Studio is a newly remodeled unit in convenient yet very quiet location. The studio is just up the block from Duboce Park and within walking distance of the Castro. It is also three blocks from a Muni Metro stop and two blocks from beautiful Buena Vista Park.The Duboce Studio has a large main room that includes a sleeping area and a lounging area with a couch. The kitchen has been totally modernized and includes granite counter tops and a small dining table. It is fully stocked. The bathroom has been elegantly designed using the finest of materials.The unit offers a great degree of natural light and at the same time, a significant level of privacy. Perfect for your vacation or business trip.\n\nNo parking available', 'United States', 'California', 'San Francisco', '', '', '94117', '37.769005', '-122.436645', NULL, 0, '', 0, '0', 3, 2, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-18 22:12:24', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:12:24', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('8ee65d74-71c2-0fde-893c-55355e80042c', 'RA420-Pinnacle View', 'ra420-pinnacle-view-1', 'Located on Pinnacle Loop, this home has wonderful views of the mountains and is just minutes from Truckee and a short drive to all the major North Shore area ski resorts, Donner Lake, and Lake Tahoe. This modest but clean and comfy home will sleep 9 people max. There is a walkway with stairs that lead you down to the covered front door.\n\nOn the main level:\nFull kitchen with plenty of counter space and kitchen bar to sit at.\nLiving room has a wood burning stove, wrap around couch and lots of light\nDining area has a large table which seats 8\nThere are 2 bedrooms with Queen beds and a full bathroom with a shower/tub combo\n\nUpper level:\nMaster bedroom with King bed\nFull bathroom with shower / tub\nLoft area has 3 Twin beds along with a sofa seat that pulls out to a small Twin\nTV is located in the loft\n\nThere is flat parking for 4-5 cars, No garage.\n\nPlease let us know how many pets you are bringing, or if you are not bringing pets, and we will adjust the rate accordingly. Book 3 nights and get the 4th free (excluding holiday weeks). \n\nNo Smoking. Well behaved pets ok with approval and additional cleaning fee. ', 'United States', 'California', 'Truckee', '', '', '96161', '39.366870', '-120.248029', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-20 22:15:08', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:15:08', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('909007b7-3587-ab06-acb2-5532bf3f7954', 'RA208-Cozy Lodi Escape', 'ra208-cozy-lodi-escape', 'Relax in the private hot tub after a long day outdoors at the mountains or the lake. Come inside and stay warm in the spacious living room with a huge wood burning fireplace, 2 couches, and recliner.8 people will sleep comfortably in this house with 3 bedrooms and 2 baths. Centrally located, this property is very close to close to our Lindberg Chalet for larger groups. The South Lake Tahoe area features world-class ski resorts, hiking trails, parks, beaches, restaurants, recreation, boating and numerous other tourist attractions, as well as the nearby casinos of Stateline. A perfect year round vacation destination, with fantastic weather and breathtaking scenery.\n\nPermit number: VHR#2090 ', 'United States', 'California', 'South Lake Tahoe', '', '', '96150', '38.919926', '-119.984345', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-18 22:35:05', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:35:05', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('90bb0dde-1bd8-690d-f52d-5532c250f1e8', 'RA189-Venice Drive Beauty', 'ra189-venice-drive-beauty-1', 'Beautiful home in Tahoe Keys on the lagoon. Very peaceful and serene. House is tastefully furnished with lots of personal touches. Formal Dining Room, brick f/p with gas insert in Living Room and Master Bedroom. Outside has beautiful double lot, deck and hot tub!\n\nPermit number: VHR#5815', 'United States', 'California', 'South Lake Tahoe', '', '', '96150', '38.927872', '-120.013900', NULL, 0, '', 0, '0', 5.5, 3, 2.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-18 22:46:32', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:46:32', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('90c7f5d8-d5da-d793-73db-5532c20d86ef', 'RA193-Venice Drive Meadow View', 'ra193-venice-drive-meadow-view-1', '\nLovely, spacious, recently built home with views of the meadow and the lake in the distance.Both adults and kids will appreciate the separate downstairs den and the large backyard. Venice Drive Meadow View is located in the exclusive Tahoe Keys community, so renters have the opportunity to take advantage of numerous Tahoe Keys amenities such as indoor and outdoor swimming pools, basketball court, putting green, playground, beach area and pier, and tennis courts! This property sleeps 12 with 4 bedrooms, a den, and 2.5 baths.The South Lake Tahoe area features world-class ski resorts, hiking trails, parks, beaches, restaurants, recreation, boating and numerous other tourist attractions, as well as the nearby casinos of Stateline. A perfect year round vacation destination, with fantastic weather and breathtaking scenery.\n\nVery nice newer home with views of the meadow and the lake. There is a separate den downstairs. This home has access to Tahoe Keys amenities. Close to all other Venice homes for large groups.Prices do not reflect taxes and cleaning fee. Holiday Weekend Excluded.Permit number: VHR#102057 ', 'United States', 'California', 'South Lake Tahoe', '', '', '96150', '38.933722', '-120.020129', NULL, 0, '', 0, '0', 6.5, 4, 2.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-18 22:47:45', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:47:45', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('9156c73a-11fb-4fae-48d4-5532c4f7adfa', 'RA228-Creatively Decorated Basque Golf Course Home', 'ra228-creatively-decorated-basque-golf-course-home-1', 'Just Remodeled spacious kitchen with Granite Counter tops! This bright, beautiful 4 bedroom home is located on the golf course in Northstar. Includes a gas log fireplace, 2 color TV''s, 1 VCR, micro jetted bath, and a steam shower in the master bath. It features a living room upstairs as well as a nice family room downstairs. Extra sleeping in a small room off the family room with 1 Twin. This creatively decorated home has 3508 square feet of luxurious space waiting to be filled by you! Plus, this property includes access to the NorthStar HomeOwners Swim and Racquet Club. ', 'United States', 'California', 'Truckee', '', '', '96161', '39.285646', '-120.111968', NULL, 0, '', 0, '0', 8, 4, 4, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '631c13a2-1961-0d99-7cd7-553184a48eb8', 1, 1, 'Y', 'N', 0, '2015-04-18 22:55:21', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:55:21', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('92822ac0-1373-b8b9-50ff-55356b565951', 'RA554-Sierra Megeve Condo with Best Location in Mammoth', 'ra554-sierra-megeve-condo-with-best-location-in-mammoth', 'This first floor, two bedroom condominium is located in building 1, which is the best location closest to the slopes. This unit overlooks the pool and spa area. The master bedroom has a king bed and the bathroom has a spa tub for relaxation. The guest bedroom has two twins and the living room has a sofa sleeper. There is a fully equipped kitchen, 2 TVs (37" flat screen TV in the living room), DVD, 2 VCRs, no telephone (please bring your cell phones!) and fireplace (wood provided). This unit is non-smoking and has one assigned underground parking space (garage height 7''2"). One additional vehicle parks in guest spot underground or outside depending on parking availability. ', 'United States', 'California', 'Mammoth Lakes', '', '', '93546', '37.644083', '-118.999806', NULL, 0, '', 0, '0', 4, 2, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 23:11:41', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 23:11:41', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('92ab8d7c-e58c-91cf-f294-5535656a93eb', 'RA434-Tahoe Stoneridge', 'ra434-tahoe-stoneridge', ' One of the best Vacation Rental values in Truckee - Tahoe Stoneridge - a new townhome just a short distance from downtown Truckee.The upstairs level has a nicely furnished living area with upscale leather furniture (seating for 6), hardwood floors, a flat screen TV/DVD player, plus a cozy gas fireplace. The sofa is pull-out with sleeping for 2 on a full sized bed, while the overstuffed chair is pull-out with sleeping for 1 on a twin sized bed. There is a small but lovely deck with seating for 2 and views of Northstar and the surrounding mountains.The kitchen is full stocked, the dining room table seats 6, and there is bar seating for an additional 3 people. Downstairs you will find a large Master bedroom with a King bed, sitting area, plus bathroom with tub, shower, and dual sinks. The second bedroom contains a Queen bed, and views of Northstar. There is high speed wireless available for your convenience, but it cannot be guaranteed.This home is an easy walk to downtown Truckee with all of its fabulous shopping, dining and nightlife. ', 'United States', 'California', 'Truckee', '', '', '96161', '39.333379', '-120.180792', NULL, 0, '', 0, '0', 4, 2, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-20 22:45:47', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:45:47', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('94ff1f42-6c54-5f9f-8dc4-5532c1d9216a', 'RA314-Keyser', 'ra314-keyser', 'Step back in time as you enter this charming "Old Tahoe" style cabin on Lake Tahoe''s West Shore. The main house of this Tahoe vacation rental features 3 bedrooms, 2 bathrooms and large living area with knotty pine interior and original stone fireplace with a woodstove insert for efficiency. The newer add-on dining room features slate floors, knotty pine walls and a gas stove and offers extra gathering space as well as a large dining table to seat the entire group. Summer guests have the added bonus of two newly remodeled summer guest rooms with sleeping for four and two 1/2 baths. The large courtyard is perfect for an afternoon BBQ and offers a safe place for outdoor child play. This west shore vacation home is conveniently located to public beaches and skiing.\n\nAmenities\nCD Player, Dishwasher, Fireplace, Microwave, Stereo, Telephone, VCR players, Washer/Dryer, Lake Nearby, Yard, Satellite/Cable Television, Skiing, Walking', 'United States', 'California', 'Tahoe City', '', '', '96146', '39.127655', '-120.162824', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-18 22:42:36', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:42:36', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('96052ed6-24a3-beab-7cf2-5532b905785c', 'RA80-Pierce Place Lower Unit', 'ra80-pierce-place-lower-unit', 'Please note : this Property requires a 30 day minimum stay\n\nThis bright and cozy home in San Francisco comes with one bedroom, one bath, and a full kitchen equipped with all the necessary utensils and appliances to satisfy your cooking and hosting needs. It can accommodate up to four people a queen bed and a full sofa bed, and pets are allowed (with an additional $100 charge per pet) so you can bring the furry members of your family with you. The kitchen features hardwood floors and the rest of the unit has been newly carpeted. Take advantage of the beautiful weather out on the patio, and keep connected and entertained with access to cable/satellite television and wireless Broadband Internet.\n\nInterested in venturing out around the neighborhood? Be sure to visit Alta Plaza Park only two blocks away. With its sprawling views of the bay and city skyline, as well as a fully equipped playground, it is no wonder this park is a popular hangout for young parents and their children. Equally attractive to pet owners, the first Sunday of every month is informally known as “Pug Day”. Weather permitting, up to 50 pooches and their owners congregate at the north end of this off-leash park during the afternoon for a giant play date.\n\nA short, ten-minute drive will take you to the famous Golden Gate Bridge. Enjoy the beautiful sights of the bridge and the ocean by car or on foot. And don’t forget the many museums and other attractions in and around Golden Gate Park, one of the most visited city parks in the United States. Sites such as the Conservatory of Flowers, the De Young Museum, the Japanese Tea Gardens, and the California Academy of Sciences make San Francisco an unforgettable experience.\n\nIf available and you need more space, this unit may be rented in addition to Pierce Place Upper Unit.\n\nNo parking available', 'United States', 'California', 'San Francisco', '', '', '94115', '37.788778', '-122.437168', NULL, 0, '', 0, '0', 2, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-18 22:07:38', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:07:38', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('96b3114c-8e29-ea7e-045e-55356817455d', 'RA488-Chamonix #096', 'ra488-chamonix-096', 'This three level, two bedroom + loft condominium is townhouse style and a perfect vacation getaway. It has everything you need for a comfortable stay. The master bedroom downstairs has a king bed. The second master bedroom has two twin beds. The loft has two sets of bunk beds. There is a fully equipped kitchen, 2 TVs, telephone (local calls only), free high speed internet access (cable), woodstove (firewood provided), and mud room for ski/snowboard equipment. This unit is non-smoking and has two outside parking spaces (unassigned).\n\nPool (Summer Only)', 'United States', 'California', 'Mammoth Lakes', '', '', '93546', '37.647012', '-118.997657', NULL, 0, '', 0, '0', 5, 2, 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 23:00:22', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 23:00:22', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('97e8609f-9b28-7790-b457-5532bc5f548b', 'RA167-Venice Condo', 'ra167-venice-condo', 'Cozy Condo with Mountain Views on the Tahoe Keys Lagoon. 3 Bdrm-2Ba-Sleeps 7. Upstairs living area. Access to all of the Tahoe Keys amenities. Close to unit #293, 2044 & 2052 for larger groups. Q TW, Q, D\n\nPermit number: VHR#102177', 'United States', 'California', 'South Lake Tahoe', '', '', '96150', '38.928234', '-120.013955', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', 'd3e20359-89bd-8249-981e-553180c9fde7', 1, 1, 'Y', 'N', 0, '2015-04-18 22:20:07', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:20:07', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('98308130-7e29-df14-b3b6-55355ff6948e', 'RA323-Springsteen', 'ra323-springsteen-2', 'Pride of ownership shows throughout in this darling Lake Tahoe vacation home. If you''re looking for the perfect little cabin in the woods, this west shore Lake Tahoe rental property will be sure to meet your needs. Conveniently located, this cozy cabin is just minutes from the Tahoe Park Homeowner''s Association beach and recreation area as well as the back side entrance to Alpine Meadows Ski Area and lakeside dining at Sunnyside Resort. With three bedrooms and two bathrooms, this rental property is perfect for a family or small group. Summer guests will love the large outdoor deck with full size charcoal BBQ and a complete set of patio furniture for outdoor dining.\n\nAmenities\nBusiness district, CD Player, Dishwasher, Fireplace, Microwave, Stereo, Telephone, Vacuum Cleaners, VCR players, Washer/Dryer, Beach Access, Lake Nearby, Boating, Satellite/Cable Television, Community Tennis, Skiing, Walking, Golf\n ', 'United States', 'California', 'Tahoe City', '', '', '96146', '39.142170', '-120.160016', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 22:19:33', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:19:33', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('998af48d-f575-332c-d10d-55355a20d0c5', 'RA352-Tahoe Diamond', 'ra352-tahoe-diamond-1', 'This gorgeous end unit features 2 private lake view decks in the Mountain Shadow complex.Conveniently located close to Hyatt and Diamond Peak, with access to two exclusive beaches in Incline Village (one with heated pool and slide), this large condo is perfect for any seaon. Recent renovations include fresh paint, new wood laminate, newly carpeted rooms, fully remodeled tiled bathrooms, a new electric fireplace insert, dual pane vinyl windows, and new top-down window coverings for bedrooms. Tahoe Diamond features vaulted ceilings and open floor plan.Included in your stay at Tahoe Diamond are passes to two seasonal pools, open after Memorial Day.  Incline Village features stunning mountain retreats, relaxing beaches and a plethora of lakeside activities. In summer, mountain biking, hiking, and water activities abound, while theatergoers flock to the Lake Tahoe Shakespeare Festival. Winter attractions include Diamond Peak Ski Area (within city limits) and Mt. Rose. And the casinos are quite lively all year! ', 'United States', 'Nevada', 'Incline Village', '', '', '89451', '39.246755', '-119.935543', NULL, 0, '', 0, '0', 5.5, 3, 2.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 22:00:45', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:00:45', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('99fc0f29-9e2d-c30f-5348-553565de9c86', 'RA436-Trailside Villa ', 'ra436-trailside-villa', 'This gorgeous rental in Tahoe Donner-Truckee is a beautifully furnished three bedroom, two and a half bathroom free standing Town Home. The upper level of this home has a large, sunny living room with twin-sized pull out sofa and seating for 5. The dining area contains a bar seating for 3, plus seating for 6 at a table. The kitchen is upgraded with granite counters, alder wood cabinets, and a deck overlooking golf course with propane BBQ and seating for 4.\n\nThere is a shared half bathroom, and the large master suite is also upstairs, with a king bed and private bathroom including soaker tub, dual sinks, travertine tile and TV. On the lower level there are two bedrooms, one with two single beds and a TV with DVD. The second bedroom has a queen bed, also with a TV. There is a full shared bathroom down the hall.\n\nThis home also has a 1 car garage, and High Speed Wireless Internet (no router), but please note that connection cannot be guaranteed in the mountains. This rental includes access cards for the Tahoe Donner Recreation Center resident amenities. A nominal charge applies for some activities. Book 3 nights and get the 4th night free (excluding holiday weeks).', 'United States', 'California', 'Truckee', '', '', '96161', '39.358810', '-120.257455', NULL, 0, '', 0, '0', 5.5, 3, 2.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 22:46:33', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:46:33', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('9b01441b-943f-747b-c0c9-5532c4cb0935', 'RA215-Gold Bend Northstar Home', 'ra215-gold-bend-northstar-home-1', 'This large and beautiful Northstar home is approximately 1 mile from the Northstar Recreation Center. The shuttle bus stops right in front of the driveway.Recently remodeled and gorgeous with a beautiful stone fireplace and new kitchen. Large deck for BBQ''s.Whether you are seeking action-packed adventure or just some rest and relaxation, Northstar is the perfect vacation destination. In addition to fantastic downhill & cross country skiing, tubing, golfing, horseback riding, mountain biking, obstacle course & rock climbing wall, the Recreation Center includes tennis, swimming, gym, game room and spas. The Northstar area features stylish boutiques, art galleries, and a collection of cafés and restaurants all centered on a year-round skating rink. Festivities include live music, special events, and a collection of fire pits (ideal for roasting s’mores). ', 'United States', 'California', 'Truckee', '', '', '96161', '39.283191', '-120.123065', NULL, 0, '', 0, '0', 8, 5, 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '631c13a2-1961-0d99-7cd7-553184a48eb8', 1, 1, 'Y', 'N', 0, '2015-04-18 22:54:18', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:54:18', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('9d21f87a-e380-bfb8-74ea-5535510baedf', 'RA348-Venice Drive Escape', 'ra348-venice-drive-escape', 'Nicely furnished, family style home with a boat dock and access to Tahoe Keys amenities (nominal fee charged). Cute country decor throughout the house. Close to all of the Venice homes for larger groups. This 4 bedroom, 2.5 bath has a King bed in the master bedroom, a Queen in the second bedroom, and three twins in the "bunk room," with a Queen-sized sleeper sofa in the separate TV room.The South Lake Tahoe area features world-class ski resorts, hiking trails, parks, beaches, restaurants, recreation, boating and numerous other tourist attractions, as well as the nearby casinos of Stateline. A perfect year round vacation destination, with fantastic weather and breathtaking scenery.\n\nPermit number: VHR#103358 ', 'United States', 'California', 'South Lake Tahoe', '', '', '96150', '38.930964', '-120.022110', NULL, 0, '', 0, '0', 7, 4, 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-20 21:20:15', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:20:15', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('9e9e1dd8-fea5-d2fe-f916-5532c5f6975d', 'RA313-Seymour', 'ra313-seymour-1', 'This roomy mountain home is ready for your ski group or large family. This 2200 square foot, 4 bedroom, 2 bath North Lake Tahoe vacation rental is conveniently located near Tahoe City with easy access and parking for 4 vehicles. This vacation home has three levels - the bottom floor features an oversized bedroom that also serves as a family room with TV/VCR and game table. The main level features two bedrooms, living, dining and kitchen with the large master suite located on the upper level. Nice upgrades have been added throughout including new carpet, slate entry, wood flooring and new kitchen appliances.  If you need plenty of space to spread out in, this mountain home is perfect for you.\n\nAmenities\nBusiness district, CD Player, Dishwasher, DVD player, Fireplace, Microwave, Stereo, Telephone, VCR players, Washer/Dryer, Beach Access, Lake Nearby, Boating, Satellite/Cable Television, Skiing, Walking, Golf', 'United States', 'California', 'Carnelian Bay', '', '', '96140', '39.206678', '-120.099979', NULL, 0, '', 0, '0', 6, 4, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '631c13a2-1961-0d99-7cd7-553184a48eb8', 1, 1, 'Y', 'N', 0, '2015-04-18 22:59:13', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:59:13', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('9f5e0cca-292f-b1c9-76e7-553564939dea', 'RA420-Pinnacle View', 'ra420-pinnacle-view-2', 'Located on Pinnacle Loop, this home has wonderful views of the mountains and is just minutes from Truckee and a short drive to all the major North Shore area ski resorts, Donner Lake, and Lake Tahoe. This modest but clean and comfy home will sleep 9 people max. There is a walkway with stairs that lead you down to the covered front door.\n\nOn the main level:\nFull kitchen with plenty of counter space and kitchen bar to sit at.\nLiving room has a wood burning stove, wrap around couch and lots of light\nDining area has a large table which seats 8\nThere are 2 bedrooms with Queen beds and a full bathroom with a shower/tub combo\n\nUpper level:\nMaster bedroom with King bed\nFull bathroom with shower / tub\nLoft area has 3 Twin beds along with a sofa seat that pulls out to a small Twin\nTV is located in the loft\n\nThere is flat parking for 4-5 cars, No garage.\n\nPlease let us know how many pets you are bringing, or if you are not bringing pets, and we will adjust the rate accordingly. Book 3 nights and get the 4th free (excluding holiday weeks). \n\nNo Smoking. Well behaved pets ok with approval and additional cleaning fee. ', 'United States', 'California', 'Truckee', '', '', '96161', '39.366870', '-120.248029', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-20 22:40:55', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:40:55', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL);
