('9ffe8dcc-9211-5852-a37c-55356bb7bcf3', 'RA510-La Residence Cozy 1 Bedroom Condo', 'ra510-la-residence-cozy-1-bedroom-condo', 'Cozy one bedroom, one bathroom unit with wireless internet and parking just a few steps from the front door. Located downstairs in Building S, this condominium comes with a fully equipped kitchen, balcony, breakfast bar that seats 4, and a wood burning fireplace. The master bedroom has a queen size bed. The living room has a Sofa Sleeper along with a 32" TV, VHS player and a DVD player. Make sure to bring your cell phone, this unit does not have a phone. ', 'United States', 'California', 'Mammoth Lakes', '', '', '93546', '37.641608', '-118.972764', NULL, 0, '', 0, '0', 2, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 23:11:07', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 23:11:07', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('a067d964-7edc-773f-cf18-5535645c41c8', 'RA425-Squaw Valley Meadows Condo', 'ra425-squaw-valley-meadows-condo-2', 'This second floor condo has all the modern features for a great get-away. As you enter the property the mudroom offers a great spot for kicking off your hiking boots or dropping your ski gear. The new furniture throughtout make this condo a comfortable place to enjoy life and just relax.The Master bathroom is en suite with a queen bed. The second bedroom has a flat panel TV and queen bed. The second bath is in the hall adjacent to the second bedroom. The living room has comfortable leather couch and chair with a wood burning fireplace and flat panel TV. The upgrades in the kitchen included granite counter tops and stainless appliances. The six person dining table is located between the livingroom and kitchen making it a great space for socializing and dining.The deck has a great gas BBQ. Sitting on the deck you can enjoy 180 degree views of Squaw Meadows and Squaw Valley ski area. After checking the weather from the deck you can walk out the door for a great day on the mountain summer or winter. This place will keep you coming back again and again.It also features free cable and high speed internet access. Parking allowed for two cars with covered parking for one car. Book 3 nights and get the forth night free (excluding the holiday week).No smoking, No pets. ', 'United States', 'California', 'Olympic Valley', '', '', '96146', '39.198610', '-120.228871', NULL, 0, '', 0, '0', 4, 2, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-20 22:41:59', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:41:59', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('a173c3fc-78bf-06e5-379d-5532c0818f79', 'RA210-Tahoe Island Drive Luxury Home', 'ra210-tahoe-island-drive-luxury-home', 'Newly Constructed Home w/ Pool Table, Steam Shower and modern furnishings.This is a great home for families in a nice area, right outside of Tahoe Keys. No pets. K,Q,Q,Bunk Full/TW,3 single futons.2324sq ft. Charcoal Grill/Gas Fireplaces. Prices do not reflect taxes and cleaning fee.\n\nPermit number: VHR#2361', 'United States', 'California', 'South Lake Tahoe', '', '', '96150', '38.919872', '-120.001278', NULL, 0, '', 0, '0', 7, 4, 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-18 22:37:22', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:37:22', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('a1c105aa-1b0a-4c18-1443-553568bf91ec', 'RA487-Chamonix 3 Level Condo is Perfect Getaway     ', 'ra487-chamonix-3-level-condo-is-perfect-getaway', 'This three level, two bedroom + loft condominium is townhouse style and a perfect vacation getaway. It has everything you need for a comfortable stay. The two master bedrooms downstairs have a king bed each. The loft has two sets of bunk beds with a double on the bottom and twin on top. The living room has a sofa sleeper. There is a fully equipped kitchen, 4 TVs, 4 DVDs, telephone (free unlimited long distance calling in USA), free high speed internet access (cable), BBQ on the balcony, woodstove (firewood provided), newly installed ceiling fan in the living room and mud room for ski/snowboard equipment. This unit is non-smoking and has two outside parking spaces (unassigned).\n\nGame Room\nClubhouse (Shared)\nPool (Summer Only)\nVaulted Ceilings', 'United States', 'California', 'Mammoth Lakes', '', '', '93546', '37.647012', '-118.997657', NULL, 0, '', 0, '0', 5, 2, 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 22:58:16', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:58:16', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('a1eca5b1-3193-48a3-ba08-5532c5007d98', 'RA314-Keyser', 'ra314-keyser-1', 'Step back in time as you enter this charming "Old Tahoe" style cabin on Lake Tahoe''s West Shore. The main house of this Tahoe vacation rental features 3 bedrooms, 2 bathrooms and large living area with knotty pine interior and original stone fireplace with a woodstove insert for efficiency. The newer add-on dining room features slate floors, knotty pine walls and a gas stove and offers extra gathering space as well as a large dining table to seat the entire group. Summer guests have the added bonus of two newly remodeled summer guest rooms with sleeping for four and two 1/2 baths. The large courtyard is perfect for an afternoon BBQ and offers a safe place for outdoor child play. This west shore vacation home is conveniently located to public beaches and skiing.\n\nAmenities\nCD Player, Dishwasher, Fireplace, Microwave, Stereo, Telephone, VCR players, Washer/Dryer, Lake Nearby, Yard, Satellite/Cable Television, Skiing, Walking', 'United States', 'California', 'Tahoe City', '', '', '96146', '39.127655', '-120.162824', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-18 22:59:26', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:59:26', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('a1f6abe3-32cf-c06b-016a-5532c0672bbf', 'RA215-Gold Bend Northstar Home', 'ra215-gold-bend-northstar-home', 'This large and beautiful Northstar home is approximately 1 mile from the Northstar Recreation Center. The shuttle bus stops right in front of the driveway.Recently remodeled and gorgeous with a beautiful stone fireplace and new kitchen. Large deck for BBQ''s.Whether you are seeking action-packed adventure or just some rest and relaxation, Northstar is the perfect vacation destination. In addition to fantastic downhill & cross country skiing, tubing, golfing, horseback riding, mountain biking, obstacle course & rock climbing wall, the Recreation Center includes tennis, swimming, gym, game room and spas. The Northstar area features stylish boutiques, art galleries, and a collection of cafés and restaurants all centered on a year-round skating rink. Festivities include live music, special events, and a collection of fire pits (ideal for roasting s’mores). ', 'United States', 'California', 'Truckee', '', '', '96161', '39.283191', '-120.123065', NULL, 0, '', 0, '0', 8, 5, 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '631c13a2-1961-0d99-7cd7-553184a48eb8', 1, 1, 'Y', 'N', 0, '2015-04-18 22:37:44', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:37:44', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('a31b03a7-f02e-c112-18d2-55356b196d9f', 'RA515-Mammoth Pines Large 3 Level 2 Bedroom Condo  ', 'ra515-mammoth-pines-large-3-level-2-bedroom-condo', 'This large two bedroom + loft condominium has three levels, vaulted ceilings, fully equipped kitchen, balcony, 3 TVs (HBO included), VCR, DVD, CD player, telephone (local calls only), wireless high speed internet and fireplace (wood provided).The master bedroom has a king bed and the guest bedroom has a queen. The loft has a queen bed and two sets of bunk beds. Mammoth Pines does not have an onsite spa or pool. This unit is non-smoking and has two outdoor parking spaces. ', 'United States', 'California', 'Mammoth Lakes', '', '', '93546', '37.640845', '-118.974014', NULL, 0, '', 0, '0', 5, 2, 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 23:11:12', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 23:11:12', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('a333496b-4716-5dc0-a8f1-5532b9b5b5e9', 'RA83-Casa Buena Vista', 'ra83-casa-buena-vista', 'Stay in an elegantly decorated yet comfortable Victorian flat in the middle of San Francisco for less than a hotel room!Casa Buena Vista is located across the street from one of San Francisco’s most beautiful parks, Buena Vista, and is capable of sleeping six people.  It is just a few blocks away from the exciting Haight Street shopping area with its numerous restaurants and shopping opportunities.Casa Buena Vista is a finely appointed flat with two large bedrooms.  Efforts have been made to maintain classical style while still providing maximum comfort.  You will the Asian themed décor most pleasant.The spacious living room has striking views of Buena Vista Park.  There is a Queen sized pull out couch beside lovely Asian antiques.  A large dining area sits next to the atrium. The master bedroom, which has a Queen sized bed, is large and comfortable and features a working fireplace.  The second bedroom has two twin beds that can be pushed together to form a King and includes a private bathroom.  Both bedrooms face the garden with large windows.  The lower level of the unit features a recently remodeled kitchen that is fully stocked with cooking equipment and includes a dishwasher. The yard is large and professionally landscaped with a gazebo looking towards the ocean.  There is a barbeque for guest use.\n\nStreet parking', 'United States', 'California', 'San Francisco', '', '', '94117', '37.768700', '-122.443424', NULL, 0, '', 0, '0', 4, 2, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', 'b1667c1f-9e1f-85f3-9682-55317452e139', 1, 1, 'Y', 'N', 0, '2015-04-18 22:09:22', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:09:22', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('a35bc16e-5cc4-a349-9c1c-5535638827c7', 'RA399-Deer Path Hot Tub', 'ra399-deer-path-hot-tub-2', 'What a delightful Northstar vacation retreat! This 2 bedroom, 2 bath home will sleep 6 comfortably or 8 if you choose to use the daybed in the living room as well as the sleeper loveseat in the loft.Bedding includes a Queen in the master suite downstairs, 2 Single beds in the upstairs bedroom, and another 2 Single beds along with a Single loveseat sleeper in the loft upstairs. There are 2 bathrooms downstairs. The bathroom which attaches to the Master bedroom has a Tub with no Shower. It does have a shower hose to use if you are sitting in the tub. The second bathroom has a Shower with no Tub.Downstairs has an open floor plan encompassing the dining room, living room, daybed nook, and reading area. There is also an office desk just near the kitchen if you need to sneak some work in on vacation. The kitchen is fully stocked with plateware and cooking needs. It has an electric stovetop, microwave, toaster, coffee maker and dishwasher. There is a mudroom as you enter to store any winter coats or wet boots as well as a ski closet outside for ski equipment.This home also has a large sunny deck for summer BBQ''s as well as a hot tub for warming up after the slopes. *Please note there is a Pak-N-Play available for guest use in the Master bedroom closet. Please note that pets are allowed. This Pet Friendly property has a small fee included in its balance. Please let us know how many pets you are bringing, or if you are not bringing pets, and we will adjust the rate accordingly. Book 3 nights and get the 4th free (excluding holiday weeks). ', 'United States', 'California', 'Truckee', '', '', '96161', '39.288299', '-120.121105', NULL, 0, '', 0, '0', 4, 2, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 22:36:06', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:36:06', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('a410826e-9f28-c0ec-f2e8-55354f40e58f', 'RA328-Chapman', 'ra328-chapman', 'If you''re looking for privacy, space and a sense of getting away from it all, Chapman''s Chalet is sure to fit your needs. This spacious four bedroom Truckee vacation home offers a large greatroom with beautiful forested views, adjacent dining area and fully equipped kitchen with plenty of space for your entertaining needs. Located in a quiet remote corner of Truckee, this rental home enjoys easy access to Northstar Ski Resort and is only minutes from downtown Truckee. You will find one queen guest room on the main level with three addtional rooms upstairs along with a separate loft/family room complete with TV/VCR, children''s video collection as well as an assortment of board games. The master bedroom is complete with an extensive library and work desk or just relax after an envigorating day on the slopes in the private jacuzzi tub. Perfect for large families and groups..\n\nAmenities\nBBQ/Picnic area, Business district, CD Player, Dishwasher, DVD player, Fireplace, Games supplied, Jacuzzi, Microwave, Movies supplied, Stereo, Vacuum Cleaners, Washer/Dryer, Satellite/Cable Television, Wireless Internet, Family, No Pets, Skiing, Walking\n\nActivities\nLibrary', 'United States', 'California', 'Truckee', '', '', '96161', '39.314110', '-120.182335', NULL, 0, '', 0, '0', 7, 4, 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '631c13a2-1961-0d99-7cd7-553184a48eb8', 1, 1, 'Y', 'N', 0, '2015-04-20 21:13:35', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:13:35', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('a5764f45-d9fa-fb55-f1e9-5532ba2d338e', 'RA85-Presidio Terrace Upper Unit', 'ra85-presidio-terrace-upper-unit', 'Please note : this Property requires a 30 day minimum stay\n\nIf available this unit can be combined with our Presidio Pensiones Lower Unit. Our Presidio Terrace is a large and elegant flat located in one of San Francisco''s most prestigious and serene neighborhoods. The property is one block from the Presidio and is within walking distance of the upscale Laurel Village commercial district. In the other direction is one of the City''s thriving Chinatowns with unique shopping and dining opportunities.Presidio Terrace offers the guest plenty of room to spread out. There is a large living room with a working fireplace. The living room opens on to a formal dining room. The pantry acts as a passageway to the fully equipped kitchen which includes all appliances, a dishwasher, and a full set of dishes and cooking equipment. Adjacent to the kitchen is a laundry room with a washer and dryer.The master bedroom has a King sized-bed, private bathroom and deck, and boasts great views to the South towards Twin Peaks. The second bedroom is also large, with a Queen and access to the deck. There are two more bedrooms, one with a double bed and one with a single bed, as well as two more full bathrooms.Presidio Terrace offers a unique opportunity of staying in a truly historic district with ample space and comfort. It is ideal for a family or small group traveling together.If available and you need more space, this unit may be rented in addition to Presidio Terrace Lower Unit.\n\nNo parking available.', 'United States', 'California', 'San Francisco', '', '', '94118', '37.789357', '-122.458895', NULL, 0, '', 0, '0', 6, 4, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', 'b1667c1f-9e1f-85f3-9682-55317452e139', 1, 1, 'Y', 'N', 0, '2015-04-18 22:09:58', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:09:58', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('a593a492-e41a-befd-cf58-553556866665', 'RA414-Lucky Tree Cabin', 'ra414-lucky-tree-cabin', 'This authentic, hand built log cabin is furnished in the classic "Old Tahoe" tradition right down to the soft leather sofa, club chair and Oriental carpets. Filled with Lake Tahoe''s charming history, there is a timeless, rustic mountain feel in every room. This is a single level home. The living room has soft leather furnishing that provide seating for 5, plus a wood stove and TV/DVD/VCR system. The Dining area has a table that seats 4 and the kitchen is fully stocked with gas stovetop and all other amenities. The deck has and charcoal BBQ and seating for 3, which overlook forested open space. The Master bedroom has a full sized bed with TV/DVD player and full bathroom attached. The second and third bedrooms also have Full sized beds. This economy rated cabin is nestled in the hills above Truckee and is a cozy, romantic, welcoming retreat. Quiet, yet close to most everything, it has great winter access and is perfect for a Tahoe skiing and snowboarding vacation. "Lucky Tree Cabin" is located in Tahoe Donner, and include access (with nominal fee) to the following amenities- championship 18 Hole Golf Course, pro shop, downhill ski resort, a cross country ski resort (featuring several warming huts and a ski-in cafe), the fine Lodge restaurant, deli/market, tennis courts, equestrian center, hot tub, swimming pools and a brand new, year-round gym to just name a few. Also includes access to a private marina, beach and boat launch at Donner Lake. The beach features a cafe, concession stand, chaise lounges, boat rentals, (including kayaks), and a designated swimming area. Tahoe Donner is located approx. 5 mins to downtown Truckee, and 10-30 mins to Sugar Bowl, Northstar, Squaw Valley, Alpine Meadows, Boreal ski resorts. \n\nPet friendly.', 'United States', 'California', 'Truckee', '', '', '96161', '39.339606', '-120.217924', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '631c13a2-1961-0d99-7cd7-553184a48eb8', 1, 1, 'Y', 'N', 0, '2015-04-20 21:43:19', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:43:19', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('a677566a-2534-06ad-26fc-5532c3634358', 'RA194-Coto Cabin', 'ra194-coto-cabin-1', 'If you''re looking for a spectacular cabin for a group of friends or small family, this property is perfect. This beautiful, authentic log cabin was built in 2008 with luxury in mind.\n\nYou''ll "oooh" and "ahhh" over the gas-burning fireplace, upscale furnishings, marble countertops, and vaulted ceiling. You''ll also relish the quiet, peaceful forest setting. Up to six travelers can sleep comfortably in this three-bedroom two-bath abode.\n\nOn nice days, you can relax on the wrap-around porch. When it''s chilly out, you can warm up beside the fireplace. The fully furnished kitchen allows you to make a wide variety of memorable meals. Other perks include a barbecue grill, DVD player, washer/dryer, and lake and mountain views.\n\nThe home is not wheelchair-accessible, and pets and smoking are forbidden. There''s so much to do in and around South Lake Tahoe, including skiing, fishing, boating, and wine tasting. Make sure to take lots of pictures so you can share your experiences with friends back home.The South Lake Tahoe area features world-class ski resorts, hiking trails, parks, beaches, restaurants, recreation, boating and numerous other tourist attractions, as well as the nearby casinos of Stateline. A perfect year round vacation destination, with fantastic weather and breathtaking scenery.\n\nPermit number: VHR#1625', 'United States', 'California', 'South Lake Tahoe', '', '', '96150', '38.866503', '-119.999348', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-18 22:48:08', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:48:08', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('a6e2b7c2-d7a8-5c8e-5b22-5535553069a5', 'RA402-Eagle''s Nest', 'ra402-eagle-s-nest', 'Lovely home in Tahoe Donner with open, light living area, plenty of room for one or more families. You may bring the pets (with prior approval).\nThe driveway can be icy and slippery in the winter months and can be difficult to get up even with a 4WD vehicle. We recommend a 4WD vehicle + chains for entry when ice is present, or parking at the bottom of the driveway (be sure to park off the road and off the neighbor''s driveway)\n\nWhat a delightful Tahoe Donner vacation retreat! This 3 bedroom, 2.5 bath home will sleep 10 comfortably.Main level (upstairs): Master bedroom: Queen bed. Master bath with shower/jacuzzi tub, dual sinks. Living room: open and inviting with wood fireplace, TV/DVD, game table and reading chair, plus pull-out sofa with seating for 6+. Dining area: seating for 6. Entrance to attached garage. 1 bay open for guests. Entrance to back deck with gas BBQ (summer use only)Downstairs: Bedroom 2: Queen bed. Bedroom 3: 1 bunk bed (Twin and Double) plus additional Twin (total sleeping for 4). Full bathroom with shower/tub. Half bathroomLoft: Queen futon with small TVThe driveway is short but very steep. Can be icy and slippery in the winter months and can be difficult to get up even with a 4WD vehicle. 4WD vehicle only + chains for entry when ice is present, or parking at the bottom of the driveway for 1 car only (be sure to park off the road and off the neighbor''s driveway). Hi Speed Wireless Internet! (connection cannot be guaranteed). Access to Tahoe Donner amenities (for nominal fee) including Rec center with work-out facility pools and hot tub, downhill ski area (perfect for teaching kids), cross country ski area, equestrian center, tennis center, 18-hole golf and driving range, hiking, and so much more. Mins from downtown Truckee. Approx. 20 mins to Sugarbowl ski area, 30 mins to Squaw, 15 mins to Northstar, and 40 mins to Lake Tahoe This home comes complete with full kitchen and all linens/towels.\n\n**No Smoking** ***Pets allowed with prior approval*** The majority of guests must be over the age of 25.', 'United States', 'California', 'Truckee', '', '', '96161', '39.357024', '-120.223562', NULL, 0, '', 0, '0', 5.5, 3, 2.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '631c13a2-1961-0d99-7cd7-553184a48eb8', 1, 1, 'Y', 'N', 0, '2015-04-20 21:39:15', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:39:15', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('a7402103-e768-9e13-4450-55356be1d5b4', 'RA501-Fireside at Village 1 Bedroom Condo Nicely Decorated', 'ra501-fireside-at-village-1-bedroom-condo-nicely-decorated', 'Beautiful one bedroom condominium located within walking distance to the Village at Mammoth.\n\nThis property features: a fully equipped kitchen, large flat screen TV in the living room with DVD and VCR, flat screen TV in bedroom with DVD, telephone (local calls only), ceiling fan above dining room table and woodstove (firewood provided). The bedroom has a queen bed and the living room has a sofa sleeper.\n\nFireside at the Village has one underground assigned parking space, indoor spa, indoor pool, two saunas, laundry facilities, ping pong table and lounge area with fireplace. Use the driveway for 8050 to enter underground parking.', 'United States', 'California', 'Mammoth Lakes', '', '', '93546', '37.649183', '-118.983721', NULL, 0, '', 0, '0', 2, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-20 23:10:59', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 23:10:59', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
