('a8bb0d5a-9c7f-038c-448d-553568a96c23', 'RA486-Chamonix 2 Level Condo with Loft', 'ra486-chamonix-2-level-condo-with-loft', 'This two level, one bedroom + loft condominium in building D has been newly updated as of February 2007 with new paint, bedding and living room furniture. Queen bed in the master bedroom. The loft has a queen bed and a set of bunk beds. There is a fully equipped kitchen, 2 TVs, VCR, telephone (local calls only), fireplace (wood provided) and balcony. This unit is non-smoking and two outside parking spaces (unassigned).\n\nClubhouse (Shared)\nPool (Summer Only)', 'United States', 'California', 'Mammoth Lakes', '', '', '93546', '37.647012', '-118.997657', NULL, 0, '', 0, '0', 3, 1, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 22:57:31', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:57:31', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('a99c0ce0-9dd0-97f4-2e83-55354e37cb88', 'RA319-Kibbe', 'ra319-kibbe', 'A pleasant property for all seasons. This beautiful unit with a view of the lake sits just a short walk from the lake. Southern and western exposures guarantee bright, sunny vacation, while open-beam, cathedral ceilings over an open floorplan add that mountain feeling with plenty of space, even in the comfort of your rental.This unit is located upstairs. Neighboring units are available for larger groups.\n\n\nAmenities\nCD Player, Fireplace, Housekeeping, Ski, Stereo, TV(s), Washer/Dryer, Lake Nearby, Skiing Nearby, Boating, Games, River, Horseback Riding, Deck, Deck Furniture, Fully Equipped Kitchen, Iron/Ironing Board, Linens, Beach Towels, Television, Satellite/Cable Television, Local Calls Included, Shopping, Gambling, Family, Child Friendly, Elderly Friendly, Groups, No Smoking, No Pets, Community Pool, Community Hot Tub, Community Tennis, Designated Parking, Books, Skiing, Cycling, Mountain Biking, Water Skiing, Wind-Surfing, Swimming, Roller Blading, Tennis, Sailing, Walking, Fishing, Golf ', 'United States', 'California', 'Tahoe City', '', '', '96145', '39.183668', '-120.118018', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', 'd3e20359-89bd-8249-981e-553180c9fde7', 1, 1, 'Y', 'N', 0, '2015-04-20 21:08:41', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:08:41', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('aa4806cb-688a-2e02-ba34-55355daaceeb', 'RA407-Glenrock Town Home', 'ra407-glenrock-town-home-1', 'You''ll love this cute and cozy, economy rated 3 bedroom town home at Glenrock. This great rental is just steps away from the community swimming pool (summer only) and the Golf Course.The property has been partially remodeled and thoughtfully decorated, and includes high speed wireless internet access (subject to connectivity). In addition to the on-site swimming pool, you''ll enjoy access to Incline''s exclusive, private beaches and 2 world class golf courses. Diamond Peak ski area, the Hyatt resort casino, and excellent dining and shopping are also just minutes away! This is a perfect rental for your budget minded summer or winter Lake Tahoe vacation getaway.The home is nicely furnished and equipped, with all the cookware and linens you''ll need to relax and enjoy a memorable experience in gorgeous Lake Tahoe. Downstairs you''ll find the cozy living room with a gas fireplace on a stone hearth, comfy sofas, TV with DVD player, and access to the gas BBQ (summer only) on the back patio, set among large granite boulders.The dining area and kitchen are also downstairs, along with a half bath and laundry area with washer/dryer. All 3 bedrooms are upstairs. The master bedroom offers a king bed, TV, writing desk, and attached full bathroom. The 2nd bedroom and 3rd bedrooms each have a full sized bed and tasteful furniture. There is also another full bathroom with tub and shower upstairs.This home comes with IVGID beach passes, allowing guests to access Incline Village''s renowned private beaches for a daily use fee. Guests must bring the provided passes to the entry kiosks where the entry fee is charged. One of the two beaches offers beach volleyball, swimming pool and snack stand. Use of the boat launch is also available with the beach pass. Please note- there is no garage available for this home. There are 2 assigned parking spaces available with this property.Book 3 nights and get the 4th free (excluding holiday weeks). ', 'United States', 'Nevada', 'Incline Village', '', '', '89451', '39.260709', '-119.944050', NULL, 0, '', 0, '0', 5.5, 3, 2.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '631c13a2-1961-0d99-7cd7-553184a48eb8', 1, 1, 'Y', 'N', 0, '2015-04-20 22:13:03', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:13:03', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('ab4844a4-5ec1-51a2-9252-5532c341b985', 'RA200-Donner Lane Home', 'ra200-donner-lane-home-1', 'This large family home is within walking distance to Heavenly Ski Resort, and features an upstairs living / family area and pool table. Front deck has a hot tub and patio seating.You will also find a swedish fireplace with conversation area, and a CD Stereo with MP3 jack. There is a private hot tub on the front deck for your enjoyment. All bedrooms are located downstairs for easy access. This property sleeps 12 in 4 Bedrooms (1 King, 2 Queens, 1 Full, 3 Twins, and 1 Queen Hide-a-Bed) and 3 bathrooms.The South Lake Tahoe area features world-class ski resorts, hiking trails, parks, beaches, restaurants, recreation, boating and numerous other tourist attractions, as well as the nearby casinos of Stateline. A perfect year round vacation destination, with fantastic weather and breathtaking scenery.Permit number: VHR#103740', 'United States', 'California', 'South Lake Tahoe', '', '', '96150', '38.939708', '-119.946412', NULL, 0, '', 0, '0', 7, 4, 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-18 22:50:19', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:50:19', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('abdc0412-4830-4d01-4ad2-5532c42e3fdd', 'RA226-Skidder Trail Luxury Northstar Home', 'ra226-skidder-trail-luxury-northstar-home-1', 'This beautiful home is located on the golf course surrounded by natural greenery. It offers four bedrooms—two of which are master bedrooms, a wet bar, a fully equipped kitchen, fireplace, and a two-car garage as well as a a gas barbeque and a deck to enjoy it on. You and your family can also enjoy a variety of friendly competitions and games with the pool table, foosball table, air hockey table, and bumper pool at your disposal. In addition, this home grants you access to the Northstar Homeowners Swim and Racquet Club. This includes access to a pool, tennis courts, and even a hot tub! Then, after a day of fun indoors or out, you can watch a movie in the home theater or lie back in the Jacuzzi tub.Located in Truckee, this home also places you within easy reach of all the fun that Tahoe has to offer. A mere three minute drive will bring you to the Northstar Ski Resort where you can enjoy downhill and cross-country skiing along beautiful, tree-lined runs. The Northstar area also offers horseback riding, ice skating, mountain biking, tubing, hiking, fishing, and even a rock climbing wall! Then, when you’ve gotten off the slopes and want to unwind, you can spend some time browsing the many stylish boutiques and galleries or sit down for a meal at your choice of cafés and restaurants. For those with children seven and under, make sure to visit KidZone—a children’s museum with fun, interactive exhibits designed just for kids. With all this and more, this area is the perfect choice for your next getaway whether you’re looking for excitement or just some peace and quiet with a breathtaking view.\n\nParking space: 2', 'United States', 'California', 'Truckee', '', '', '96161', '39.290585', '-120.113555', NULL, 0, '', 0, '0', 7.5, 4, 3.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-18 22:54:38', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:54:38', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('acb0a972-7b53-3f6f-f412-5532bb23c884', 'RA157-Christie Home', 'ra157-christie-home', 'This spacious home in Tahoe Keys is the perfect place for a relaxing, group vacation. With a full kitchen, four bedrooms, and two baths, it can easily accommodate up to twelve people. Not only does it have a garage for your cars, it has a dock for your boats! Wireless Broadband Internet access, cable/satellite television, and a pool table provide ample entertainment without even having to step outside. Go all out with a barbeque out on the patio then retire indoors to watch a movie on the widescreen TV, soak in the hot tub, or sit and chat beside the fireplace.As part of the exclusive Tahoe Keys community, you will have access to the many Tahoe Keys facilities such as the indoor and outdoor swimming pools, basketball court, tennis courts, putting green, playground, beach area and pier. Of course, don’t forget the many other activities available to you outside of this resort. Visit the snowy slopes of Heavenly, a ski resort less than twenty minutes away by car. Go boating, fishing, or take a lake cruise to enjoy the breathtaking scenery from across the water.For those who don’t want to cook or just want to enjoy a great dinner out, there are plenty of casual and fine dining options in Lake Tahoe. The Fresh Ketch Lakeside Restaurant located right in the Tahoe Keys Marina combines them both with casual dining at its Seafood Bar and fine dining upstairs with a view of the lake.\n\nLarge lodge like home in the Tahoe Keys w/ a boat dock, pool table and hot tub. 3 level home with a large and comfortable living area. Within walking distance to 456 for larger groups.Permit number: VHR#2209', 'United States', 'California', 'South Lake Tahoe', '', '', '96150', '38.929744', '-120.013553', NULL, 0, '', 0, '0', 6, 4, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-18 22:17:36', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:17:36', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('acdb4ac6-9143-a80a-ee14-5532c1f72d74', 'RA307-Hale Maluhia', 'ra307-hale-maluhia', 'Hale Maluhia is a one-of-a-kind beachfront home on Hanalei Bay and is perfect for honeymooners or a small party looking for a luxurious getaway. This is a fabulous home is located on Hanalei Bay. The Saturday morning farmers and fresh produce market is just a few blocks away.The house is fully equipped with upscale furnishings and amenities. Master bedroom with king bed has garden views, flat screen TV with cable and stereo. The master bath has shower/jacuzzi tub. The living area offers a queen punee bed for additional sleeping arrangements or lounging area. Off of the living area is a small alcove area with twin size bed and half bath. The manicured gardens is very private. Gas lined tiki torches and garden gazebo encourage outdoor entertaining and dining.\n\nThis home is located on the end of the bay near the surf spot Pinetrees. Hanalei town is just a short five to ten minute walk. The Saturday morning farmers and fresh produce market is just a few blocks away.\n\nLocated on the north shore of Kauai west of Princeville, the small, peaceful town of Hanalei is rich in both history and art with landmarks such as the Waioli Mission House and Hanalei Pier. The many art galleries here feature art and carvings made in Kauai, inspired by the island’s natural beauty. Come enjoy a ukulele concert at the Hanalei Community Center or relax and watch the sunset at the end of the day over Hanalei Bay.\n\nOther amenities included:RefrigeratorToasterCookwareCeiling FansLinensIroning BoardAlarm SystemOutdoor ShowerGazeboGas lined Tiki torchesBusiness: Nearby ATM, Nearby Post Office, Nearby Internet Cafe, Nearby FedEx, Nearby Bank, TAT # W59473247-01Convenience: Nearby Medical Services, Nearby Grocery, Golf Course, Walking distant to townGeographic: On Beach, On Bay or Sound, Close to Town', 'United States', 'Hawaii', 'Hanalei', '', '', '96714', '22.201731', '-159.504954', NULL, 0, '', 0, '0', 2, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '7563d166-94d8-834c-3042-553185ff9837', 1, 1, 'Y', 'N', 0, '2015-04-18 22:41:39', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:41:39', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('ae6783a0-c71f-eea7-7c8a-5532c577c882', 'RA315-Grossman', 'ra315-grossman-1', 'This townhouse feels more like a single family home. Not attached to other units. Very spacious "reverse" floorplan with 3 bedrooms/2 baths downstairs, Living, Dining, Kitchen, 1 Bedroom and 1 Bath upstairs. Cathedral, open-beam ceilings and comfortable decor with mountain accents. The unit looks out to the outdoor pool and hot tub. Ideal for a group, large family or two small families. This townhouse is equipped with microwave, dishwasher, washer/dryer, Large screen TV with cable, VCR & DVD Player. Propane barbecue for summer use.\n\n\nAmenities\nCD Player, Dishwasher, DVD player, Microwave, Stereo, Telephone, TV(s), Vacuum Cleaners, Washer/Dryer, Lake Nearby, Skiing Nearby, Balcony, Linens, Satellite/Cable Television, Groups, Community Pool, Community Hot Tub, Community Tennis, Designated Parking, Skiing, Swimming, Tennis\n\nActivities\nWater activities, Winter sports', 'United States', 'California', 'Tahoe City', '', '', '96145', '39.183668', '-120.118018', NULL, 0, '', 0, '0', 7, 4, 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-18 22:59:52', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:59:52', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('af2e19d6-9e38-1c7d-5a04-55356bb39d32', 'RA504-Hidden Valley Value Condo Sleeps 6  ', 'ra504-hidden-valley-value-condo-sleeps-6', 'Quiet and relaxing is the setting for this downstairs, one bedroom condominium located in building E of Hidden Valley. This property features: a fully equipped kitchen, dining for four plus two at the breakfast bar, small balcony, 32" Flatscreen TV in the living room, VCR, DVD player, two sofa sleepers, telephone (local calls only) and fireplace (firewood provided). The master bedroom offers a queen-size bed and TV. This unit is non-smoking and has one outside parking space (unassigned). Hidden Valley is located in a private and quiet neighborhood off Lake Mary Road within walking distance to the Village (Mammoth''s newest development). The Village has shops, restaurants, bars and a gondola to the Canyon Lodge. Hidden Valley offers outside parking, indoor and outdoor Jacuzzi, two saunas, two laundry facilities, fish cleaning station by the Hidden Valley office and a swimming pool that is open during the summer only. Wireless high speed internet is available in the Hidden Valley common area located next to the Hidden Valley office. Common area hours are from 9:00am to 10:00pm daily. Check with Hidden Valley office for password. There is a shuttle stop (free service) nearby if needed. The shuttle (green line) travels to the Eagle Lodge and the Village.', 'United States', 'California', 'Mammoth Lakes', '', '', '93546', '37.646307', '-118.985406', NULL, 0, '', 0, '0', 2, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 23:11:03', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 23:11:03', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('af62b316-9c79-cd40-cde0-5535655dd340', 'RA432-Tahoe City Retreat with Hot Tub', 'ra432-tahoe-city-retreat-with-hot-tub', 'This beautiful 4 bedroom, 3.5 bath home has a light and bright open floor plan and comfortable, high-quality furnishings. The gourmet kitchen features gorgeous granite counter tops, stainless steel appliances, double oven, and bar seating.Catch some sun on the large front deck, or relax in the hot tub on the back deck overlooking the large, grassy, fenced yard. Stroll to the end of the street and find miles of trails for hiking, nature walks or mountain biking. In the winter, cruise miles of cross-country groomed trails accessed right from the house! With a two car garage, plenty of parking, and a quiet location in a tucked away neighborhood, this is your perfect home-away-from-home!The entry level contains three bedrooms, the first sleeping 4 in two bunk beds, the second bedroom has a Queen and 25" TV/VCR with shared bathroom, and the third room has a Queen bed with an adjoining bathroom. Upstairs you will find the living room with gas fireplace, 36" TV/DVD, and french doors leading onto the deck.The dining room has a table to seat 13 plus and there is a half bath for guests. The Master bedroom has a King bed with 27" TV, and french doors leading onto the deck. The Master bathroom is equipped with a large Jacuzzi tub and walk-in closet.The upstairs has entry onto the back deck with gas BBQ and hot tub overlooking the fenced, grassy yard. This home comes complete with a full kitchen, all linens and towels, and may be suitable for well-behaved dogs and owners upon approval. Please Note: This Pet Friendly property has a small fee included in its balance. Please let us know how many pets you are bringing, or if you are not bringing pets, and we will adjust the rate accordingly.Book 3 nights and get the 4th free (excluding holiday weeks). ', 'United States', 'California', 'Tahoe City', '', '', '96145', '39.195305', '-120.113100', NULL, 0, '', 0, '0', 7.5, 4, 3.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', 'd3e20359-89bd-8249-981e-553180c9fde7', 1, 1, 'Y', 'N', 0, '2015-04-20 22:44:16', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:44:16', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('af761934-1352-387d-7b5e-553562963163', 'RA384-Aspen Grove Townhouse', 'ra384-aspen-grove-townhouse-2', 'This comfortable Northstar condo is perfect for families and is conveniently located just minutes away from the Village, recreation center and lifts. On the entry level you''ll find one bedroom with a Queen bed and private deck and another bedroom with a Full and Twin bunk bed (can sleep 3), as well as a newly remodeled bathroom with tub and shower.The second floor hosts the living room with "Tahoe Lodge" themed decor. The pull-out sofa sleeps 2, and the comfortable furnishings, 42" flat-creen TV, and deck entry with propane right of the side make for a wonderful gathering area for your group. The kitchen, also on the second level, as all the amenities you could need, and the dining area provides seating for 5.The third floor includes the Master bedroom with a King bed, and a newly remodeled bathroom with an extra sink. Other house-wide amenities include hi-speed wireless internet (though connection cannot be guaranteed), and a full set of linen and towels for your stay.With just a 1/2 mile walk to the Village, and Recreation Center access (for a nominal fee) that includes a Hot Tub, Pool, weight room, and kid''s play room, you can''t find a better location. Enjoy the shopping, dining, iceskating, downhill mountain biking, and the on-demand Northstar shuttle that will take you to see it all!Book 3 nights and get the 4th free (excluding holiday weeks). No Smoking. No Pets', 'United States', 'California', 'Truckee', '', '', '96161', '39.279782', '-120.119018', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 22:32:57', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:32:57', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('afd3cb66-7ff4-3b71-2670-5532bb5d680b', 'RA133-Beautiful Incline Village Condo', 'ra133-beautiful-incline-village-condo', 'Welcome to this warm and beautifully furnished Tahoe condo. This two-floor condo features three bedrooms and three baths, as well as a spacious living room with high ceilings and leather couches. Both the kitchen and the bathrooms have been newly remodeled, and the kitchen has a full set of new appliances. Quality linens are provided, and there is a washer and dryer for your convenience.Enjoy the amazing views from both patios, or watch a movie indoors. Cable television, a DVD player, and DVDs are all included along with a selection of music CDs. High-speed Internet access lets you keep on top of things, and don’t forget about all of Tahoe’s outdoor attractions.This condo is located in central Incline Village within easy walking distance of coffee shops, restaurants, and grocery stores with snacks and ingredients for those who want to throw together a delicious, home-cooked meal. There is a public library in the area, and several private and public beaches within a mile. Also close by are several of Tahoe’s world-class skii resorts. A five minute’s drive will bring you to the beautiful and kid-friendly Diamond Peak ski resort. Mount Rose is just 15 minutes away, Northstar-at-Tahoe is within 20 minutes by car, and 35 minutes will take you to Alpine Meadows, Squaw Valley, and Heavenly.', 'United States', 'Nevada', 'Incline Village', '', '', '89451', '39.251694', '-119.960241', NULL, 0, '', 0, '0', 6, 3, 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-18 22:13:57', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:13:57', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('b05456f9-5056-713b-5c5d-5532baf8c4d1', 'RA93-Golden Gate Vista', 'ra93-golden-gate-vista', 'Please note : this Property requires a 30 day minimum stay\n\nOur Golden Gate Vista property offers spectacular views and refined appointments for less than the price of a hotel room. The unit, located in a quiet yet central neighborhood, offers spacious quarters and a deck that boasts a view from the Marin Headlands all the way to the San Francisco Bay, centering on the Golden Gate Bridge. Golden Gate Vista has a full-sized bed and a fireplace. In the same room there is a dining table with the same serene view.The gourmet kitchen is completely updated and fully stocked. There is a full sized refrigerator and stove as well as a dishwasher. The bathroom is elegant with a large shower and marble counter tops. There is generous closet space.Public transport is located two blocks away from the unit. Restaurants and shopping in the exciting Cole Valley neighborhood are a five-minute walk from the unit. Golden Gate Park is a ten-minute walk from Golden Gate Vista. The property is located near the University of California at San Francisco for those visiting for academic or medical reasons.\nNo parking available.\nNote: Free internet/wifi at the property.', 'United States', 'California', 'San Francisco', '', '', '94117', '37.759911', '-122.449985', NULL, 0, '', 0, '0', 3, 2, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-18 22:12:06', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:12:06', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL);
