('b2dd1e9e-9f33-84d5-d523-55356b6e7f39', 'RA524-Mammoth Ski & Racquet Brightly Lit Condo is Pet Friendly', 'ra524-mammoth-ski-racquet-brightly-lit-condo-is-pet-friendly', 'Fully remodeled one bedroom + loft condominium that is dog friendly, located upstairs in building F of Mammoth Ski & Racquet in Mammoth Lakes.\n\nThis property features: fully equipped updated kitchen with newer appliances and slate flooring, small balcony, TV, VCR, DVD, telephone (local calls only), dining for six, balcony, and gas fireplace. The living room also has a sofa sleeper. The master bedroom has a King size bed with a flatscreen TV. The loft has a double bed and a set of bunk beds with an additional Trundle. This unit is non-smoking and has a one car garage. A large vehicle may not fit in the garage, but there is parking available outside.\n\nDog unit rules:\n1) Do not leave your dog alone in the unit.\n2) Pick up after your dog.\n3) Keep your dog on a leash (it''s the law).\n\nIf you do not follow these rules, there will be a $100.00 fine.\n\nMammoth Ski and Racquet is located within walking distance to the Canyon Lodge but for avid skiers there is a ski-back trail behind the complex.\n Game RoomBBQ (Summer)Clubhouse (Shared)Pool (Summer Only)Location: Ski in (Snow Permitting)', 'United States', 'California', 'Mammoth Lakes', '', '', '93546', '37.648529', '-118.997741', NULL, 0, '', 0, '0', 3, 1, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-20 23:11:17', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 23:11:17', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
