('b365a2c3-564b-9953-5da5-553563a1df31', 'RA400-Diamond Peak Chalet', 'ra400-diamond-peak-chalet-2', 'Diamond Peak Chalet is a charming, well appointed home in the heart of Incline Village.This home is within minutes of Diamond Peak Ski Resort in Incline Village, with Mt. Rose, Heavenly, Northstar and Squaw Valley near by. After a long day on the slope you can ease into the hot tub to warm up and relax.The kitchen is stocked with cookware, dishware and silverware as well as beautiful table settings for the dining room table and comes with a breakfast bar with seating for 5. The kitchen flows easily into the dining room, which has seating for 8, and living room area with wood burning fire place, Television, DVD, CD, Video, and Entertainment/Sound system. Off the dining room is the exterior deck with the BBQ gas grill. The master bedroom, bathroom and one guest bedroom is located just off the living room on the main level.The lower level hosts the family room with an impressive 50 inch flatscreen television ,Entertainment/sound system, DVD, CD player, and gas stove to keep you warm on those cooler evenings. This level has one guest bedroom and an additional bathroom. The beds are adorned with comfortable quilts and pillows. All linens and towels are provided.This home is within minutes of Diamond Peak Ski Resort in Incline Village, with Mt. Rose, Heavenly, Northstar and Squaw Valley near by. After a long day on the slope ease into the hot tub afterwards to warm up and relax. During the summer this home comes with IVGID beach passes, allowing guests to access Incline Village''s renowned private beaches for a daily use fee. Guests must bring the provided passes to the entry kiosks where the entry fee is charged. One of the two beaches offers beach volleyball, swimming pool and snack stand. Use of the boat launch is also available with the beach pass.\n\nThe property has a 2 car garage for small cars only, and is dog friendly - but no cats, please. This Pet Friendly property has a small fee included in its balance. Please let us know how many pets you are bringing, or if you are not bringing pets, and we will adjust the rate accordingly.  ', 'United States', 'Nevada', 'Incline Village', '', '', '89451', '39.243016', '-119.931519', NULL, 0, '', 0, '0', 6, 3, 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '631c13a2-1961-0d99-7cd7-553184a48eb8', 1, 1, 'Y', 'N', 0, '2015-04-20 22:36:48', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:36:48', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('b46b81c9-37da-4ad6-ce52-55356436f051', 'RA419-Pine Needle Meadows', 'ra419-pine-needle-meadows-2', 'Remodeled from head-to-toe, Ponderosa Palisades home has brand new hardwood flooring and carpet, granite counters and upgraded tile, full of sunlight and warm finishes. This home is perfect for families and their dogs, too!The main level of Poderosa Palisades has a large living area with seating for 5, plus a brand new 40" plasma TV (not pictured), as well as lots of sunlight and open space! The remodeled kitchen comes with granite counters, TWO dual sinks, and looks out over the large yard. The dining room has plenty of seating, and there is a full bathroom with shower, as well as laundry room - all with up-scale tile and granite.Sleeping on the main floor includes one bedroom with a Full futon, and another bedroom with a Twin/Full bunkbed (sleeping 3). The entrance to the large deck area is also on the main floor. Step onto the deck through the sliding doors and enjoy views of the large yard while cooking on the gas BBQ.Upstairs you will find the Master bedroom with King bed (Please note that there are 2 window benches that can sleep one child each, measure approx. 3'' x 5'', and not included in total sleeping number as they do not sleep adults) and Master bathroom, with large jetted tub and separate shower, dual sinks . . . all upgraded! High speed wireless Internet is available (subject to connectivity)Large yard, quiet neighborhood...located within 20 mins to all ski resorts and Lake Tahoe, why rent a hotel room when you can have a home for the same price! Please note that there is parking for 4, but the garage is non-accessible storage space. This Pet Friendly property has a small fee included in its balance. Please let us know how many pets you are bringing, or if you are not bringing pets, and we will adjust the rate accordingly. However, no cats are permitted due to allergies. ', 'United States', 'California', 'Truckee', '', '', '96161', '39.312745', '-120.175490', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '631c13a2-1961-0d99-7cd7-553184a48eb8', 1, 1, 'Y', 'N', 0, '2015-04-20 22:40:32', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:40:32', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('b53b69aa-7e59-7cb0-3c84-553564ebfe81', 'RA431-Stockholm Vista', 'ra431-stockholm-vista-2', 'What a fantastic Tahoe Donner vacation retreat! This 3 bedroom plus den/family room, 2.5 bath home will sleep 8 comfortably plus one more on a pull out single bed. Upstairs is where you''ll find the the living room with gas fireplace, and seating for 9, plus amazing views from every window. For your entertainment there is a 47" HDTV and DVD player, as well as Wi-Fi. The fully stocked kitchen with newer appliances, including stainless steel fridge is right next to the dining area with bar seating for 2, plus table seating for 6. Also upstairs, you''ll find the Master bedroom with King bed, TV, spacious mater bathroom with dual sinks, jetted tub, and separate shower, as well as access to the 2-car garage. On the lower level there are two more bedrooms, each with a Queen bed. There is a full bathroom with shower/tub, and the den has a Twin bunk bed (sleeps 2). The den also has sofa seating for three, and a TV/DVD player. The downstairs level has access to the deck with a Hot Tub and BBQ. This home is just a couple blocks from the Tahoe Donner cross country ski/equestrian center, and about 1 mile to the downhill ski area.  Please Note: This Pet Friendly property has a small fee included in its balance. \n\nPets are allowed upon approval and with an additional $25 cleaning fee. ', 'United States', 'California', 'Truckee', '', '', '96161', '39.363132', '-120.250193', NULL, 0, '', 0, '0', 5.5, 3, 2.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-20 22:43:35', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:43:35', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('b56d370e-9bde-3957-00b3-5535685ec646', 'RA490-Crestview Affordable Downstairs Condo', 'ra490-crestview-affordable-downstairs-condo', 'Very nice, one bedroom condominium with country decor and a nice view of mountains and trees. It is a downstairs unit in building C. There is a fully equipped kitchen, small balcony, 2 TVs, VCR, CD player, wireless internet, and woodstove (firewood provided). The bedroom has a king bed. The living room has a sofa sleeper and a set of bunk beds in the alcove area by the kitchen. The second bathroom is located by the alcove area. Make sure to bring your cell phone, this unit has no phone. This unit is non-smoking and has one assigned underground parking space (garage height 6''10"). ', 'United States', 'California', 'Mammoth Lakes', '', '', '93546', '37.645230', '-118.988799', NULL, 0, '', 0, '0', 3, 1, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 23:00:45', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 23:00:45', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('b666d83e-23fc-6637-8414-55355ced961e', 'RA393-Chambers Retreat', 'ra393-chambers-retreat-1', 'This warm and welcoming home is perfect for family gatherings and year round fun activities!The warm wood interior gives this cozy Tahoe Cabin a great family feel... In the winter, enjoy the convenient location nearby Homewood ski area. Just a bit further is Alpine Meadows and Squaw Valley. In the opposite direction find Sugar Pine Point State park with miles of X.C. groomed trails and plenty of snowshoeing. In the summer, enjoy the private HOA tennis courts and pool.\n\nOnly a 10 minute walk (half mile) to Chamber’s Landing Beach. You’ll find this home a relaxing quiet get away located just a walk to Lake Tahoe and minutes to the Ski slopes. --Main level: -open kitchen with upgraded counters and bar seating for 3 -Living room with with a lovely vaulted ceiling, beautiful stone fireplace and large flat screen HD TV with Satellite TV...pull out queen sofa (sleeping for 2) -dining room: large table with seating for 6 people.\n\nBedroom 1: queen bed, TV, plus full bathroom with shower (no tub) -laundry area with washer/dryer -entrance to wrap around deck allows for great outdoor seating and bbq (summer use only) --Upstairs: -open loft Master Bedroom with queen bed, large Flat Screen HD TV, with full bathroom (shower only) -Just to the left of the master bed room, Not pictured, is a small children''s room with two twin beds -to the right of the Master Bedroom/Loft is a smaller loft sleeping area with futon (sleeping for 2).\n\nLocated Nearby Homewood...approx. 15 mins to Alpine Meadows/Squaw Valley Ski Resorts!Please note: This home has a tricky driveway and requires a 4 wheel drive vehicle for access. Hi-speed internet is available, and the the property is pet-friendly. This Pet Friendly property has a small fee included in its balance. Please let us know how many pets you are bringing, or if you are not bringing pets, and we will adjust the rate accordingly.\n\nNo smoking! Pet Friendly!Book 3 nights and get the 4th free (excluding holiday weeks). ', 'United States', 'California', 'Tahoma', '', '', '96141', '39.073378', '-120.147184', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-20 22:07:45', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:07:45', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('b708a9b6-e3a4-4836-3f43-553567ed4881', 'RA454-Aspen Creek Recently Updated 2 Bedroom Condo', 'ra454-aspen-creek-recently-updated-2-bedroom-condo', 'This one level, two bedroom condominium is located on the first floor in building #2. It overlooks grassy area in the summer towards Majestic Pines street. King bed in the master bedroom. The guest bedroom has two sets of bunk beds. The living room has a sofa sleeper. There is a fully equipped kitchen, atrium balcony, TV, VCR, CD player, telephone (local calls only) and fireplace (wood provided). By the entrance, is a mud room for ski/snowboard equipment. This unit is non-smoking and has one assigned underground parking space (garage height 7''1"). Nice condominium recently updated in 2007 is located within walking distance to the Eagle Lodge and Eagle Express chairlift. Aspen Creek offers underground parking (one space), laundry facilities and elevators in each building, 3 outdoor spas, 3 saunas and a swimming pool open during the summer only.\n\n\nPool (Summer Only)', 'United States', 'California', 'Mammoth Lakes', '', '', '93546', '37.634286', '-118.988993', NULL, 0, '', 0, '0', 4, 2, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', 'b1667c1f-9e1f-85f3-9682-55317452e139', 1, 1, 'Y', 'N', 0, '2015-04-20 22:53:33', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:53:33', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('bcdd99ae-1a51-e91d-6ce9-5535588168b1', 'RA431-Stockholm Vista', 'ra431-stockholm-vista', 'What a fantastic Tahoe Donner vacation retreat! This 3 bedroom plus den/family room, 2.5 bath home will sleep 8 comfortably plus one more on a pull out single bed. Upstairs is where you''ll find the the living room with gas fireplace, and seating for 9, plus amazing views from every window. For your entertainment there is a 47" HDTV and DVD player, as well as Wi-Fi. The fully stocked kitchen with newer appliances, including stainless steel fridge is right next to the dining area with bar seating for 2, plus table seating for 6. Also upstairs, you''ll find the Master bedroom with King bed, TV, spacious mater bathroom with dual sinks, jetted tub, and separate shower, as well as access to the 2-car garage. On the lower level there are two more bedrooms, each with a Queen bed. There is a full bathroom with shower/tub, and the den has a Twin bunk bed (sleeps 2). The den also has sofa seating for three, and a TV/DVD player. The downstairs level has access to the deck with a Hot Tub and BBQ. This home is just a couple blocks from the Tahoe Donner cross country ski/equestrian center, and about 1 mile to the downhill ski area.  Please Note: This Pet Friendly property has a small fee included in its balance. \n\nPets are allowed upon approval and with an additional $25 cleaning fee. ', 'United States', 'California', 'Truckee', '', '', '96161', '39.363132', '-120.250193', NULL, 0, '', 0, '0', 5.5, 3, 2.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-20 21:49:00', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:49:00', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('bcfa771b-306e-c68a-8f75-5532bd0376ee', 'RA169-Pasadena Haven', 'ra169-pasadena-haven', 'This cute duplex is only 3 blocks from Lake Tahoe, so you can enjoy lovely walks to the lake or to local restaurants and shops! Pasadena Haven is a cozy home with a lot of warmth - a great place to relax by the wood-burning fireplace after a day of activity in the surrounding area. The property is only minutes from Heavenly for hikes or winter sports, or to the casinos for hours of fun. You''ll love the patio and garden with a BBQ grill. Enjoy all the comforts of home with wireless internet, great spots for reading and lounging, and a washer/dryer. 4 people will sleep comfortably in this house with 2 bedrooms and 1.5 baths. Rent Pasadena Haven together with Pasadena Hideaway for larger groups!The South Lake Tahoe area features world-class ski resorts, hiking trails, parks, beaches, restaurants, recreation, boating and numerous other tourist attractions, as well as the nearby casinos of Stateline. A perfect year round vacation destination, with fantastic weather and breathtaking scenery. Q, Q, Wireless Internet & DVD Player 26 In. Flat Screen LCD, TV & DVD Player. Sleeps up to 4. ', 'United States', 'California', 'South Lake Tahoe', '', '', '96150', '38.940821', '-119.979917', NULL, 0, '', 0, '0', 3.5, 2, 1.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-18 22:23:07', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:23:07', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('bda5026a-2417-09b5-3094-5532c0b3c4a1', 'RA226-Skidder Trail Luxury Northstar Home', 'ra226-skidder-trail-luxury-northstar-home', 'This beautiful home is located on the golf course surrounded by natural greenery. It offers four bedrooms—two of which are master bedrooms, a wet bar, a fully equipped kitchen, fireplace, and a two-car garage as well as a a gas barbeque and a deck to enjoy it on. You and your family can also enjoy a variety of friendly competitions and games with the pool table, foosball table, air hockey table, and bumper pool at your disposal. In addition, this home grants you access to the Northstar Homeowners Swim and Racquet Club. This includes access to a pool, tennis courts, and even a hot tub! Then, after a day of fun indoors or out, you can watch a movie in the home theater or lie back in the Jacuzzi tub.Located in Truckee, this home also places you within easy reach of all the fun that Tahoe has to offer. A mere three minute drive will bring you to the Northstar Ski Resort where you can enjoy downhill and cross-country skiing along beautiful, tree-lined runs. The Northstar area also offers horseback riding, ice skating, mountain biking, tubing, hiking, fishing, and even a rock climbing wall! Then, when you’ve gotten off the slopes and want to unwind, you can spend some time browsing the many stylish boutiques and galleries or sit down for a meal at your choice of cafés and restaurants. For those with children seven and under, make sure to visit KidZone—a children’s museum with fun, interactive exhibits designed just for kids. With all this and more, this area is the perfect choice for your next getaway whether you’re looking for excitement or just some peace and quiet with a breathtaking view.\n\nParking space: 2', 'United States', 'California', 'Truckee', '', '', '96161', '39.290585', '-120.113555', NULL, 0, '', 0, '0', 7.5, 4, 3.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-18 22:38:05', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:38:05', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('bdce006f-a4f7-8433-e99b-5532ba64e11e', 'RA89-Museum Townhouse', 'ra89-museum-townhouse', 'The Museum Townhouse is a beautifully appointed home in one of San Francisco’s most desirable neighborhoods. The Museum Townhouse offers wonderful views, a convenient location, and genuine warmth and comfort. The unit is a short walking distance from the Castro District and the numerous transportation options on Market Street. The Randall Junior Museum is across the street from the Townhouse.The Museum Townhouse has been thoughtfully decorated with an eye towards comfort and style.  The unit is modern with great amounts of natural light streaming into the Townhouse. The neighborhood is quiet and safe.Enter the Museum Townhouse and you will find a living room with a full deck with excellent views. There is a unique sliding flat screen television and a pull out Queen sized couch. There is a stylish dining area next to a modern well-stocked kitchen. A large bedroom with two twin beds and a full bathroom completes the bottom floor. Take the circular stairs to the master bedroom and you will find the same great views, a king sized bed and the second full bathroom.\n\nStreet parking', 'United States', 'California', 'San Francisco', '', '', '94117', '37.764289', '-122.439629', NULL, 0, '', 0, '0', 4, 2, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-18 22:11:26', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:11:26', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('bdd302b9-ee67-0e3d-3f4d-5532c1a825c5', 'RA300-Honu Lani', 'ra300-honu-lani', 'Welcome to our Kauai vacation rental accommodations at Kilauea near Princeville and Hanalei on Kauai''s North Shore.\n\nThe interior floor plan of Honu Lani was designed to accommodate families or small gatherings of friends. The large family room is at the center of the house, with the master bedroom on one side with adjoining bath and two bedrooms on the other with a shared bath, for a total of three bedrooms and two baths. The large kitchen, dining and living area separates these two wings of the home. The expansive lanai is accessed by large pocket doors that disappear in the walls and thus open the whole living and dining area to an inside/outside family room.\n\nBeautifully decorated and well maintained, this perfect retreat is surrounded with lush tropical vegetation and greenery! Perched above the ocean and mountains, Honu Lani features breathtaking views of both! Relax and unwind in this 3br, 2ba house, where you will find all the comforts of home: a fully stocked kitchen, entertainment center, family room, master bedroom with king bed, 2 additional bedrooms with queen beds, beach towels, and much more.\n\nKilauea is conveniently located on the North Shore of Kauai between Kapaa and Hanalei. It is minutes away from an abundance of shopping, fine restaurants, and world class golf. Anini Beach is a beautiful, tropical ocean front community that has been home to various celebrity residents. It is known for its long barrier reef and calm water inside the reef.\n\nOther amenities included:RefrigeratorToasterCookwareCeiling FansLinensIroning BoardBusiness: Nearby ATM, Nearby Post Office, Nearby Internet Cafe, Nearby BankConvenience: Nearby Medical Services, Nearby Grocery, Golf CourseGeographic: Near Beach, Close to Town, TVNC-4213, NCU 4213, TAT # W40354318-01 ', 'United States', 'Hawaii', 'Kilauea', '', '', '96754', '22.211944', '-159.412222', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '7563d166-94d8-834c-3042-553185ff9837', 1, 1, 'Y', 'N', 0, '2015-04-18 22:39:55', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:39:55', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('c00c20e1-9291-bb40-590b-553551f7b871', 'RA346-Chauvet Condo 3A', 'ra346-chauvet-condo-3a', 'Hotel Chauvet was originally built in 1906 and celebrated its centennial with a spectacular restoration and renovation, painstakingly accomplished over two years. The result is a historic landmark building with six luxurious vacation rentals, rejuvenated with locally made brick and reappointed by craftsmen, while upscale interior and state-of-the art amenities have been added.The lodging experience at The Chauvet is truly unique! Each unit is generously sized at almost 2,000 square feet. The large master bedrooms include a huge walk-in closet. The other two bedrooms in each unit are spacious as well. Both baths boast designer fixtures but the master features a jetted tub and separate glass enclosed shower with massage jets and rainhead.The kitchen would please any gourmet, and is outfitted with custom cabinetry, stainless steel appliances, granite counter tops, wine cooler and commercial-style gas cooktop, among other delights. Of course, if you don''t want to cook for yourself, you are just steps away from Glen Ellen''s "restaurant row" with a myriad of delicious choices... or walk across the street to Glen Ellen''s own gourmet market.A brief walk south brings you to Jack London Village with the local cheesemonger, chocolate shop (made on site), olive press and market, fantastic deli, market of locally produced gourmet items and another tasting room. Add to this vision the lovely outdoor, heated pool with sundeck patio, accessible from your own wide balcony off the master bedroom, and the views of the surrounding hillsides and native oak trees from every large picture window framed by brick arches.You will be more than comfortable at The Chauvet at any time of year, with energy efficient air conditioning and heating, a gas fireplace, full soundproofing, elevator access and private garage.The unit features: 3 bedrooms, master with king sized bed, 2nd bedroom with queen and the 3rd bedroom with a king sized bed that can convert to two twins upon request in five of the units. Queen sized sofa bed in living room of Unit 1B. 3rd bedroom in 2B only features a twin day bed with a pop up trundle (which can be made up as an Eastern king on request), couch and chaise. 2 luxurious bathrooms - the master has jetted tub, glass enclosed shower with shower panel featuring rain head and massage jets along with European style hand held.Ample closet space throughout, walk-in closet in master bedroomGourmet kitchen and formal dining space, with every amenityGas fireplace in living room, energy efficient central heat and air conditioningHeated outdoor pool surrounded by sun deckWide, private balcony with dining table & chairs, propane BBQWireless internet accessCable with expanded channels and on-demand movies (and a TV in each bedroom and living room)Designer furnishings and dramatic artwork from local artistsPaintings by local artists are exhibited in the unitsSumptuous beds with luxurious linens, and thick & thirsty towelsElevator access, intercom, covered parking in private garageWasher & dryer in the unitCentral location to wineries & tasting rooms, restaurants, farmers'' and gourmet markets - walk or bike within the charming village of Glen EllenLess than a mile from Jack London State ParkIncluded with your stay are complimentary:a bottle of wine and chocolatescookies in the cookie jarcoffee, tea, juice, yogurt, granola and fresh fruitwine passes for six to Arrowood, Chateau St. Jean, Gary Farrell and Taft Street Wineryreserve tastings at Cline and Jacuzzi2 for 1 tastings at Buena Vista, Geyser Peak, Gundlach Bundschu, and Ravenswoodupgraded tastings at LedsonSonoma Valley B & B Association passport for complimentary tastings for each guest at 25+ Sonoma Valley wineries\nPlease note: The pool is open year-round, however is not heated Nov. 1 through May. 14, per County regulations.\n\n Rates reduced for longer stays: Peak 4-5 nights $595/night, 6+ nights $550/night.  Off peak 3-5 nights $495/night, 6+ nights $450/night.  Balance will be adjusted with the final billing.You can also view Condo 1A, Condo 1B, Condo 2A, Condo 2B, and Condo 3B. for larger groups or other available dates. TOT 848N, 849N', 'United States', 'California', 'Glen Ellen', '', '', '95442', '38.362343', '-122.525923', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 21:18:41', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:18:41', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('c0b1421d-fb9a-ef83-3840-5532bf215f5e', 'RA199-June Way Cabin', 'ra199-june-way-cabin', 'Have your perfect Tahoe retreat in this awesome ski cabin. This cozy vacation home is just a half a block walk from world-renowned Heavenly. Featuring an indoor sauna, private hot tub, and horseshoe pit, June Way Cabin has all the comforts of home, and then some! This property is perfect for large groups with five comfortable bedrooms: one containing a King bed, three with Queen beds, and bunk room (Double/Twin). There is a full sized kitchen with basic supplies, washer/dryer, cable TV, 2 DVD players, and inset living room seating around the fireplace. The two decks have plenty of space, a BBQ, and excellent views of Heavenly. Have the relaxed vacation of your dreams with family or friends (and your pets!) any time of year.The South Lake Tahoe area features world-class ski resorts, hiking trails, parks, beaches, restaurants, recreation, boating and numerous other tourist attractions, as well as the nearby casinos of Stateline. A perfect year round vacation destination, with fantastic weather and breathtaking scenery.\n\nPermit number: VHR#2364\n\n ', 'United States', 'California', 'South Lake Tahoe', '', '', '96150', '38.937051', '-119.942328', NULL, 0, '', 0, '0', 7.5, 5, 2.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-18 22:31:03', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:31:03', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
