('c3356ed0-b9d5-0c43-b9b8-55355e79c4de', 'RA414-Lucky Tree Cabin', 'ra414-lucky-tree-cabin-1', 'This authentic, hand built log cabin is furnished in the classic "Old Tahoe" tradition right down to the soft leather sofa, club chair and Oriental carpets. Filled with Lake Tahoe''s charming history, there is a timeless, rustic mountain feel in every room. This is a single level home. The living room has soft leather furnishing that provide seating for 5, plus a wood stove and TV/DVD/VCR system. The Dining area has a table that seats 4 and the kitchen is fully stocked with gas stovetop and all other amenities. The deck has and charcoal BBQ and seating for 3, which overlook forested open space. The Master bedroom has a full sized bed with TV/DVD player and full bathroom attached. The second and third bedrooms also have Full sized beds. This economy rated cabin is nestled in the hills above Truckee and is a cozy, romantic, welcoming retreat. Quiet, yet close to most everything, it has great winter access and is perfect for a Tahoe skiing and snowboarding vacation. "Lucky Tree Cabin" is located in Tahoe Donner, and include access (with nominal fee) to the following amenities- championship 18 Hole Golf Course, pro shop, downhill ski resort, a cross country ski resort (featuring several warming huts and a ski-in cafe), the fine Lodge restaurant, deli/market, tennis courts, equestrian center, hot tub, swimming pools and a brand new, year-round gym to just name a few. Also includes access to a private marina, beach and boat launch at Donner Lake. The beach features a cafe, concession stand, chaise lounges, boat rentals, (including kayaks), and a designated swimming area. Tahoe Donner is located approx. 5 mins to downtown Truckee, and 10-30 mins to Sugar Bowl, Northstar, Squaw Valley, Alpine Meadows, Boreal ski resorts. \n\nPet friendly.', 'United States', 'California', 'Truckee', '', '', '96161', '39.339606', '-120.217924', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '631c13a2-1961-0d99-7cd7-553184a48eb8', 1, 1, 'Y', 'N', 0, '2015-04-20 22:14:12', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:14:12', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('c50824f7-ac94-0348-1d27-5532bc1acc05', 'RA160-Larch Cabin', 'ra160-larch-cabin', 'Cabin sits back off the street for your privacy amongst abundant natural pines. Surrounded by lush landscaping with a fenced- in front yard, flagstone walkway to the front door and secluded deck seating at the back of the cabin. Just a few blocks walk to the Lake and Tahoe Queen, shopping and dining. Very close to Heavenly with ski shuttle only / block away and within walking distance or very short drive to the Stateline Casinos. Well appointed cute, clean & cozy cabin offering a true "Tahoe" ambiance and atmospher, comfortable furnishings, a wood burning fireplace, TV w/ DVD in livingroom and TV upstairs.\nSki lease available for 1/7/2014 @ $2,300.00/month + $350.00 cleaning fee. Sleeps 6. Utility Allowance of $75.00/month for both gas & electric.\n\nPermit number: VHR#3799', 'United States', 'California', 'South Lake Tahoe', '', '', '96150', '38.945377', '-119.953102', NULL, 0, '', 0, '0', 4, 2, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-18 22:18:43', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:18:43', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('c5e32271-ba87-61bb-4c18-5532c20fdb48', 'RA180-Sky Meadows Retreat', 'ra180-sky-meadows-retreat-1', 'This comfortably furnished home is located in a peaceful, wooded neighborhood of South Lake Tahoe. With two bedrooms and a loft, it has plenty of room for everyone in your family. The washer and dryer make laundry easy. Add the fully quipped kitchen and you’re set with all your basic needs covered so that you can focus on what really matters—enjoying your vacation! Watch a movie in comfort on the wide-screen TV with a fire in the hearth or enjoy the scenery from the patio with some sizzling, fresh barbeque. If you’re traveling with an extra large party, this home is also mere seconds away from several other rental properties. Just look for the Sky Meadows Court and Sky Meadows Home.Located in Sky Meadows, this home gives you easy access to a variety of venues from great restaurants to shops, galleries and more! Treat yourself to some fantastic food at the Fresh Ketch Lakeside Restaurant in the Tahoe Keys Marina a mere four minutes drive away. Not only does it have a Seafood Bar, it also offers fine dining upstairs with a view of the lake. Also only four minutes away is the Eagle Valley Frames and Art Gallery and Hanifin’s Arts and Antiques where you can find a collection of works by local artists. If you came to ski, a fourteen minute drive will take you to the Heavenly Ski Resort! You can also go boating and fishing or hike one of the area’s many trails as you enjoy Tahoe’s breathtaking scenery.2 night minimum required. Prices do not reflect taxes and cleaning fee. Holiday Weekends Excluded. \n\nPermit number: VHR#102449', 'United States', 'California', 'South Lake Tahoe', '', '', '96150', '38.922129', '-119.995299', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-18 22:44:31', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:44:31', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('c63ab0fe-5f71-aac8-56be-5532c126ea22', 'RA313-Seymour', 'ra313-seymour', 'This roomy mountain home is ready for your ski group or large family. This 2200 square foot, 4 bedroom, 2 bath North Lake Tahoe vacation rental is conveniently located near Tahoe City with easy access and parking for 4 vehicles. This vacation home has three levels - the bottom floor features an oversized bedroom that also serves as a family room with TV/VCR and game table. The main level features two bedrooms, living, dining and kitchen with the large master suite located on the upper level. Nice upgrades have been added throughout including new carpet, slate entry, wood flooring and new kitchen appliances.  If you need plenty of space to spread out in, this mountain home is perfect for you.\n\nAmenities\nBusiness district, CD Player, Dishwasher, DVD player, Fireplace, Microwave, Stereo, Telephone, VCR players, Washer/Dryer, Beach Access, Lake Nearby, Boating, Satellite/Cable Television, Skiing, Walking, Golf', 'United States', 'California', 'Carnelian Bay', '', '', '96140', '39.206678', '-120.099979', NULL, 0, '', 0, '0', 6, 4, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '631c13a2-1961-0d99-7cd7-553184a48eb8', 1, 1, 'Y', 'N', 0, '2015-04-18 22:42:20', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:42:20', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('c6df0ce9-a0ad-60a0-a701-5532bd6b483b', 'RA168-Wildwood Flat', 'ra168-wildwood-flat', 'This Heavenly Valley condo is close to lifts, casinos and Lake. Great central location, EZ access year-round. This unit is clean, comfortable, and affordable! Sleeps 5 and has covered carport.\n\nPermit number: VHR#2238', 'United States', 'California', 'South Lake Tahoe', '', '', '96150', '38.945137', '-119.950136', NULL, 0, '', 0, '0', 3.5, 2, 1.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-18 22:22:32', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:22:32', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('c6e4e68d-c07a-a883-e7d0-5532be02c98e', 'RA193-Venice Drive Meadow View', 'ra193-venice-drive-meadow-view', '\nLovely, spacious, recently built home with views of the meadow and the lake in the distance.Both adults and kids will appreciate the separate downstairs den and the large backyard. Venice Drive Meadow View is located in the exclusive Tahoe Keys community, so renters have the opportunity to take advantage of numerous Tahoe Keys amenities such as indoor and outdoor swimming pools, basketball court, putting green, playground, beach area and pier, and tennis courts! This property sleeps 12 with 4 bedrooms, a den, and 2.5 baths.The South Lake Tahoe area features world-class ski resorts, hiking trails, parks, beaches, restaurants, recreation, boating and numerous other tourist attractions, as well as the nearby casinos of Stateline. A perfect year round vacation destination, with fantastic weather and breathtaking scenery.\n\nVery nice newer home with views of the meadow and the lake. There is a separate den downstairs. This home has access to Tahoe Keys amenities. Close to all other Venice homes for large groups.Prices do not reflect taxes and cleaning fee. Holiday Weekend Excluded.Permit number: VHR#102057 ', 'United States', 'California', 'South Lake Tahoe', '', '', '96150', '38.933722', '-120.020129', NULL, 0, '', 0, '0', 6.5, 4, 2.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-18 22:30:08', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:30:08', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('c7f00663-1986-5f67-3f68-55355decde87', 'RA400-Diamond Peak Chalet', 'ra400-diamond-peak-chalet-1', 'Diamond Peak Chalet is a charming, well appointed home in the heart of Incline Village.This home is within minutes of Diamond Peak Ski Resort in Incline Village, with Mt. Rose, Heavenly, Northstar and Squaw Valley near by. After a long day on the slope you can ease into the hot tub to warm up and relax.The kitchen is stocked with cookware, dishware and silverware as well as beautiful table settings for the dining room table and comes with a breakfast bar with seating for 5. The kitchen flows easily into the dining room, which has seating for 8, and living room area with wood burning fire place, Television, DVD, CD, Video, and Entertainment/Sound system. Off the dining room is the exterior deck with the BBQ gas grill. The master bedroom, bathroom and one guest bedroom is located just off the living room on the main level.The lower level hosts the family room with an impressive 50 inch flatscreen television ,Entertainment/sound system, DVD, CD player, and gas stove to keep you warm on those cooler evenings. This level has one guest bedroom and an additional bathroom. The beds are adorned with comfortable quilts and pillows. All linens and towels are provided.This home is within minutes of Diamond Peak Ski Resort in Incline Village, with Mt. Rose, Heavenly, Northstar and Squaw Valley near by. After a long day on the slope ease into the hot tub afterwards to warm up and relax. During the summer this home comes with IVGID beach passes, allowing guests to access Incline Village''s renowned private beaches for a daily use fee. Guests must bring the provided passes to the entry kiosks where the entry fee is charged. One of the two beaches offers beach volleyball, swimming pool and snack stand. Use of the boat launch is also available with the beach pass.\n\nThe property has a 2 car garage for small cars only, and is dog friendly - but no cats, please. This Pet Friendly property has a small fee included in its balance. Please let us know how many pets you are bringing, or if you are not bringing pets, and we will adjust the rate accordingly.  ', 'United States', 'Nevada', 'Incline Village', '', '', '89451', '39.243016', '-119.931519', NULL, 0, '', 0, '0', 6, 3, 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '631c13a2-1961-0d99-7cd7-553184a48eb8', 1, 1, 'Y', 'N', 0, '2015-04-20 22:10:27', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:10:27', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('c81bb351-c535-fdbe-7de7-5532bcc6e219', 'RA159-Paradise Lodge', 'ra159-paradise-lodge', '\nWith an amazing eight bedrooms and three baths, this house can easily accommodate all your family and friends and still have room for the family pets! A large, fenced yard gives the kids a place to run around and have fun. It also provides a great setting for making use of the charcoal barbeque. If you’re looking for some relaxation, try out the hot tub or grab a seat by the fireplace and watch a movie. Even better, the lake is only a leisurely stroll away.If you’re looking for excitement, this location gives you easy access to many of Lake Tahoe’s amazing attractions. The Heavenly ski resort is a mere six minute drive away. A three to five minute drive will take you to restaurants like the Blue Water Bistro or Lakeside Beach Grill where you can dine right on the lakefront—good food and a view! You can also go fishing, boating, and hiking, or just enjoy the beautiful, Lake Tahoe scenery. All this and mare make this the perfect location for your next big reunion!Walk to the lake, Ski Run Marina restaurants, shop, boat rentals, water sports, et.. 1 mile to Heavenly Big house, fenced yard and private hot tub.\n\nPermit number: VHR#6371', 'United States', 'California', 'South Lake Tahoe', '', '', '96150', '38.949124', '-119.951793', NULL, 0, '', 0, '0', 11, 8, 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-18 22:18:19', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:18:19', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL);
