('c8717d1c-b363-4787-0ba0-55355eeba138', 'RA426-Squaw Valley Paradise ', 'ra426-squaw-valley-paradise-1', 'Fabulous and private, this house is completely remodeled and newly furnished. It is only one minute from the Village at Squaw and 5 minutes from the Resort at Squaw Creek for skiing. The bike path is across the street from the house, allowing easy access for walking to the village and hiking in the summer.The spacious open-plan living plan with entertainment area, kitchen, dining and living room creates the perfect atmosphere for entertaining and family gatherings. The pristine condition, new furnishings, linens, all new spa-like bathrooms, appliances and kitchen make this house a relaxing no hassle get away.You will enjoy the two master suites with California King beds (sleeping for 4), one en suite Queen bedroom, one Queen guest room with extra Twin, and private hall bathroom and the six bunk kids room.The house also features an oversized one garage with parking for an additional 5 cars in the driveway, 8 person hot tub, entertainment area with flat screen satellite TV, DVD, and surround sound, wood burning fireplace in the living room with separate overhead stereo system, mud room with lots of storage and washer/dryer.With an exceptional floor plan and a lovely yard with deck and hot tub set off the road up a gently graded driveway you find paradise in this house. It is superb convenience to year round activities on your doorstep. This home is exceptional and the amenities and decor will make this a memorable vacation. ', 'United States', 'California', 'Olympic Valley', '', '', '96146', '39.201403', '-120.224917', NULL, 0, '', 0, '0', 9, 5, 4, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '631c13a2-1961-0d99-7cd7-553184a48eb8', 1, 1, 'Y', 'N', 0, '2015-04-20 22:17:44', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:17:44', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('cae12e95-9185-35da-f304-553567c50f51', 'RA459-Comfortable Northstar Condo on Ski Trail', 'ra459-comfortable-northstar-condo-on-ski-trail', 'Step right in to your home away from home at this comfortable Northstar condo.  Your family and friends will have plenty of privacy in this two bedroom, two bath condominimum in one of the most popular vacation destinations in Tahoe.   The ground floor features a fully stocked kitchen and cozy living room, with large windows and a real wood stove.  The master bedroom and bath can also be found on the first floor, and there is soft carpeting througout.  The entertainment center in the living room is ready for your tunes with an iPod dock.Stairs lead up to the second floor, where you find bunk beds in a loft-type setting, and the second bedroom.  These guests share a full bath, with plenty of linens and towls available for all.  This unit has access to sauna, steam room, pool, and hot tub at the Northstar Recreation Center.  Please note that this is a smoke and pet-free home. ', 'United States', 'California', 'Truckee', '', '', '96161', '39.272738', '-120.121316', NULL, 0, '', 0, '0', 4, 2, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 22:54:24', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:54:24', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('cb3c52ee-f7ae-ea8f-6dda-5535674f4987', 'RA470-Aspen Creek Condo in Premier Location', 'ra470-aspen-creek-condo-in-premier-location', 'This one bedroom condominium is a premier condominium at Aspen Creek. It''s located in the best spot of building 4 with great mountain views. The bedroom has a king bed and the living room has a sofa sleeper. There is a fully equipped kitchen, 2 TVs, 2 VCRs, CD player, telephone (local calls only), woodstove (firewood provided), atrium balcony and mud room for ski/snowboard equipment. This unit is non-smoking and has one assigned underground parking space (garage height 8''0"). This space is tight and will not fit large vehicles, but there is outdoor parking available. ', 'United States', 'California', 'Mammoth Lakes', '', '', '93546', '37.634286', '-118.988993', NULL, 0, '', 0, '0', 2, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 22:55:35', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:55:35', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('cb3d907d-4afd-9f55-5708-553562e770ce', 'RA393-Chambers Retreat', 'ra393-chambers-retreat-2', 'This warm and welcoming home is perfect for family gatherings and year round fun activities!The warm wood interior gives this cozy Tahoe Cabin a great family feel... In the winter, enjoy the convenient location nearby Homewood ski area. Just a bit further is Alpine Meadows and Squaw Valley. In the opposite direction find Sugar Pine Point State park with miles of X.C. groomed trails and plenty of snowshoeing. In the summer, enjoy the private HOA tennis courts and pool.\n\nOnly a 10 minute walk (half mile) to Chamber’s Landing Beach. You’ll find this home a relaxing quiet get away located just a walk to Lake Tahoe and minutes to the Ski slopes. --Main level: -open kitchen with upgraded counters and bar seating for 3 -Living room with with a lovely vaulted ceiling, beautiful stone fireplace and large flat screen HD TV with Satellite TV...pull out queen sofa (sleeping for 2) -dining room: large table with seating for 6 people.\n\nBedroom 1: queen bed, TV, plus full bathroom with shower (no tub) -laundry area with washer/dryer -entrance to wrap around deck allows for great outdoor seating and bbq (summer use only) --Upstairs: -open loft Master Bedroom with queen bed, large Flat Screen HD TV, with full bathroom (shower only) -Just to the left of the master bed room, Not pictured, is a small children''s room with two twin beds -to the right of the Master Bedroom/Loft is a smaller loft sleeping area with futon (sleeping for 2).\n\nLocated Nearby Homewood...approx. 15 mins to Alpine Meadows/Squaw Valley Ski Resorts!Please note: This home has a tricky driveway and requires a 4 wheel drive vehicle for access. Hi-speed internet is available, and the the property is pet-friendly. This Pet Friendly property has a small fee included in its balance. Please let us know how many pets you are bringing, or if you are not bringing pets, and we will adjust the rate accordingly.\n\nNo smoking! Pet Friendly!Book 3 nights and get the 4th free (excluding holiday weeks). ', 'United States', 'California', 'Tahoma', '', '', '96141', '39.073378', '-120.147184', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-20 22:34:27', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:34:27', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('cbe617ea-e189-dfb9-f5f1-5532bb6eb586', 'RA158-Wildwood Retreat', 'ra158-wildwood-retreat', 'This two-bedroom condo in South Lake Tahoe is perfect for your next family vacation. It comes with a washer and dryer as well as a full kitchen with microwave and dishwasher for your convenience. Satellite and cable TV and a DVD player gives everyone access to their favorite shows. There’s even a gas barbeque available for your enjoyment!This retreat also gives you easy access to everything you might want from a trip to Tahoe. A short, three minute drive will take you to the Heavenly ski resort. You can also go fishing and boating on the lake. If you don’t want to cook, this area also offers a large variety of restaurants including lakefront dining venues like the Lakeside Beach Grill a mere five minutes away. Take advantage of Tahoe’s many trails to not only get some exercise, but also to enjoy Lake Tahoe’s breathtaking scenery. Then, treat yourself to some care and relaxation at the Massage Therapy Cottage, a day spa facility only half a mile from this house. With everything you could want right around the corner, this home couldn’t be more convenient.Permit number: VHR#1546', 'United States', 'California', 'South Lake Tahoe', '', '', '96150', '38.945137', '-119.950136', NULL, 0, '', 0, '0', 3.5, 2, 1.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-18 22:17:57', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:17:57', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('cd5fba97-3776-8a38-c3d3-55354f3fd38f', 'RA325-Briggs', 'ra325-briggs', 'This is a beautiful home with room for everyone. This would be great home for two families or a large group of people. The downstairs is set up as a "mother in law unit" with a full kitchen and living area, as well as two bedrooms. The upstairs is light and bright and open, with a comfortable living room, dining area and kitchen.\n\nAmenities\nBusiness district, CD Player, Dishwasher, DVD player, Fireplace, Microwave, Stereo, Telephone, TV(s), VCR players, Washer/Dryer, Pet Friendly, Garage, Lake Nearby, Skiing Nearby, Golf Nearby, Boating, Satellite/Cable Television, Dialup/DSL Internet Access, No Smoking, Community Pool, Community Hot Tub, Community Tennis, Skiing, Horse Riding, Walking, Golf\n ', 'United States', 'California', 'Truckee', '', '', '96161', '39.348288', '-120.222002', NULL, 0, '', 0, '0', 8, 5, 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 21:13:14', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:13:14', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('cd61d260-63ff-5b43-0c2b-55356b6b4ca8', 'RA539-Snowcreek End Unit with Great Views', 'ra539-snowcreek-end-unit-with-great-views', 'This very nice, three level, three bedroom + loft condominium is an end unit with great views. There is a fully equipped kitchen, balcony with BBQ, fireplace (wood provided), breakfast nook, TV & VCR in living room and loft, DVD in living room and washer/dryer. One of the very few units in Snowcreek with a small separate dining room area off the kitchen. This table seats 4-5 people. There is an additional dining room table between the living room and kitchen that seats 6. The master bedroom has a king bed. The second bedroom has a trundle bed (2 twins) and the third bedroom has a queen. The loft has a sofa sleeper. This unit is non-smoking and has two outside parking spaces (unassigned).\n\n\nAthletic Club (fee)\nVaulted Ceilings', 'United States', 'California', 'Mammoth Lakes', '', '', '93546', '37.633672', '-118.976829', NULL, 0, '', 0, '0', 5.5, 3, 2.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-20 23:11:31', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 23:11:31', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('cd81f758-93ea-f6fe-3410-55356bc54a85', 'RA525-Mammoth Ski & Racquet 2 Bedroom Downstairs Condo with Views', 'ra525-mammoth-ski-racquet-2-bedroom-downstairs-condo-with-views', 'A beautiful two bedroom, two bath condominium located in Mammoth Lakes. This unit is located in building K. This property features: a fully equipped kitchen, small balcony with a view of the mountain and gondola, telephone (local calls only), free wireless, and gas fireplace. The master bedroom has a king bed with flat screen TV and DVD player and the second bedroom has a double bed and a twin bed with twin trundle, and Flatscreen TV. The living room has a sofa sleeper, flat screen TV with DVD player, and video player. This unit is non-smoking and has a one car garage. The garage height is 6.5'', and there is parking available outside. The free village shuttle stops just feet away from the complex, or you can ski from Roller Coaster to the complex on the new Village Ski Back Trail or walk back from Canyon Lodge. Mammoth Ski and Racquet is located within walking distance to the Canyon Lodge and the Village Gondola. If the walk is too far, there is a free shuttle service (blue line) that stops on Canyon Boulevard. The shuttle travels to Canyon Lodge and the Village. Mammoth Ski & Racquet offers garage parking, an outdoor spa, sauna, recreation room and laundry facilities. During summer, the swimming pool and tennis court are open. For nearby apres ski and fine dining, the Austria Hof restaurant is a short walk away.\n Game RoomBBQ (Summer)Clubhouse (Shared)Pool (Summer Only)Location Ski in (Snow Permitting)', 'United States', 'California', 'Mammoth Lakes', '', '', '93546', '37.648529', '-118.997741', NULL, 0, '', 0, '0', 4, 2, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-20 23:11:19', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 23:11:19', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', 