t Friendly!Book 3 nights and get the 4th free (excluding holiday weeks). ', 'United States', 'California', 'Tahoma', '', '', '96141', '39.073378', '-120.147184', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-20 21:35:07', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:35:07', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('d405282d-2ad3-efff-08a1-5532bb35c63c', 'RA150-Tata Lane Chalet', 'ra150-tata-lane-chalet', 'Brand new, high-end remodel - a bright & cheerful 2 bedroom plus loft area. Pine accents, nicely furnished, with 3 TVs, surround sound & DVD. Convenient to beach, trails, skiing and casinos. Q, Q, Qsleepr max 6\n\nPermit number: VHR#6370', 'United States', 'California', 'South Lake Tahoe', '', '', '96150', '38.913217', '-120.008529', NULL, 0, '', 0, '0', 4, 2, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', 'b1667c1f-9e1f-85f3-9682-55317452e139', 1, 1, 'Y', 'N', 0, '2015-04-18 22:16:03', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:16:03', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('d4fa6c8e-80d9-1596-fb35-55356b361fb7', 'RA534-Snowcreek 1 Bedroom Condo with Sunny Exposure', 'ra534-snowcreek-1-bedroom-condo-with-sunny-exposure', 'This single level, one bedroom condominium is a downstairs corner unit with sunny exposure and view of trees and mountains. The bedroom has a king bed and the living room has a sofa sleeper. The condo has a fully equipped kitchen, small balcony, TV, VCR, DVD, CD player, telephone (local calls only), washer/dryer and woodstove (firewood provided). This unit is non-smoking and has one outside parking space (unassigned). During winter, the red line shuttle route is located on Minaret Road to the Village and Main Lodge. If the distance is too far to walk, then we recommend driving to the mountain. Eagle Lodge is the closest ski area located within a couple of miles.', 'United States', 'California', 'Mammoth Lakes', '', '', '93546', '37.634849', '-118.974059', NULL, 0, '', 0, '0', 2, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 23:11:27', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 23:11:27', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('d50c0205-a44a-112e-cbc1-5532bff645e4', 'RA206-Herbert Avenue Condo', 'ra206-herbert-avenue-condo', 'Top of the Line total Remodel/2007. Hardwood floors, granite countertops. Views of Heavenly, summer pool. Cls to Heavenly, casinos and walk to Lake Tahoe. School with playground, baseball field is nearby. Q, Q, Tw Bunk, Qhab, Charcoal Grill Has wi-fi.\nPrices do not reflect taxes and cleaning fee.\n\nPermit number: VHR#102096', 'United States', 'California', 'South Lake Tahoe', '', '', '96150', '38.941370', '-119.960163', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-18 22:33:49', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:33:49', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('d5dd2a5b-63cc-a610-1f0b-5532bcaf2805', 'RA161-Birch Country Cabin', 'ra161-birch-country-cabin', 'This cute, country cabin is fully furnished for your use and will make you feel right at home with its cozy décor. Three bedrooms complete with fresh linens, two bathrooms, a fully equipped kitchen, and more provide you with everything you need to enjoy a great vacation. The large backyard and charcoal barbeque let you take advantage of the wonderful California weather. Access to wireless Broadband Internet lets you stay connected. Have fun playing board games with your family and friends, or try out the Nintendo games on the widescreen TV. And, to round things off, soak in that extra touch of cabin atmosphere beside a real, wood-burning fireplace.The ski slopes of Heavenly are only five minutes away by car, and you can walk to the Ski Run Marina. The Ski Run Marina Village is a landmark in Lake Tahoe and boasts everything from boat and just ski rentals to art galleries and some of the best lakefront restaurants. Visit the Wildman café and coffee shop with its tasty pastries and great prices, or try the Riva Grill Restaurant—located right on the beautiful South Lake Tahoe shore with lakefront dining year round. Come enjoy the amazing scenery, great food, ski slopes, and more that Lake Tahoe has to offer!Country cabin close to the slopes at Heavenly. Minutes to the casinos and lake. Prices do not reflect taxes and cleaning fee. Holiday Weekends Excluded.\n\nPermit number: VHR#3978', 'United States', 'California', 'South Lake Tahoe', '', '', '96150', '38.944168', '-119.955102', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-18 22:19:46', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:19:46', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('d5e987f9-2948-66e3-952f-5532b9db413d', 'RA79-Central Victorian 1 Bedroom', 'ra79-central-victorian-1-bedroom', 'Please note : this Property requires a 30 day minimum stay\n\nLocated on Buena Vista Park, our Central Victorian is a newly renovated one bedroom apartment suitable for accommodating up to four people.  It is just a few blocks away from the exciting Haight Street shopping area with its numerous restaurants and shopping opportunitiesCentral Victorian One Bedroom has abundant natural light and views throughout. The apartment has been carefully renovated to make your stay comfortable. The neighborhood while centrally located is quiet and very safe.Central Victorian One Bedroom has a large living room with a pull out Queen sized couch.  There is a separate seating area in the turret window that both overlooks Buena Vista Park and has views towards downtown San Francisco.  The kitchen is good sized and has an eat-in area bracketed by windows. The bedroom has a Queen sized bed along with a small seating area. There is a walk-in closet.If available and you need more space, this unit may be rented in addition to Central Victorian 2 Bedroom and Central Victorian Lower\n\nNo parking available', 'United States', 'California', 'San Francisco', '', '', '94117', '37.769107', '-122.443407', NULL, 0, '', 0, '0', 2, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-18 22:07:24', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:07:24', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('d5fb5561-a24d-7791-9c18-5532ba1a58e0', 'RA125-Northstar Mountain Home', 'ra125-northstar-mountain-home', 'This comfortable mountain home will bring you back time and time again with modern accommodations and easy access to all Northstar has to offer including door-to-door shuttle service. The open floor plan is warm and inviting and the wrap-around sofa surrounding the wood burning fireplace will keep you cozy and warm during those cool High Sierra evenings.Great for families or large groups. The master bedroom is spacious and great for watching a movie on the flat screen television.  Three additional bedrooms are located on the lower level in addition to a private sitting room with access to the private back yard perfect for a small snow play area. Convenience, comfort, and value make this property a great home base for ski trips and spring/fall/summer mountain getaways.Northstar Recreation Center has the following amenities:$2 per guest per day charge (cash only)Swimming Pools - Junior Olympic Size (with diving board) Open Memorial Day through Labor Day, 9:00 a.m. - 7:30 p.m. The Heated Lap Pool is open year-roundTennis Courts (Summer Only) - Ranked number one tennis resort by Tennis Week Magazine. Ranked number one best tennis camp value by USA Today. Certified instructors teach an array of classes and clinics for all ages.Three Outdoor Spa Tubs 26'' diameter Family Spa 10'' x 15'' Adult Spa (families okay when Family Spa closed) Covered Shaped Adult Spa (adults only)Game Room - air-hockey, foosball, ping pong, video games, pool tables, TV room', 'United States', 'California', 'Truckee', '', '', '96161', '39.285684', '-120.124950', NULL, 0, '', 0, '0', 6, 4, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-18 22:13:47', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:13:47', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('d6896500-8b29-ad88-b2ff-553557e1711f', 'RA419-Pine Needle Meadows', 'ra419-pine-needle-meadows', 'Remodeled from head-to-toe, Ponderosa Palisades home has brand new hardwood flooring and carpet, granite counters and upgraded tile, full of sunlight and warm finishes. This home is perfect for families and their dogs, too!The main level of Poderosa Palisades has a large living area with seating for 5, plus a brand new 40" plasma TV (not pictured), as well as lots of sunlight and open space! The remodeled kitchen comes with granite counters, TWO dual sinks, and looks out over the large yard. The dining room has plenty of seating, and there is a full bathroom with shower, as well as laundry room - all with up-scale tile and granite.Sleeping on the main floor includes one bedroom with a Full futon, and another bedroom with a Twin/Full bunkbed (sleeping 3). The entrance to the large deck area is also on the main floor. Step onto the deck through the sliding doors and enjoy views of the large yard while cooking on the gas BBQ.Upstairs you will find the Master bedroom with King bed (Please note that there are 2 window benches that can sleep one child each, measure approx. 3'' x 5'', and not included in total sleeping number as they do not sleep adults) and Master bathroom, with large jetted tub and separate shower, dual sinks . . . all upgraded! High speed wireless Internet is available (subject to connectivity)Large yard, quiet neighborhood...located within 20 mins to all ski resorts and Lake Tahoe, why rent a hotel room when you can have a home for the same price! Please note that there is parking for 4, but the garage is non-accessible storage space. This Pet Friendly property has a small fee included in its balance. Please let us know how many pets you are bringing, or if you are not bringing pets, and we will adjust the rate accordingly. However, no cats are permitted due to allergies. ', 'United States', 'California', 'Truckee', '', '', '96161', '39.312745', '-120.175490', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '631c13a2-1961-0d99-7cd7-553184a48eb8', 1, 1, 'Y', 'N', 0, '2015-04-20 21:44:02', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:44:02', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('d84ebeb6-eb16-1c62-f5fa-553562fba600', 'RA386-Bernese Mountain Home', 'ra386-bernese-mountain-home-2', 'Welcome to The Bernese Mountain Home, a very private and newer 3 bedroom, 2.5 bathroom home in lower Tahoe Donner just a short drive to Truckee and all major Tahoe ski resorts. The home is accessed through a covered walkway (perfect for snowy days and all your gear) or directly from the two-car garage.\n\nUpstairs is the living room, kitchen, half-bath, and Master bedroom with a full bath and walk-in closet.\n\nDownstairs are two more bedrooms with a shared second bath. There are three decks; a primary deck off the living room, and two smaller decks off the master and second guest bedroom leading directly to a private backyard. The main living area upstairs includes a fully stocked kitchen open to the dinning area and living room. There is countertop seating as well as a dining area with seating for six. The living room is wide open with high vaulted ceilings and full-length windows offering lots of light with great sun exposure. There is a queen sized sofa couch in the living room. On-site amenities include TV/DVD/Cable/Phone and high speed wireless internet. There is a gas fireplace in the living room for a cozy evening with friends, and a gas BBQ for summer fun on the large main deck. The Master bedroom has a King Duxiana bed, TV/Cable, walk-in closet, and a full bathroom with shower/tub and double sinks. Downstairs are the guest bedrooms, one with a Queen bed and direct access to the backyard; and the other (perfect kids room) has two bunk beds (sleeping 4). The guest rooms share a full bathroom with a shower/tub combo and single sink. The Bernese Mountain Home is only about two miles to the Tahoe Donner downhill ski area.\n\nTahoe Donner is a wonderful, mountain resort community with its own private downhill ski area, a fantastic cross country ski center, a sledding hill, small market/deli, and Recreation Center. The Center offers hot tubs, a heated pool, fitness center, saunas, health spa, tennis courts, downhill and cross country ski resorts, equestrian center, Golf Club with 18-hole course and driving range, a public restaurant (The Lodge at Tahoe Donner), and a private beach on Donner Lake. Tahoe Donner is conveniently situated at the upper west end of Truckee and is just minutes to downtown shopping and restaurants. Ski area resorts including Northstar at Tahoe, Squaw, Alpine Meadows, Sugarbowl, Soda Spring, Donner Ski Ranch, and Royal Gorge Cross Country Center are just a short 15-30 minutes away. Your rental of The Bernese Mountain Home includes access cards for the Tahoe Donner Recreation Center resident amenities. A nominal charge applies for some activities. Please note that the driveway is sloped, so 4WD or chains are recommended for all winter visitors. ', 'United States', 'California', 'Truckee', '', '', '96161', '39.338785', '-120.218375', NULL, 0, '', 0, '0', 5.5, 3, 2.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 22:33:34', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:33:34', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('dbc7ed99-762c-3fd3-19c9-5532be61163f', 'RA194-Coto Cabin', 'ra194-coto-cabin', 'If you''re looking for a spectacular cabin for a group of friends or small family, this property is perfect. This beautiful, authentic log cabin was built in 2008 with luxury in mind.\n\nYou''ll "oooh" and "ahhh" over the gas-burning fireplace, upscale furnishings, marble countertops, and vaulted ceiling. You''ll also relish the quiet, peaceful forest setting. Up to six travelers can sleep comfortably in this three-bedroom two-bath abode.\n\nOn nice days, you can relax on the wrap-around porch. When it''s chilly out, you can warm up beside the fireplace. The fully furnished kitchen allows you to make a wide variety of memorable meals. Other perks include a barbecue grill, DVD player, washer/dryer, and lake and mountain views.\n\nThe home is not wheelchair-accessible, and pets and smoking are forbidden. There''s so much to do in and around South Lake Tahoe, including skiing, fishing, boating, and wine tasting. Make sure to take lots of pictures so you can share your experiences with friends back home.The South Lake Tahoe area features world-class ski resorts, hiking trails, parks, beaches, restaurants, recreation, boating and numerous other tourist attractions, as well as the nearby casinos of Stateline. A perfect year round vacation destination, with fantastic weather and breathtaking scenery.\n\nPermit number: VHR#1625', 'United States', 'California', 'South Lake Tahoe', '', '', '96150', '38.866503', '-119.999348', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-18 22:30:44', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:30:44', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('dd62d2f3-84eb-5f95-8525-5532c488d07d', 'RA233-Basque Northstar House', 'ra233-basque-northstar-house-1', 'This beautiful, three-bedroom home has a bright, open living room and stone fireplace, giving you and your family a comfortable space in which to spend some quality time together. In addition, this home grants you access to the Northstar Homeowners Swim and Racquet Club. This includes access to a pool, tennis courts, and even a hot tub! Located in Truckee, this home also places you within easy reach of all the fun that Lake Tahoe has to offer. A mere five minute drive will bring you to the Northstar Ski Resort where you can enjoy downhill and cross-country skiing along beautiful, tree-lined runs. The Northstar area also offers horseback riding, ice skating, mountain biking, tubing, hiking, fishing, and even a rock climbing wall! Then, when you’ve gotten off the slopes and want to unwind, you can spend some time browsing the many stylish boutiques and galleries or sit down for a meal at your choice of cafés and restaurants. For those with children seven and under, make sure to visit KidZone—a children’s museum with fun, interactive exhibits designed just for kids. With all this and more, this area is the perfect choice for your next getaway whether you’re looking for excitement or just some peace and quiet with breathtaking views.    ', 'United States', 'California', 'Truckee', '', '', '96161', '39.293083', '-120.126450', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '631c13a2-1961-0d99-7cd7-553184a48eb8', 1, 1, 'Y', 'N', 0, '2015-04-18 22:55:42', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:55:42', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('de691faa-c53d-a884-890e-55355f432d7c', 'RA325-Briggs', 'ra325-briggs-2', 'This is a beautiful home with room for everyone. This would be great home for two families or a large group of people. The downstairs is set up as a "mother in law unit" with a full kitchen and living area, as well as two bedrooms. The upstairs is light and bright and open, with a comfortable living room, dining area and kitchen.\n\nAmenities\nBusiness district, CD Player, Dishwasher, DVD player, Fireplace, Microwave, Stereo, Telephone, TV(s), VCR players, Washer/Dryer, Pet Friendly, Garage, Lake Nearby, Skiing Nearby, Golf Nearby, Boating, Satellite/Cable Television, Dialup/DSL Internet Access, No Smoking, Community Pool, Community Hot Tub, Community Tennis, Skiing, Horse Riding, Walking, Golf\n ', 'United States', 'California', 'Truckee', '', '', '96161', '39.348288', '-120.222002', NULL, 0, '', 0, '0', 8, 5, 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 22:20:01', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:20:01', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('de697336-c0a5-b421-1e18-55355de0a129', 'RA399-Deer Path Hot Tub', 'ra399-deer-path-hot-tub-1', 'What a delightful Northstar vacation retreat! This 2 bedroom, 2 bath home will sleep 6 comfortably or 8 if you choose to use the daybed in the living room as well as the sleeper loveseat in the loft.Bedding includes a Queen in the master suite downstairs, 2 Single beds in the upstairs bedroom, and another 2 Single beds along with a Single loveseat sleeper in the loft upstairs. There are 2 bathrooms downstairs. The bathroom which attaches to the Master bedroom has a Tub with no Shower. It does have a shower hose to use if you are sitting in the tub. The second bathroom has a Shower with no Tub.Downstairs has an open floor plan encompassing the dining room, living room, daybed nook, and reading area. There is also an office desk just near the kitchen if you need to sneak some work in on vacation. The kitchen is fully stocked with plateware and cooking needs. It has an electric stovetop, microwave, toaster, coffee maker and dishwasher. There is a mudroom as you enter to store any winter coats or wet boots as well as a ski closet outside for ski equipment.This home also has a large sunny deck for summer BBQ''s as well as a hot tub for warming up after the slopes. *Please note there is a Pak-N-Play available for guest use in the Master bedroom closet. Please note that pets are allowed. This Pet Friendly property has a small fee included in its balance. Please let us know how many pets you are bringing, or if you are not bringing pets, and we will adjust the rate accordingly. Book 3 nights and get the 4th free (excluding holiday weeks). ', 'United States', 'California', 'Truckee', '', '', '96161', '39.288299', '-120.121105', NULL, 0, '', 0, '0', 4, 2, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 22:09:39', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:09:39', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('df1a88e0-8b38-c1c1-5f80-5535506a21cb', 'RA333-Rivkin', 'ra333-rivkin', 'Beautiful custom home located on 11 acres in Tahoe Donner is the perfect place to get away from it all.  Brand new home with three bedrooms, loft, two and a half baths, and huge two car garage.  This home is located on a very desireable and quiet street in Tahoe Donner and has everything that you need.  The chef of the family will love the gourmet kitchen, which is fully stocked.\n\n\nAmenities\nDishwasher, DVD player, Fireplace, Freezer, Microwave, Oven, Refrigerator, Toaster, Vacuum Cleaners, Washer/Dryer, Pet Friendly, Garage, Lake Nearby, Skiing Nearby, Cooking Utensils Provided, Spices, Boating, River, Horseback Riding, Deck, Deck Furniture, Fully Equipped Kitchen, Gourmet Kitchen, Garbage Disposal, Linens, Television, Satellite/Cable Television, Hunting, Child Friendly, Elderly Friendly, Ice Maker, Coffee Maker, Stove Top Burner, Skiing, Cycling, Mountain Biking, Water Skiing, Wind-Surfing, Para-gliding, Swimming, Roller Blading, Tennis, Horse Riding, Sailing, Walking, Fishing, Golf', 'United States', 'California', 'Truckee', '', '', '96161', '39.355663', '-120.234259', NULL, 0, '', 0, '0', 6, 3, 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 21:14:58', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:14:58', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('e0537db1-417c-4fad-9851-5532b93b65ec', 'RA68-Central Victorian Studio', 'ra68-central-victorian-studio', 'Please note : this Property requires a 30 day minimum stay\n\nCentral Victorian offers a unit with charm and flexibility. Located on beautiful Buena Vista Park, the Central Victorian Studio can sleep two people. It is just a few blocks away from the exciting Haight Street shopping area with its numerous restaurants and shopping opportunities.Central Victorian Studio is a pleasant combination of modern convenience and casual comfort. The location is near the center of the San Francisco yet quiet and very safe. Access to many of San Francisco’s attractions are close by.The Central Studio boasts a very large sleeping living room area with a separate seating area. There is a fully stocked kitchen and newly renovated. There is a dining area in the kitchen. The unit also has large closet and changing room. There is abundant natural light throughout and views of Buena Vista Park and the San Francisco skyline.\n\nNo parking available', 'United States', 'California', 'San Francisco', '', '', '94117', '37.769107', '-122.443407', NULL, 0, '', 0, '0', 3, 2, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-18 22:06:01', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:06:01', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('e0eef362-d4ae-3da8-ee42-5532c48185e0', 'RA227-Spacious Basque Northstar Home', 'ra227-spacious-basque-northstar-home-1', 'Big spacious 4 bedroom + Loft home in Northstar with Hot Tub!Perfect for 2 families with 2 masters that each have a king. Loft with tv and futon gives kids somewhere to play while you can still hear them, but they aren''t taking over the living room. Also includes access to the Northstar HomeOwners Swim and Racquet Club!', 'United States', 'California', 'Truckee', '', '', '96161', '39.292338', '-120.118787', NULL, 0, '', 0, '0', 7, 4, 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '631c13a2-1961-0d99-7cd7-553184a48eb8', 1, 1, 'Y', 'N', 0, '2015-04-18 22:55:02', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:55:02', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('e2f6dbf1-6c48-dae6-a96b-5532c2ac9ecf', 'RA192-Venice Drive Mountain View', 'ra192-venice-drive-mountain-view-1', 'You don''t have to think twice about booking this large home in the Tahoe Keys!  A 4 bedroom beauty with incredible views of the mountains and meadow you''ll have it all plus the amenities available to people who book this exclusive community.   Nicely furnished, great for families or large groups, free local and long distance calls, as well as Wireless Internet ensures that you have everything you need at this home away from home.The expansive central living room offers fantastic views of the meadow and mountains while you toast your toes in front of the woodstove.  The open floor plan means that you can help prepare a meal in the fully equipped kitchen while watching a movie on the huge widescreen TV/DVD player with your family.  The dining area has two full sized tables plus bar seating, which will accommodate those extra friends that stop by.   In the warmer weather step out on the deck and take in the views before firing up the BBQ for a cook-out. If the excitement is too much for the kids, there is a cozy smaller living area where they can watch movies and play games.After a long day of skiing, boating, or basking by the pool, you''ll be pleased with the 4 cozy bedrooms (one King, two Queens, and one bedroom with two Twins), and if your group is extra large there is a Queen sized sofa bed.  Please keep in mind that the maximum sleeping capacity for this home is 10. Permit number: VHR#102057', 'United States', 'California', 'South Lake Tahoe', '', '', '96150', '38.931575', '-120.013516', NULL, 0, '', 0, '0', 6.5, 4, 2.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-18 22:47:17', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:47:17', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('e31b1363-94a7-be27-bbfd-5532c5c8c448', 'RA303-Kuuipo', 'ra303-kuuipo-1', 'On Kauai’s north shore in the charming town of Hanalei, this Hawaiian plantation style home is very comfortable and has a fenced yard that is ideal for families.\n\nIts location, across the street from a beach access path makes it a very short walk to the beach at crescent shaped Hanalei Bay.\n\n2 houses on one property (Ipo Hale). Rent both homes for larger groups, Kuuipo is the front house and smaller of the two.\n\n\nOther amenities:Kitchen: Refrigerator, Toaster, CookwareLiving: Ceiling Fans, Linens, Ironing BoardBusiness: Nearby ATM, Nearby Post Office, Nearby Internet Cafe, Nearby FedEx, Nearby Bank, TAT # W35432026-01, TVR 1159Convenience: Nearby Medical Services, Nearby Grocery, Walking distant to townGeographic: Near Beach, Close to Town ', 'United States', 'Hawaii', 'Hanalei', '', '', '96714', '22.205062', '-159.497635', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '7563d166-94d8-834c-3042-553185ff9837', 1, 1, 'Y', 'N', 0, '2015-04-18 22:57:47', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:57:47', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL);
