('e4bc1cb4-9c14-aab6-c16c-55355f6ba320', 'RA344-Chauvet Condo 2A', 'ra344-chauvet-condo-2a-2', 'Hotel Chauvet was originally built in 1906 and celebrated its centennial with a spectacular restoration and renovation, painstakingly accomplished over two years. The result is a historic landmark building with six luxurious vacation rentals, rejuvenated with locally made brick and reappointed by craftsmen, while upscale interior and state-of-the art amenities have been added.The lodging experience at The Chauvet is truly unique! Each unit is generously sized at almost 2,000 square feet. The large master bedrooms include a huge walk-in closet. The other two bedrooms in each unit are spacious as well. Both baths boast designer fixtures but the master features a jetted tub and separate glass enclosed shower with massage jets and rainhead.The kitchen would please any gourmet, and is outfitted with custom cabinetry, stainless steel appliances, granite counter tops, wine cooler and commercial-style gas cooktop, among other delights. Of course, if you don''t want to cook for yourself, you are just steps away from Glen Ellen''s "restaurant row" with a myriad of delicious choices... or walk across the street to Glen Ellen''s own gourmet market.A brief walk south brings you to Jack London Village with the local cheesemonger, chocolate shop (made on site), olive press and market, fantastic deli, market of locally produced gourmet items and another tasting room. Add to this vision the lovely outdoor, heated pool with sundeck patio, accessible from your own wide balcony off the master bedroom, and the views of the surrounding hillsides and native oak trees from every large picture window framed by brick arches.You will be more than comfortable at The Chauvet at any time of year, with energy efficient air conditioning and heating, a gas fireplace, full soundproofing, elevator access and private garage.The unit features: 3 bedrooms, master with king sized bed, 2nd bedroom with queen and the 3rd bedroom with a king sized bed that can convert to two twins upon request in five of the units. Queen sized sofa bed in living room of Unit 1B. 3rd bedroom in 2B only features a twin day bed with a pop up trundle (which can be made up as an Eastern king on request), couch and chaise. 2 luxurious bathrooms - the master has jetted tub, glass enclosed shower with shower panel featuring rain head and massage jets along with European style hand held.Ample closet space throughout, walk-in closet in master bedroomGourmet kitchen and formal dining space, with every amenityGas fireplace in living room, energy efficient central heat and air conditioningHeated outdoor pool surrounded by sun deckWide, private balcony with dining table & chairs, propane BBQWireless internet accessCable with expanded channels and on-demand movies (and a TV in each bedroom and living room)Designer furnishings and dramatic artwork from local artistsPaintings by local artists are exhibited in the unitsSumptuous beds with luxurious linens, and thick & thirsty towelsElevator access, intercom, covered parking in private garageWasher & dryer in the unitCentral location to wineries & tasting rooms, restaurants, farmers'' and gourmet markets - walk or bike within the charming village of Glen EllenLess than a mile from Jack London State ParkIncluded with your stay are complimentary:a bottle of wine and chocolatescookies in the cookie jarcoffee, tea, juice, yogurt, granola and fresh fruitwine passes for six to Arrowood, Chateau St. Jean, Gary Farrell and Taft Street Wineryreserve tastings at Cline and Jacuzzi2 for 1 tastings at Buena Vista, Geyser Peak, Gundlach Bundschu, and Ravenswoodupgraded tastings at LedsonSonoma Valley B & B Association passport for complimentary tastings for each guest at 25+ Sonoma Valley wineries\nPlease note: The pool is open year-round, however is not heated Nov. 1 through May. 14, per County regulations.\n\n Rates reduced for longer stays: Peak 4-5 nights $595/night, 6+ nights $550/night.  Off peak 3-5 nights $495/night, 6+ nights $450/night.  Balance will be adjusted with the final billing.You can also view Condo 1A, Condo 1B, Condo 2B, Condo 3A, and Condo 3B. for larger groups or other available dates.TOT 848N, 849N', 'United States', 'California', 'Glen Ellen', '', '', '95442', '38.362343', '-122.525923', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 22:22:19', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:22:19', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('e4fad4c2-02c5-e13d-24c3-55355efdc0f4', 'RA424-Silver Strike at Northstar', 'ra424-silver-strike-at-northstar-1', 'This warm and comfortable condo is conveniently located just steps away from the Village and lifts.Enjoy modern luxuries such as a large flat screen TV, gas fireplace, and leather furnishings. The kitchen is gourmet quality with beautiful woodwork, granite counters, and stainless steel appliances is perfect for creating family meals and wonderful memories.The entry level of this home contains the Master bedroom with a Queen bed, flat screen TV, private deck entry, and Master bathroom with shower and in-floor heating. The second bedroom contains two Twin beds (sleeping for 2), as well as a bathroom with shower and in-floor heating.The upper level of the home contains a living room with gas fireplace, 42" large flat-screen TV/VCR/DVD/Stereo, and Double sleeper sofa (sleeping for 2), with deck entry. The full kitchen comes with deluxe appliances and dining table for 6, plus 2 at side table. It also features a full laundry room, and high speed wireless Internet.\n\nThis home comes complete with full kitchen and all linens/towels.  This home does not have a barbeque grill!\n\nNo Smoking. No PetsBook 3 nights and get the 4th free (excluding holiday weeks).', 'United States', 'California', 'Truckee', '', '', '96161', '39.279135', '-120.118340', NULL, 0, '', 0, '0', 4, 2, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 22:15:53', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:15:53', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
