('e5b34dda-3272-7c14-1762-55356b7cd164', 'RA551-Stonegate 4 Bedroom 5 Bath Estate Size Home Located by Golf Course', 'ra551-stonegate-4-bedroom-5-bath-estate-size-home-located-by-golf-course', 'The Lodge floor plan in this home is tri-level with 4 bedrooms, loft, den, 5 bathrooms, 2-car garage and sleeps 11 with wireless internet (password posted onsite in the Guest Book). The first floor has three master bedrooms. The first master has a set of bunk beds with a double on the bottom and twin on top. The second and third master have a queen bed and overlooks the golf course and trees. The den has a couch, large flat screen TV and access to the deck overlooking the golf course and trees. Laundry room with washer, dryer and sink is located on this floor next to the entry to and from the garage. On the second floor, there is a large master bedroom with a king bed, gas fireplace and walk-in closet. In addition, there is a separate bathroom located on this floor. The kitchen is spacious with two islands, professional-grade appliances, 6-burner stove, stone countertops and sub-zero wine storage. The living room has vaulted ceilings, large flat screen TV and DVD. Enjoy great views of the golf course and trees. The loft is located on the third floor. There is a couch, sofa sleeper and coffee table. This home is non-smoking. Don''t forget your cell phone because this home does not have telephone service. ', 'United States', 'California', 'Mammoth Lakes', '', '', '93546', '37.645662', '-118.982669', NULL, 0, '', 0, '0', 9, 4, 5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 23:11:39', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 23:11:39', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('e60833cf-0bcf-2fa9-2696-5535553a87df', 'RA397-Darling Delight Cabin', 'ra397-darling-delight-cabin', 'Meander up the stone pathway to your tranquil place of retreat. This quaint getaway is on 5 private acres and features a gourmet kitchen with stainless steel appliances. Relax in front of the stone fireplace, grill on the gas BBQ, or soak in the peaceful hot tub nestled on the sunny deck. Hike miles of trails on Forest Service land, enjoy a bike ride on the paved bike path, stroll down to the nearby private beach with picnic area and playground.  This "old Tahoe" style cabin is a couples delight or perfect setting for a small family.Located just 5 minutes from Tahoe City''s beaches, music festivals, and farmers markets. World class dining is just around the corner, as well as boutique shopping and art galleries. Just 15 minutes to Squaw Valley, Alpine Meadows, and Homewood Mountain Ski Resorts!Downstairs is the Living Room with a pull-out couch (sleeps 2), Fireplace, TV/DVD/Stereo, and beautifully remodeled kitched with granite counters.\nThe Master bedroom has a Queen sized bed and private bath. \n-access to deck with BBQ (summer use only) and private hot tubUpstairs is a loft with two Twins, full bath, and a double sized Aerobed available.  There is no washer/dryer at this cabing, and HOA private beach access is included, as well as high speed wireless internet.  Pets may be considered at an additional cost. -small children''s play area/deskPlease note that during winter months 4-wheel drive + chains highly recommended for driveway.Book 3 nights and get the 4th free (excluding holiday weeks). ', 'United States', 'California', 'Tahoe City', '', '', '96146', '39.145535', '-120.155845', NULL, 0, '', 0, '0', 4, 2, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '631c13a2-1961-0d99-7cd7-553184a48eb8', 1, 1, 'Y', 'N', 0, '2015-04-20 21:36:51', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:36:51', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('e77eee86-1c3d-4420-16be-5532bab5c741', 'RA105-Noe Valley Suite', 'ra105-noe-valley-suite', 'Please note : this Property requires a 30 day minimum stay\n\nThe Noe Valley Suite is a newly remodeled property that is designed for comfort and convenience.Located on a lovely tree lined street in the middle of Noe Valley, the Suite is less than a block from numerous restaurants, shopping opportunities, and public transportation but still exudes a residential neighborhood ambiance. The Noe Valley Suite has all of the amenities required for a longer stay and at the same time is ideal for a brief vacation.As you enter the unit you will find a very nicely laid out one bedroom apartment. The living room is just to the left of the entrance and has a Queen sized pull out couch and large flat screen television. Opposite the living room is the fully stocked kitchen and dining area. Adjacent to the kitchen is the bathroom. As you continue to the rear of the apartment you will find the bedroom. The bedroom has a window facing the backyard.The building has a laundry room and large backyard. Whether you are in San Francisco on vacation or business, seeing family or visiting the sites, our Noe Valley Suite is an ideal location for your stay in the City.\n\nNo parking available', 'United States', 'California', 'San Francisco', '', '', '94131', '37.748547', '-122.426176', NULL, 0, '', 0, '0', 2, 1, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-18 22:13:20', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:13:20', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
