ained" pets considered in Units 1A and 1B. Additional deposit required.Rates reduced for longer stays: Peak 4-5 nights $595/night, 6+ nights $550/night.  Off peak 3-5 nights $495/night, 6+ nights $450/night.  Balance will be adjusted with the final billing.You can also view Condo 1A, Condo 2A, Condo 2B, Condo 3A, and Condo 3B. for larger groups or other available dates. TOT 848N, 849N', 'United States', 'California', 'Glen Ellen', '', '', '95442', '38.362343', '-122.525923', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 21:16:07', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:16:07', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('e916fc55-436f-d245-682b-55355dcd4465', 'RA406-Glacier Luxury Lodge', 'ra406-glacier-luxury-lodge-1', 'Set atop Glacier Way, with almost 360 degree panoramic views of Truckee, the Pacific Crest and the mountains at Squaw and Northstar. Guests are entitled to use the full facilities of Tahoe Donner, including downhill and nordic center, a private beach club at Donner Lake, year-round pool, hot tubs and workout facility. The property overlooks the back side of Tahoe Donner Downhill Ski Area, a favorite area for families and kids. Adjacent to trails, including Donner Ridge Trail, one of the most popular hiking, snow-shoeing and cross-country trails in the area. For the more adventuresome, join the many locals on the hills and trails behind the house for backcountry skiing as well!\n\nThis is a hand crafted, post and beam, luxury timberframe home, immaculately appointed with the highest quality finishes and furnishings. Built in 2002, it is widely considered to be one of the most unique and magical homes in Tahoe Donner. Its 4200+ square feet offers 4 en suite bedrooms sleeping 10 comfortably. The main attraction though is the gourmet kitchen, dining area and spectacular great room with wine bar, satellite TV, and surround sound. Panoramic views are majestically framed by gorgeous woodwork throughout. There''s enough room for a large group for any occasion. Enjoy several outdoor decks for entertaining friends and family as well as a gourmet natural gas barbecue (summer use only due to snow).\n\nUpstairs Master Bedroom - Queen Size Bed - Sleeps 2; Upstairs Guest Suite East Wing - Queen Size Bed & Window Twin Bed - Sleeps 3; Upstairs Guest Suite East Wing - Queen Size Bed & Window Twin Bed - Sleeps 3; The east wing suites are located over the garage and are connected with a delightful breezeway to the main great room. Downstairs Guest Suite - Queen Size Bed - Sleeps 2. Attached 2 Car Garage\n\nVerizon and AT&T are accessible for guests with mobile data services. Currently, local broadband and WiFi is not available. Because the property is located at the top of Tahoe Donner, it may be exposed to extreme conditions and drifts during winter storms. Please use the garage door entrance in winter. 4X4 vehicles are mandatory in winter to access this property and it is recommended that you drive up and down the rear side of Skislope from Alder Creek if it is snowing. The driveway is level and melts quickly when the sun shines. ', 'United States', 'California', 'Truckee', '', '', '96161', '39.345199', '-120.270105', NULL, 0, '', 0, '0', 8.5, 4, 4.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-20 22:12:29', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:12:29', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('e9d00d1d-2212-e6b3-2834-553557be6cd1', 'RA426-Squaw Valley Paradise ', 'ra426-squaw-valley-paradise', 'Fabulous and private, this house is completely remodeled and newly furnished. It is only one minute from the Village at Squaw and 5 minutes from the Resort at Squaw Creek for skiing. The bike path is across the street from the house, allowing easy access for walking to the village and hiking in the summer.The spacious open-plan living plan with entertainment area, kitchen, dining and living room creates the perfect atmosphere for entertaining and family gatherings. The pristine condition, new furnishings, linens, all new spa-like bathrooms, appliances and kitchen make this house a relaxing no hassle get away.You will enjoy the two master suites with California King beds (sleeping for 4), one en suite Queen bedroom, one Queen guest room with extra Twin, and private hall bathroom and the six bunk kids room.The house also features an oversized one garage with parking for an additional 5 cars in the driveway, 8 person hot tub, entertainment area with flat screen satellite TV, DVD, and surround sound, wood burning fireplace in the living room with separate overhead stereo system, mud room with lots of storage and washer/dryer.With an exceptional floor plan and a lovely yard with deck and hot tub set off the road up a gently graded driveway you find paradise in this house. It is superb convenience to year round activities on your doorstep. This home is exceptional and the amenities and decor will make this a memorable vacation. ', 'United States', 'California', 'Olympic Valley', '', '', '96146', '39.201403', '-120.224917', NULL, 0, '', 0, '0', 9, 5, 4, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '631c13a2-1961-0d99-7cd7-553184a48eb8', 1, 1, 'Y', 'N', 0, '2015-04-20 21:47:14', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:47:14', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('e9e5759d-e612-5135-9e2b-553562d0d081', 'RA395-Cristallina Greens', 'ra395-cristallina-greens-2', 'This Tahoe Donner home is great for one or more families. Situated overlooking the 18th fairway at Tahoe Donnner, complete with hot tub, sleeping for 11, remodeled kitchen, and is pet friendly! Main floor contains the raised living room with sectional sofa and wood-burning fireplace, tv/dvd/vcr player and stereo, with seating for 7.  The huge remodeled kitchen has upgraded hickory cabinets, stainless steel appliances, and double ovens. The expansive deck, totally enclosed, overlooks the golf course, and features an easy-access hot tub and gas bbq.  There is a cozy den with pull-out sofa (sleeping for 2), with a tv/dvd/vcr and access to deck, plus its own gas fireplace. The full bath has dual sinks, and all upgraded tile/faucet/cabinets, shower (no tub).  The upstairs bedroom has two Twins with one trundle, total sleeping for 3, plus computer with internet access, fax, and printer. Second level contains the Master bedroom with a King bed, plus a full bathroom (all upgraded), with dual sinks, jetted tub, and seperate shower. The second bedroom has a Queen bed, plus access to upstairs porch.  The third bedroom also has a Queen bed and access to the upstairs porch.  These bedrooms share a full bath with dual sinks, and shower (no tub- not pictured).  There is also a laundry room with washer/dryer.\n\nHi Speed Wireless Internet! (connection cannot be guaranteed) -Outdoor hot tub -Rec center access (for a nominal fee) with hot tub, swimming pool, weight room -Access to Tahoe Donner amenities including Rec center, downhill ski area (perfect for teaching kids!), cross country ski area, equestrian center, tennis center, 18-hole golf and driving range, hiking, and so much more! -Mins from downtown Truckee! -Approx. 20 mins to Sugarbowl ski area, 30 mins to Squaw, 15 mins to Northstar, and 40 mins to Lake Tahoe. This home comes complete with full kitchen and all linens/towels.\n\nPlease note that this Pet Friendly property has a small fee included in its balance. Please let us know how many pets you are bringing, or if you are not bringing pets, and we will adjust the rate accordingly. Book 3 nights and get the 4th free (excluding holiday weeks).  ', 'United States', 'California', 'Truckee', '', '', '96161', '39.349406', '-120.235983', NULL, 0, '', 0, '0', 7, 4, 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 22:34:59', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:34:59', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('eb0245ac-f5b9-c83e-a238-55355fb11ca5', 'RA431-Stockholm Vista', 'ra431-stockholm-vista-1', 'What a fantastic Tahoe Donner vacation retreat! This 3 bedroom plus den/family room, 2.5 bath home will sleep 8 comfortably plus one more on a pull out single bed. Upstairs is where you''ll find the the living room with gas fireplace, and seating for 9, plus amazing views from every window. For your entertainment there is a 47" HDTV and DVD player, as well as Wi-Fi. The fully stocked kitchen with newer appliances, including stainless steel fridge is right next to the dining area with bar seating for 2, plus table seating for 6. Also upstairs, you''ll find the Master bedroom with King bed, TV, spacious mater bathroom with dual sinks, jetted tub, and separate shower, as well as access to the 2-car garage. On the lower level there are two more bedrooms, each with a Queen bed. There is a full bathroom with shower/tub, and the den has a Twin bunk bed (sleeps 2). The den also has sofa seating for three, and a TV/DVD player. The downstairs level has access to the deck with a Hot Tub and BBQ. This home is just a couple blocks from the Tahoe Donner cross country ski/equestrian center, and about 1 mile to the downhill ski area.  Please Note: This Pet Friendly property has a small fee included in its balance. \n\nPets are allowed upon approval and with an additional $25 cleaning fee. ', 'United States', 'California', 'Truckee', '', '', '96161', '39.363132', '-120.250193', NULL, 0, '', 0, '0', 5.5, 3, 2.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-20 22:19:26', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:19:26', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('eb527f4c-0c73-3eb0-bfde-553554f30cf2', 'RA359-Elegant 3br Daly City House with View', 'ra359-elegant-3br-daly-city-house-with-view', 'This 3br, 2ba home is located in Daly City, just south of San Francisco''s Southern Hills border, only 10 minutes from vibrant SF neighborhoods.Enjoy your vacation in an elegantly decorated, beautifully maintained house with a spacious, modern, fully equipped kitchen.  2 bedrooms have queens, 1 bedroom has a full, and a twin-sized air mattress is available for the 7th guest.This house is a few miles from the coolest restaurants, cafes, shops, theaters and others attractions of San Francisco. Very private, quiet, great location. Stylish and comfortable with all amenities including wireless internet.15 minutes from Dolores park and the hip 20/30-something Valencia corridor with top restaurants, coffee houses, and clubs. Also nearby is Noe Valley, Castro and Mission. Noe Valley is a quaint, young family shopping area; the Castro is the gay capital of the West Coast with nightlife, shops, bars and cafes. The Mission is a young, vibrant neighborhood with a 20''s/30''s crowd, bustling with bars, clubs, interesting shops, restaurants and galleries.The house is conveniently located 10 minutes from San Francisco International Airport and 20 minutes to Embarcadero, Financial District, Moscone Center, Yerba Buena Gardens, Union Square shopping and Civic Center -- with its historic buildings, museums, SF Opera House, Davies Symphony Hall, and more.\n\nOther notes:Pets Not AllowedNon Smoking OnlyCooking UtensilsRefrigeratorParking For RV/Boat/TrailerLinens ProvidedVideo Game Console', 'United States', 'California', 'Daly City', '', '', '94014', '37.707273', '-122.435722', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '84074c2f-7cba-b5fd-c906-55317d9a4878', 1, 1, 'Y', 'N', 0, '2015-04-20 21:32:28', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:32:28', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('eb7a2496-bb2b-299e-4bf2-5535554c5581', 'RA400-Diamond Peak Chalet', 'ra400-diamond-peak-chalet', 'Diamond Peak Chalet is a charming, well appointed home in the heart of Incline Village.This home is within minutes of Diamond Peak Ski Resort in Incline Village, with Mt. Rose, Heavenly, Northstar and Squaw Valley near by. After a long day on the slope you can ease into the hot tub to warm up and relax.The kitchen is stocked with cookware, dishware and silverware as well as beautiful table settings for the dining room table and comes with a breakfast bar with seating for 5. The kitchen flows easily into the dining room, which has seating for 8, and living room area with wood burning fire place, Television, DVD, CD, Video, and Entertainment/Sound system. Off the dining room is the exterior deck with the BBQ gas grill. The master bedroom, bathroom and one guest bedroom is located just off the living room on the main level.The lower level hosts the family room with an impressive 50 inch flatscreen television ,Entertainment/sound system, DVD, CD player, and gas stove to keep you warm on those cooler evenings. This level has one guest bedroom and an additional bathroom. The beds are adorned with comfortable quilts and pillows. All linens and towels are provided.This home is within minutes of Diamond Peak Ski Resort in Incline Village, with Mt. Rose, Heavenly, Northstar and Squaw Valley near by. After a long day on the slope ease into the hot tub afterwards to warm up and relax. During the summer this home comes with IVGID beach passes, allowing guests to access Incline Village''s renowned private beaches for a daily use fee. Guests must bring the provided passes to the entry kiosks where the entry fee is charged. One of the two beaches offers beach volleyball, swimming pool and snack stand. Use of the boat launch is also available with the beach pass.\n\nThe property has a 2 car garage for small cars only, and is dog friendly - but no cats, please. This Pet Friendly property has a small fee included in its balance. Please let us know how many pets you are bringing, or if you are not bringing pets, and we will adjust the rate accordingly.  ', 'United States', 'Nevada', 'Incline Village', '', '', '89451', '39.243016', '-119.931519', NULL, 0, '', 0, '0', 6, 3, 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '631c13a2-1961-0d99-7cd7-553184a48eb8', 1, 1, 'Y', 'N', 0, '2015-04-20 21:38:34', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:38:34', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('ebe6ad55-2440-8521-9d34-5532c46c8607', 'RA210-Tahoe Island Drive Luxury Home', 'ra210-tahoe-island-drive-luxury-home-1', 'Newly Constructed Home w/ Pool Table, Steam Shower and modern furnishings.This is a great home for families in a nice area, right outside of Tahoe Keys. No pets. K,Q,Q,Bunk Full/TW,3 single futons.2324sq ft. Charcoal Grill/Gas Fireplaces. Prices do not reflect taxes and cleaning fee.\n\nPermit number: VHR#2361', 'United States', 'California', 'South Lake Tahoe', '', '', '96150', '38.919872', '-120.001278', NULL, 0, '', 0, '0', 7, 4, 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-18 22:54:01', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:54:01', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('ec0e31de-78d4-06b4-5150-55355de51df2', 'RA402-Eagle''s Nest', 'ra402-eagle-s-nest-1', 'Lovely home in Tahoe Donner with open, light living area, plenty of room for one or more families. You may bring the pets (with prior approval).\nThe driveway can be icy and slippery in the winter months and can be difficult to get up even with a 4WD vehicle. We recommend a 4WD vehicle + chains for entry when ice is present, or parking at the bottom of the driveway (be sure to park off the road and off the neighbor''s driveway)\n\nWhat a delightful Tahoe Donner vacation retreat! This 3 bedroom, 2.5 bath home will sleep 10 comfortably.Main level (upstairs): Master bedroom: Queen bed. Master bath with shower/jacuzzi tub, dual sinks. Living room: open and inviting with wood fireplace, TV/DVD, game table and reading chair, plus pull-out sofa with seating for 6+. Dining area: seating for 6. Entrance to attached garage. 1 bay open for guests. Entrance to back deck with gas BBQ (summer use only)Downstairs: Bedroom 2: Queen bed. Bedroom 3: 1 bunk bed (Twin and Double) plus additional Twin (total sleeping for 4). Full bathroom with shower/tub. Half bathroomLoft: Queen futon with small TVThe driveway is short but very steep. Can be icy and slippery in the winter months and can be difficult to get up even with a 4WD vehicle. 4WD vehicle only + chains for entry when ice is present, or parking at the bottom of the driveway for 1 car only (be sure to park off the road and off the neighbor''s driveway). Hi Speed Wireless Internet! (connection cannot be guaranteed). Access to Tahoe Donner amenities (for nominal fee) including Rec center with work-out facility pools and hot tub, downhill ski area (perfect for teaching kids), cross country ski area, equestrian center, tennis center, 18-hole golf and driving range, hiking, and so much more. Mins from downtown Truckee. Approx. 20 mins to Sugarbowl ski area, 30 mins to Squaw, 15 mins to Northstar, and 40 mins to Lake Tahoe This home comes complete with full kitchen and all linens/towels.\n\n**No Smoking** ***Pets allowed with prior approval*** The majority of guests must be over the age of 25.', 'United States', 'California', 'Truckee', '', '', '96161', '39.357024', '-120.223562', NULL, 0, '', 0, '0', 5.5, 3, 2.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '631c13a2-1961-0d99-7cd7-553184a48eb8', 1, 1, 'Y', 'N', 0, '2015-04-20 22:10:59', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:10:59', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('ec329062-f132-aec7-60d6-5532b99761df', 'RA81-Presidio Terrace Lower Unit', 'ra81-presidio-terrace-lower-unit', 'Please note : this Property requires a 30 day minimum stay\n\nOur Presidio Terrace is a large and elegant flat located in one of San Francisco''s most prestigious and serene neighborhoods. The property is located one block from the Presidio and is within walking distance of the upscale Laurel Village commercial district. In the other direction is one of the City''s thriving Chinatowns with unique shopping and dining opportunities.Presidio Terrace offers the guest plenty of room to spread out. There is a large living room with a working fireplace. The living room opens on to the formal dining room. There is a pantry, which acts as a passageway to the kitchen. The kitchen is fully equipped with all appliances, including a dishwasher, and a full set of dishes and cooking equipment. Adjacent to the kitchen is a laundry room with a washer and dryer.The master bedroom has a King sized bed and boasts great views to the South towards Twin Peaks. The master has a private bathroom and a deck. The second bedroom is also large and has a Queen and access to the deck. There are two more bedrooms, one with a double bed and one with a single bed. There are also two more full bathrooms.Presidio Terrace offers a unique opportunity of staying in a truly historic district with ample space and comfort. It is ideal for a family or small group traveling together.For larger groups, rent this unit along with the Presidio Terrace Upper Unit.\n\nNo parking available', 'United States', 'California', 'San Francisco', '', '', '94118', '37.789357', '-122.458895', NULL, 0, '', 0, '0', 6, 4, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-18 22:07:51', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:07:51', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('eccd70c4-3896-a277-6a2f-55356aa5251e', 'RA496-Forest Creek Comfortable 2 Bedroom Condo with Hot Tub', 'ra496-forest-creek-comfortable-2-bedroom-condo-with-hot-tub', 'This comfortable, two bedroom condominium is perfect for couples or families. There is a fully equipped kitchen, TV, VCR, telephone (local calls only), BBQ, wireless internet, and woodstove (firewood provided). Both master bedrooms are located on the first level with queen size beds in each. The living room has a sofa sleeper. This unit is non-smoking and has two unassigned outside parking spaces. If you are staying with us on a Monday, please be aware that the spa company will be by to clean the Jacuzzi. Spa Notice: Due to the possibility of accident or injury,the manager, children under the age of 18 from using hot tub. Tenant and its guests acknowledge that use of hot tub is at their own risk to injury and damage from the chemicals used to keep hot tubs sanitary which may cause fading in some swimsuits and some individuals may experience mild skin rashes; pregnant women and people with heart conditions or pace-makers are not allowed use of the hot tub and enter it at their own risk and agree to hold manager harmless. ', 'United States', 'California', 'Mammoth Lakes', '', '', '93546', '37.640909', '-118.976787', NULL, 0, '', 0, '0', 5, 2, 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 23:07:35', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 23:07:35', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('ee0edb84-2d08-6de3-4028-5532b9b51f38', 'RA78-Central Victorian 2 Bedroom', 'ra78-central-victorian-2-bedroom', 'Please note : this Property requires a 30 day minimum stay\n\nThis charming, two-bedroom, Victorian style apartment is a pleasant combination of modern convenience and casual comfort. Located in beautiful Buena Vista Park, it is just a few blocks away from the vibrant Haight Street shopping area where you will find numerous restaurants, clothing boutiques, coffee shops, bars, and a variety of other retail stores. Also within walking distance are many memorable San Francisco attractions including the California Academy of Sciences, the De Young Museum, the Conservatory of Flowers, and the Japanese Tea Gardens.\n\nThe apartment itself has a spacious living room complete with a wood-burning fireplace and a pull-out, Queen-sized couch, as well as a dining area overlooking Golden Gate Park—one of the jewels of San Francisco. The unit also includes a large kitchen, a small breakfast area, and an office that opens onto a stairway which will take you to the backyard. The master bedroom has a Queen-sized bed and a window with a view of downtown San Francisco. The second bedroom has a pull-out couch, allowing it to be used as either a bedroom or a sitting area. The apartment also provides wireless, broadband internet access so that you can stay connected on your vacation.\nIf you have a larger party, you can also check out the nearby properties of Central Victorian 1 Bedroom and Central Victorian Lower.\n\nStreet parking', 'United States', 'California', 'San Francisco', '', '', '94117', '37.769055', '-122.443357', NULL, 0, '', 0, '0', 3, 2, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-18 22:07:06', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:07:06', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('ef339f21-2046-9584-619e-553556b3b8f3', 'RA407-Glenrock Town Home', 'ra407-glenrock-town-home', 'You''ll love this cute and cozy, economy rated 3 bedroom town home at Glenrock. This great rental is just steps away from the community swimming pool (summer only) and the Golf Course.The property has been partially remodeled and thoughtfully decorated, and includes high speed wireless internet access (subject to connectivity). In addition to the on-site swimming pool, you''ll enjoy access to Incline''s exclusive, private beaches and 2 world class golf courses. Diamond Peak ski area, the Hyatt resort casino, and excellent dining and shopping are also just minutes away! This is a perfect rental for your budget minded summer or winter Lake Tahoe vacation getaway.The home is nicely furnished and equipped, with all the cookware and linens you''ll need to relax and enjoy a memorable experience in gorgeous Lake Tahoe. Downstairs you''ll find the cozy living room with a gas fireplace on a stone hearth, comfy sofas, TV with DVD player, and access to the gas BBQ (summer only) on the back patio, set among large granite boulders.The dining area and kitchen are also downstairs, along with a half bath and laundry area with washer/dryer. All 3 bedrooms are upstairs. The master bedroom offers a king bed, TV, writing desk, and attached full bathroom. The 2nd bedroom and 3rd bedrooms each have a full sized bed and tasteful furniture. There is also another full bathroom with tub and shower upstairs.This home comes with IVGID beach passes, allowing guests to access Incline Village''s renowned private beaches for a daily use fee. Guests must bring the provided passes to the entry kiosks where the entry fee is charged. One of the two beaches offers beach volleyball, swimming pool and snack stand. Use of the boat launch is also available with the beach pass. Please note- there is no garage available for this home. There are 2 assigned parking spaces available with this property.Book 3 nights and get the 4th free (excluding holiday weeks). ', 'United States', 'Nevada', 'Incline Village', '', '', '89451', '39.260709', '-119.944050', NULL, 0, '', 0, '0', 5.5, 3, 2.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '631c13a2-1961-0d99-7cd7-553184a48eb8', 1, 1, 'Y', 'N', 0, '2015-04-20 21:41:50', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:41:50', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('efd4992b-e105-4583-3a5e-55355c64d3b5', 'RA359-Elegant 3br Daly City House with View', 'ra359-elegant-3br-daly-city-house-with-view-1', 'This 3br, 2ba home is located in Daly City, just south of San Francisco''s Southern Hills border, only 10 minutes from vibrant SF neighborhoods.Enjoy your vacation in an elegantly decorated, beautifully maintained house with a spacious, modern, fully equipped kitchen.  2 bedrooms have queens, 1 bedroom has a full, and a twin-sized air mattress is available for the 7th guest.This house is a few miles from the coolest restaurants, cafes, shops, theaters and others attractions of San Francisco. Very private, quiet, great location. Stylish and comfortable with all amenities including wireless internet.15 minutes from Dolores park and the hip 20/30-something Valencia corridor with top restaurants, coffee houses, and clubs. Also nearby is Noe Valley, Castro and Mission. Noe Valley is a quaint, young family shopping area; the Castro is the gay capital of the West Coast with nightlife, shops, bars and cafes. The Mission is a young, vibrant neighborhood with a 20''s/30''s crowd, bustling with bars, clubs, interesting shops, restaurants and galleries.The house is conveniently located 10 minutes from San Francisco International Airport and 20 minutes to Embarcadero, Financial District, Moscone Center, Yerba Buena Gardens, Union Square shopping and Civic Center -- with its historic buildings, museums, SF Opera House, Davies Symphony Hall, and more.\n\nOther notes:Pets Not AllowedNon Smoking OnlyCooking UtensilsRefrigeratorParking For RV/Boat/TrailerLinens ProvidedVideo Game Console', 'United States', 'California', 'Daly City', '', '', '94014', '37.707273', '-122.435722', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '84074c2f-7cba-b5fd-c906-55317d9a4878', 1, 1, 'Y', 'N', 0, '2015-04-20 22:05:24', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:05:24', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('f07ba3b3-2463-4ca9-7905-5532c0e61e5a', 'RA228-Creatively Decorated Basque Golf Course Home', 'ra228-creatively-decorated-basque-golf-course-home', 'Just Remodeled spacious kitchen with Granite Counter tops! This bright, beautiful 4 bedroom home is located on the golf course in Northstar. Includes a gas log fireplace, 2 color TV''s, 1 VCR, micro jetted bath, and a steam shower in the master bath. It features a living room upstairs as well as a nice family room downstairs. Extra sleeping in a small room off the family room with 1 Twin. This creatively decorated home has 3508 square feet of luxurious space waiting to be filled by you! Plus, this property includes access to the NorthStar HomeOwners Swim and Racquet Club. ', 'United States', 'California', 'Truckee', '', '', '96161', '39.285646', '-120.111968', NULL, 0, '', 0, '0', 8, 4, 4, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '631c13a2-1961-0d99-7cd7-553184a48eb8', 1, 1, 'Y', 'N', 0, '2015-04-18 22:38:29', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:38:29', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL);
