('f194f1c1-a254-7de3-bf85-553550843563', 'RA345-Chauvet Condo 2B', 'ra345-chauvet-condo-2b', 'Hotel Chauvet was originally built in 1906 and celebrated its centennial with a spectacular restoration and renovation, painstakingly accomplished over two years. The result is a historic landmark building with six luxurious vacation rentals, rejuvenated with locally made brick and reappointed by craftsmen, while upscale interior and state-of-the art amenities have been added.The lodging experience at The Chauvet is truly unique! Each unit is generously sized at almost 2,000 square feet. The large master bedrooms include a huge walk-in closet. The other two bedrooms in each unit are spacious as well. Both baths boast designer fixtures but the master features a jetted tub and separate glass enclosed shower with massage jets and rainhead.The kitchen would please any gourmet, and is outfitted with custom cabinetry, stainless steel appliances, granite counter tops, wine cooler and commercial-style gas cooktop, among other delights. Of course, if you don''t want to cook for yourself, you are just steps away from Glen Ellen''s "restaurant row" with a myriad of delicious choices... or walk across the street to Glen Ellen''s own gourmet market.A brief walk south brings you to Jack London Village with the local cheesemonger, chocolate shop (made on site), olive press and market, fantastic deli, market of locally produced gourmet items and another tasting room. Add to this vision the lovely outdoor, heated pool with sundeck patio, accessible from your own wide balcony off the master bedroom, and the views of the surrounding hillsides and native oak trees from every large picture window framed by brick arches.You will be more than comfortable at The Chauvet at any time of year, with energy efficient air conditioning and heating, a gas fireplace, full soundproofing, elevator access and private garage.The unit features: 3 bedrooms, master with king sized bed, 2nd bedroom with queen and the 3rd bedroom with a king sized bed that can convert to two twins upon request in five of the units. Queen sized sofa bed in living room of Unit 1B. 3rd bedroom in 2B only features a twin day bed with a pop up trundle (which can be made up as an Eastern king on request), couch and chaise. 2 luxurious bathrooms - the master has jetted tub, glass enclosed shower with shower panel featuring rain head and massage jets along with European style hand heldAmple closet space throughout, walk-in closet in master bedroomGourmet kitchen and formal dining space, with every amenityGas fireplace in living room, energy efficient central heat and air conditioningHeated outdoor pool surrounded by sun deckWide, private balcony with dining table & chairs, propane BBQWireless internet accessCable with expanded channels and on-demand movies (and a TV in each bedroom and living room)Designer furnishings and dramatic artwork from local artistsPaintings by local artists are exhibited in the unitsSumptuous beds with luxurious linens, thick & thirsty towels and robesElevator access, intercom, covered parking in private garageWasher & dryer in the unitCentral location to wineries & tasting rooms, restaurants, farmers'' and gourmet markets - walk or bike within the charming village of Glen EllenLess than a mile from Jack London State ParkIncluded with your stay are complimentary:a bottle of wine and chocolatescookies in the cookie jarcoffee, tea, juice, yogurt, granola and fresh fruitwine passes for six to Arrowood, Chateau St. Jean, Gary Farrell and Taft Street Wineryreserve tastings at Cline and Jacuzzi2 for 1 tastings at Buena Vista, Geyser Peak, Gundlach Bundschu, and Ravenswoodupgraded tastings at LedsonSonoma Valley B & B Association passport for complimentary tastings for each guest at 25+ Sonoma Valley wineries\nPlease note: The pool is open year-round, however is not heated Nov. 1 through May. 14, per County regulations.\n\n Rates reduced for longer stays: Peak 4-5 nights $595/night, 6+ nights $550/night.  Off peak 3-5 nights $495/night, 6+ nights $450/night.  Balance will be adjusted with the final billing.You can also view Condo 1A, Condo 1B, Condo 2A, Condo 3A, and Condo 3B. for larger groups or other available dates. TOT 848N, 849N', 'United States', 'California', 'Glen Ellen', '', '', '95442', '38.362343', '-122.525923', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-20 21:17:42', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:17:42', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('f1bbcb00-10df-fff0-2fdc-55355463de64', 'RA389-Brockway Shores Charmer', 'ra389-brockway-shores-charmer', 'This 3 bedroom, 2.5 bathroom, split level lakefront townhouse sleeps 6 and has an open floor plan to accommodate your gathering. Located in beautiful Brockway Shores, this unit is nestled amongst the tall trees and grassy lawn of the expansive picnic area.Stroll down the back steps to the HOA private beach, or pull your boat up to the pier to take your friends on an evening cruise. Go kayaking or fishing right from the back deck! Go hiking on nearby conservancy land and enjoy refreshments while having a BBQ in the summer.In winter, go snowshoeing for epic views of the lake, or ski at the many nearby resorts. Take in the spectacular views that incorporate the landscape of the lake and mountains...year ''round! This property has an ideal location! Just a few blocks walk along a safe, quiet neighborhood to the heart of downtown Kings Beach''s restaurants, dining, and shopping. The gorgeous sandy beaches are just down the street, with sand-court volleyball and kayak rentals.Cool down with soft-serve ice cream while playing a round of mini-golf or enjoy live music and taco specials after a round of 9-hole golf! Dine on hearty steaks and salad bars lakeside, or be amazed by award-winning all-you-can-eat sushi. There''s even a local movie theater! Just a short drive to the stateline casinos and music venues, there''s year-round fun and activities for the entire family!This split-level condo features, on the downstairs level, a Master bedroom with a King bed, 24"TV/VCR/DVD/Stereo with private bath, and a second bedroom with 2 twins, small TV/VCR and bathroom with Jacuzzi tub. Upstairs is the 3rd bedroom with a Queen and half bath. The Kitchen has granite counters and a 3 person bar. The Living room has a leather sofa, fireplace, 52" HDTV/DVD/Stereo, and the Dining room has seating for 8. Buoys are available for rent so bring your boat (subject to availability).Only 10 minutes from Northstar, this townhouse has HOA private lake access, pier, and picnic area. Walking distance to downtown Kings Beach and beautiful sandy beaches, and nearby to award-winning restaurants and boutique shopping as well as shops for kayaks, skis, and snowboards. Please note: Hi-speed internet access is shared; subject to availability. Book 3 nights and get the 4th free (excluding holiday weeks).No Smoking. No pet. ', 'United States', 'California', 'Kings Beach', '', '', '96143', '39.231617', '-120.015611', NULL, 0, '', 0, '0', 5.5, 3, 2.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '47c5f833-e196-bff0-ff99-55317f87896f', 1, 1, 'Y', 'N', 0, '2015-04-20 21:34:18', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:34:18', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('f2723e74-f084-f5bc-f523-553567a37ee2', 'RA441-Sierra Shores', 'ra441-sierra-shores', 'This beautiful condo features plush furnishings, rich wood accents, a gourmet kitchen, and the unparalleled luxury of lakefront access. With three flat screen TV''s, hi-end appliances, and an incredible sandy beach with pier, this home will accommodate your perfect Tahoe vacation! Concierge Service is readily available on site upon request to assist with dinner reservations, ski equipment fittings and rental, on site private chef, on site massage therapy, sled ride reservations, boat and water activity reservations, hiking and horse back riding and more. Inn Keepers and staff are very knowledgeable about the area and can assist with all activities and local information. One of the few Handicap Accessible Vacation Rentals in Lake Tahoe, featuring level wheelchair access and a full Ada approved bathroom. Master suite - King with private bath and 42" Flat TV Bedroom 2 - Queen with 36" Flat TV Bathroom 2 Bedroom 3 - Queen with 36" Flat TV Bathroom 3 This condo is Ada approved on one level with garage right next to the unit, special shower access, 1.5" lower counters and refrigerator...even the hot tub has a special Ada approved lift. Everyone should enjoy such comfort and luxury! .\n\nPrivate sandy beach with pier -Beautiful landscaped grounds -Private heated pool, hot tub, and gym. Centrally located just minutes to Heavenly Valley Ski area! Heated walkways and drive ways during winter months keep snow clear for easy access. Gated property in the heart of South Lake...nearby restaurants and shopping! Enjoy the nightlife of the casinos, yet stay secluded in this private setting! This home comes complete with full kitchen and all linens and towels. **No Smoking**No Pets** Internet connection available, although not guaranteed. This is the convenience and luxury that will help make your dream Tahoe vacation come true! Property amenities include direct beach access, on site resident Inn-Keeper, assigned enclosed parking.', 'United States', 'California', 'South Lake Tahoe', '', '', '96150', '38.945636', '-119.968520', NULL, 0, '', 0, '0', 6, 3, 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', 'd3e20359-89bd-8249-981e-553180c9fde7', 1, 1, 'Y', 'N', 0, '2015-04-20 22:52:25', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 22:52:25', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('f27a5daa-e134-1fb9-2475-5532c74c8585', 'RA316-Mandala', 'ra316-mandala', 'Great, open, and bright 4 bedroom, 3 bath condo. A perfect vacation spot.\n\nGorgeous lake views from the deck -- just a few feet to Lake Tahoe! Enjoy the pool, hot tub, and tennis courts located right at the unit, or cozy up in the living room in from of a widescreen TV with cable and a DVD player.\n\n\nAmenities\nDVD player, Lake View, Parking, Ski, Stereo, Telephone, TV(s), Vacuum Cleaners, Washer/Dryer, Lake Nearby, Skiing Nearby, Golf Nearby, Boating, Games, Horseback Riding, Balcony, Outdoor Furniture, Fully Equipped Kitchen, Grill, Linens, Hi Def Television, Satellite/Cable Television, Wireless Internet, Adventure, Shopping, Photography, Gambling, Child Friendly, Elderly Friendly, Groups, No Smoking, No Pets, Heat Only, Community Pool, Community Hot Tub, Community Tennis, Designated Parking, Books, Skiing, Cycling, Mountain Biking, Water Skiing, Diving, Surfing, Wind-Surfing, Para-gliding, Swimming, Roller Blading, Tennis, Horse Riding, Sailing, Walking, Terrace, Fishing, Golf', 'United States', 'California', 'Tahoe City', '', '', '96145', '39.183668', '-120.118018', NULL, 0, '', 0, '0', 7, 4, 3, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', 'd3e20359-89bd-8249-981e-553180c9fde7', 1, 1, 'Y', 'N', 0, '2015-04-18 23:08:14', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 23:08:14', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('f2bc3418-a15d-8e67-bfa8-5532bbcb2cfb', 'RA156-Koru Lodgette', 'ra156-koru-lodgette', 'This lovely country home makes a great rental for groups of up to 11 people with a full kitchen, two baths, three bedrooms, and a total of eight different beds—one queen, two doubles, and five twins. Enjoy the beauty of the woods around the property with a delicious meal out on the patio using the charcoal barbeque. Have a hot mug of coffee in the fresh air on a quiet morning, or gather about the wood-burning fireplace inside for a cozy evening of fun. With everything from a stereo and cable/satellite television to a piano and a ping pong table, this house has everything that you could need for a few relaxing days in Lake Tahoe.Not far from this Lodgette is Fallen Leaf Lake, a beautiful and more private lake surrounded by mountains and forests with plenty of hiking trails, kayaking, a general store, and more. Go a little further and you will find Paradise Park and Lake Baron, a popular wedding destination because of its amazing sites with a majestic view of the Sierra mountains in the distance. The Heavenly ski resort is less than half an hour’s drive away, as is the Lake Tahoe airport if you’re flying to Tahoe for your vacation.House in the county with wireless internet.', 'United States', 'California', 'South Lake Tahoe', '', '', '96150', '38.862646', '-120.041315', NULL, 0, '', 0, '0', 5, 3, 2, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '6ef94489-c1e9-74a4-5c28-5531797f5596', 1, 1, 'Y', 'N', 0, '2015-04-18 22:17:19', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:17:19', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('f3d28fd4-e8b7-76aa-e9f5-5532b9b6abd1', 'RA65-Noe Valley Studio', 'ra65-noe-valley-studio', 'The Noe Valley Studio is a newly remodeled property that is designed for comfort and convenience. Located on a lovely tree lined street in the middle of Noe Valley, the Studio is less than a block from numerous restaurants, shopping opportunities, and public transportation - but still exudes a residential neighborhood ambiance. The Noe Valley Studio has all of the amenities required for a longer stay and at the same time is ideal for a brief vacation.As you enter the unit you will find a very comfortable mid-sized studio apartment. The cozy kitchen is complete with a stove and refrigerator. There is an intimate dining table for two and a small closet for storage. The tall ceilings and abundant light make for a spacious feel to this studio apartment.The building has a laundry room and large backyard.  Whether you are in San Francisco on vacation or business, seeing family or visiting the sights, our Noe Valley Studio is an ideal location for your stay in the City!\n\nNo parking available', 'United States', 'California', 'San Francisco', '', '', '94131', '37.748312', '-122.426152', NULL, 0, '', 0, '0', 3, 2, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', 'b1667c1f-9e1f-85f3-9682-55317452e139', 1, 1, 'Y', 'N', 0, '2015-04-18 22:05:21', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-18 22:05:21', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL),
('f3ef98c0-0bcb-fd79-125e-553557a1b68b', 'RA429-St. Croix', 'ra429-st-croix', 'This adorable cabin is the perfect mountain getaway. It set set up for entertaining a large group and comes with so many amenities.\n\nThe entry level of this home includes living room, dining room and kitchen. There is also a gas fireplace, TV/DVD, cable and wireless internet. The kitchen has everything you may need for creating a feast and serving it up with style. There is a half bath in the hall across from the first Bedroom which has a Queen bed (sleeping for 2). The master bedroom is right next door with a Queen bed, TV and an attached bathroom with shower/tub. There is a Pak-n-Play in the closet as well. The second floor has a loft with a TV which open over the living room and 2 small beds suitable for kids. There are two bedrooms, one has a Queen bed and another one has 2 Twin beds (sleeping for 2). These rooms share a bathroom with a fuly shower/tub.\n\nThis home comes with a full kitchen and all linens and towels, and hi-speed wireless Internet access. 2 car garage along with slightly sloped driveway which can fit 4 cars are other available amenities. For summer guests, there is charcoal BBQ available.\n\nThis home comes with access cards to the Tahoe Donner HOA amenities including Beach Club Marina, Tennis Club, Golf, Equestrian center, Rec center with Fitness room, pools, hot tubs, and both cross-country and downhill skiing. Book 3 nights and get the 4th free (excluding holiday weeks).\n\n\n', 'United States', 'California', 'Truckee', '', '', '96161', '39.360380', '-120.241053', NULL, 0, '', 0, '0', 6.5, 4, 2.5, 0, NULL, NULL, NULL, NULL, NULL, NULL, '', 'd0933b68-f3a3-e93c-c66b-54fc71b7f63f', '631c13a2-1961-0d99-7cd7-553184a48eb8', 1, 1, 'Y', 'N', 0, '2015-04-20 21:48:09', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', '2015-04-20 21:48:09', 'aef53301-4dd6-8eaf-1a91-54de51715b8f', NULL, NULL);
